INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Aneuploidy','Aneuploidy','A chromosomal abnormality in which there is an addition or loss of chromosomes within a set (e.g., 23 + 22 or 23 + 24).',2558223,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Aldolases','ALDOLASE','ALDOLASE',2561871,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Insulin','Insulin','(IN-su-lin) A hormone made by the islet cells of the pancreas. Insulin controls the amount of sugar in the blood by moving it into the cells, where it can be used by the body for energy.',2561935,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Calcitonin','Calcitonin','Encoded by human CALCA Gene (Calcitonin Family) 32-aa 3.4-kD secreted Calcitonin polypeptide hormone is cleaved from a large polyprotein precursor synthesized by thyroid parafollicular cells. Opposite to the effect of PTH Calcitonin induces a rapid drop in blood calcium and phosphate level by promoting bone incorporation. (NCI)',2563590,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PTGIS','Prostaglandin I2 (prostacyclin) synthase','http://www.gene.ucl.ac.uk/nomenclature/',2565758,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ERBB4','v-erb-a erythroblastic leukemia viral oncogene homolog 4 (avian) ','http://www.gene.ucl.ac.uk/nomenclature/',2565765,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Adenovirus','Adenovirus','nonenveloped ds-DNA in single linear molecule at least 10 polypeptides assembly of virus particle in nucleus of usually one host transmission by direct or indirect contact with urine or feces in throat or eye.',2567448,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Bacteroides','Bacteroides','A genus of bacteria within the phylum Bacteroidetes consisting of gram-negative bacilli or cocco-bacilli that comprise a major portion of the human normal flora predominating in the intestinal tract.',2567456,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CMV (Cytomegalovirus)','Cytomegalovirus','widely occurring intracellular herpesvirus characterized by narrow host specificity and slow reproduction (latency); causes a variety of pathologies in mammals including AIDS related oculopathy in humans.',2567474,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EBV (Epstein-Barr Virus)','Epstein-Barr Virus','isolated from Burkitts lymphoma of African children; a widely occurring human infection mainly of children; primary infection of young adults causes infectious mononucleosis.',2567477,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Lactobacillus','Lactobacillus','A genus of Gram-positive facultative anaerobic or microaerophilic bacteria in the phylum Firmicutes.',2567497,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IgM (Immunoglobulin M)','IgM','The major immunoglobulin secreted during a primary immune response.  IgM binds with low affinity but high avidity (multiple binding sites) because it not only occurs as monomers but also as pentamers and hexamers.',2568587,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Beta-carotene','Beta Carotene','A vitamin A precursor. Beta carotene belongs to the family of fat-soluble vitamins called carotenoids.',2569626,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Estrogen Receptor','Estrogen Receptor','Widely expressed human Estrogen Receptors (NR3 Family) are ligand-activated nuclear hormone receptor transcription factors composed of an N-terminal transcription activation/modulation domain a DNA-binding domain and a C-terminal steroid-binding domain. Binding to DNA as a homo- or heterodimer ESR interacts with NCOA3 NCOA5 and NCOA6 coactivators. Hormone-ESR complexes appear to recognize discrete upstream target ERE DNA sequences to regulate gene expression cell proliferation and differentiation. DNA-binding is lost in the absence of ligand. (NCI)',2572015,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Transflutaminase','Transflutaminase','Transflutaminase',2574315,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('YES1 (Yamaguchi sarcoma viral oncogene homolog 1, Yes, c-yes HsT441)','YES-1 Oncogone','The gene product of oncogene YES-1 is associated with tyrosine kinase activity and its amino acid sequence shows high similarity with that of SRC. Multiple copies of YES-related genes occur in the human genome. Oncogene YES-1 is located at 18p11.31-p11.21.',2575795,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Estrone','Estrone','One of three naturally occuring estrogens synthesized from androstenedione in the adrenal glands and peripheral tissues by aromatization and is the primary estrogen produced after menopause.(NCI)',2576306,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Estrone sulfate (E1S)','Estrone-Sulfate','An aqueous substance that is the sulfate salt form of estrone. (NCI)',2576307,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Estradiol','Estradiol','Estradiol (E2). beta-estradiol; 17 beta-estradiol; 135(10)-estratriene-317 beta-diol; the most potent naturally occurring estrogen in mammals formed by the ovary placenta testis and possibly the adrenal cortex; therapeutic indications for estradiol are those typical of an estrogen. alpha-Estradiol (17 alpha-estradiol) exhibits considerably less biologic activity. Estradiol is used in the treatment of menstrual disorders menopause problems etc. SYN estrogenic hormone oestradiol.',2576827,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('1,25(OH)2D (Calcitriol)','Calcitriol','A synthetic physiologically-active analog of vitamin D specifically the vitamin D3 form.  Calcitriol regulates calcium in vivo by promoting absorption in the intestine reabsorption in the kidneys and along with parathyroid hormone regulation of bone growth.  A calcitriol receptor-binding protein appears to exist in the mucosa of human intestine. Calcitriol also induces cell cycle arrest at G0/G1 phase of the cell cycle cell differentiation and apoptosis resulting in inhibition of proliferation of some tumor cell types.  This agent may be chemopreventive for colon and prostate cancers. (NCI04)',2577779,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('glutamine','Glutamine','A nonessential amino acid. Glutamine can donate the ammonia on its side chain to the formation of urea (for eventual excretion by the kidneys) and to purines (necessary for the synthesis of nucleic acids). Glutamine may become a conditionally essential nutrient during certain catabolic states. (NCI04)',2577904,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Circulating cell-free DNA','Circulating cell-free DNA','Circulating cell-free DNA',2578098,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Interferon, beta (IFN&#946;)','Interferon Beta','A class of interferon elaborated by fibroblasts.',2578175,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Interferon,alpha (IFN-&#945;)','Interferon Alpha','A class of interferon (leukocyte interferon) produced predominantly by B lymphocytes.  Located in a cluster on 9p22 there are at least 13 functional genes and 1 pseudogene.',2578176,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IFNG (Interferon,gamma)','Interferon Gamma','Interferon gamma (IFNg) is produced by activated T cells and is an important immunoregulatory molecule particularly in allergic diseases.',2578177,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL1 (interleukin-1, IL-1)','Interleukin-1','Human interleukin-1 protein (271 aa 31 kD precursor) is encoded by the human interleukin-1 (IL1) gene. This soluble protein is produced primarily by monocytes and macrophages. It activates and potentiates T-lymphocyte responses to mitogens or antigens. This protein is also capable of replacing macrophage requirements for T-cell activation',2578187,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL12','Interleukin-12','Exhibiting a broad range of biological activities on T and natural killer cells Interleukin-12 is a disulfide-bonded heterodimeric cytokine composed of a 35-kD IL12A subunit (IL-6 Superfamily) and a 40-kDa IL12B subunit (Type I Cytokine Receptor 3 Family). IL12 stimulates T-cell-independent production of IFN-gamma by PBMCs enhances NK cell lytic activity acts as a growth factor for T- and NK-cells and is important for Th1 and Th2 cell differentiation. Lymphocyte responses to IL12 require NOS2A and are mediated by STAT4 activator of transcription. (NCI)',2578188,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL3 (interleukin 3 (colony-stimulating factor, multiple); MULTI-CSF, MGC79399 MGC79398 MCGF IL-3)','Interleukin-3','Human interleukin-3 (152 aa 17 kDa precursor) is encoded by the human interleukin-3 (IL3) gene. This protein is a potent growth-promoting cytokine that enhances the ability of the immune system to fight tumor cells. IL-3 supports proliferation of many hematopoietic cell types. It is involved in cell growth differentiation and apoptosis in addition to possessing neurotrophic activity. Abnormalities in this protein may be associated with neurologic disorders.',2578189,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL6','Interleukin-6','Interleukin-6 (IL-6) a glycoprotein produced by activated T-cells and a variety of other cells induces the production of IgM by B-cells and can be used to replace feeder cells for the growth and maintenance of B-cell hybridomas in vitro.',2578190,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Lutein','Lutein','Lutein (LOO-teen) is a oxygenated carotenoid found in vegetables and fruits.  lutein is found in the macula of the eye where it is believed to act as a yellow filter. Lutein acts as an antioxidant protecting cells against the damaging effects of free radicals.',2578249,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Lycopene','Lycopene','A linear unsaturated hydrocarbon carotenoid the major red pigment in fruits such as tomatoes pink grapefruit apricots red oranges watermelon rosehips and guava.  As a class carotenoids are pigment compounds found in photosynthetic organisms (plants algae and some types of fungus) and are chemically characterized by a large polyene chain containing 35-40 carbon atoms; some carotenoid polyene chains are terminated by two 6-carbon rings.  In animals carotenoids such as lycopene may possess antioxidant properties which may retard ageing and many degenerative diseases.  As an essential nutrient lycopene is required in the animal diet. (NCI04)',2578250,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('VEGF','Vascular Endothelial Growth Factor','A substance made by cells that stimulates new blood vessel formation.',2579523,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Testosterone','Testosterone','(tes-TOS-ter-own) A hormone that promotes the development and maintenance of male sex characteristics.',2579543,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Androgen Receptor (AR, AIS, NR3C4, SMAX1)','Androgen Receptor','Encoded by human AR Gene (NR3 Family) the Androgen Receptor transcription factor regulates gene expression cell proliferation and differentiation. AR has 3 domains: N-terminal modulating (exon 1) DNA-binding (two C4 Zinc fingers exons 2-3) and C-terminal hormone-binding (5 remaining exons). Polymorphic N-terminal poly-Gln tracts bind RAN enhancing transactivation; decreased with increased poly-Gln length. An 87-kD (AR-A) isoform lacks a normal N-terminus seen in the 110 kD (AR-B) form; A and B may differ in function. Ligand bound receptor translocates to the nucleus homodimerizes binds DNA and stimulates transcription. Polyglutamine expansion causes Kennedys disease. Other mutations are associated with androgen insensibility syndrome. (from LocusLink Swiss-Prot OMIM and NCI)',2580426,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PSA','Prostate-Specific Antigen','Alternate isoforms of the single-chain 261-aa 30-kD Kallikrein 3 (Prostate Specific Antigen) glycoprotein precursor are encoded by human KLK3 Gene (Kallikrein Family). Frameshifted isoform 2 has a shorter distinct C-terminus. A serine protease in seminal plasma PSA may function in liquefaction of seminal coagulum by (preferential Tyr-X) cleavage of seminal vesicle protein. Kallikrein proteases have diverse functions. Mounting evidence implicates kallikreins in carcinogenesis; some have potential as cancer biomarkers. The serum level of PSA is useful in diagnosis and monitoring of prostatic carcinoma. (from LocusLink Swiss-Prot OMIM and NCI)',2580427,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LXR','Liver-X Receptor','Liver-X Receptor',2580604,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LDL','Low Density Lipoprotein','Low-density lipoprotein (LDL) is a lipoprotein that carries cholesterol around the body for use by various cells.  LDL transports cholesterol to the arteries and increased levels are associated with atherosclerosis and thus myocardial infarctions and strokes. This is why cholesterol inside LDL lipoproteins is called bad cholesterol. (from Wikipedia)',2580606,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HDL','High Density Lipoprotein','High density lipoproteins are the smallest and densest lipoproteins and contain a high proportion of protein. They are synthesized in the liver as empty proteins and they pick up cholesterol and increase in size as they circulate through the bloodstream.  Because HDL can remove cholesterol from the arteries and transport it back to the liver for excretion they are seen as "good" lipoproteins. (from Wikipedia)',2580607,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CRP (C-Reactive Protein, pentraxin 1, PTX1)','C-Reactive Protein','C-reactive protein [precursor] (224 aa ~25 kDa) is encoded by the CRP gene. This protein is cleaved during biological activation and is associated with host defense mechanisms and inflammatory responses.',2580608,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('T cells','T-Lymphocyte','One type of white blood cell that attacks virus-infected cells foreign cells and cancer cells.  T cells also produce a number of substances that regulate the immune response.',2581332,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Monocyte','Monocyte','Large phagocytic mononuclear leukocytes produced in the vertebrate bone marrow and released into the blood; contain a large oval or somewhat indented nucleus surrounded by voluminous cytoplasm and numerous organelles.',2581333,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DHT','Dihydrotestosterone','The most potent androgen required for sex development. Dihydrotestosterone is synthesized from testosterone in the prostate gland testes hair follicles and adrenal glands by 5-alpha reductase. Dihydrotestosterone exerts its action similar to testosterone which binds to and activates specific nuclear androgen receptors.  After translocation into the nucleus the activated hormone-receptor complex binds to the androgen response elements on the DNA and activates gene expressions that are required for sex development. Dihydrotestosterone is responsible for the formation of male primary sex characteristics and most male secondary sex characteristics during puberty such as muscular growth facial and body hair growth and deepening of the voice.',2581417,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IGF-1','Insulin-Like Growth Factor 1','Elevated serum levels of insulin-like growth factor-1 (IGF-1) may identify premenopausal women who are likely to develop breast cancer before age 50. (from Int J Cancer 2000;88:828-832 via Medscape)',2581421,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GSTP1 (glutathione S-transferase pi 1, GSTP, GST3 FAEES3)','Glutathione S-Transferase Pi','GST-pi is the anionic isozyme of glutathione S-transferase.  GST enzymes play an important role in detoxification by conjugating hydrophobic and electrophilic compounds with reduced glutathione.  GST-pi appears to be present in all tissues with the exception of red blood cells and is over expressed in multidrug-resistant cells.  GST-pi may be fatty acid ethyl ester synthase III a heart enzyme that nonoxidatively metabolizes ethanol.  (from OMIM 134660 and NCI)',2581424,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CEACAM5 (CEA, CD66e, carcinoembryonic antigen-related cell adhesion molecule 5)','Carcinoembryonic Antigen','Carcinoembryonic antigen. A substance that is sometimes found in an increased amount in the blood of people with certain cancers.',2633456,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('beta-HCG (Human Chorionic Gonadotropic Beta)','Human Chorionic Gonadotropin Beta Subunit','The beta subunit of human chorionic gonadotropin. It is used as a clinical marker to facilitate early detection of normal pregnancy and significantly contributes to the diagnosis of various pregnancy-related disorders, such as ectopic pregnancy, spontaneous abortion, hydatidiform mole, choriocarcinoma, or Trisomy 21. Further, determination of this marker is immensely helpful to guide curative intervention in testicular cancer. Other possible clinical uses includes as a marker of cancers of the bladder, pancreas, or biliary tract. (Scan J Clin Lab Invest Suppl 1993;216:97-104)',2633458,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AFP (FETA, alpha-fetoprotein)','Alpha-Fetoprotein','Alpha-fetoprotein. A protein normally produced by a developing fetus. AFP levels are usually undetectable in the blood of healthy nonpregnant adults. An elevated level of AFP suggests the presence of either a primary liver cancer or germ cell tumor.',2633460,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cancer Antigen 19.9 (CA 19.9, CA 19-9)','CA19-9 Antigen','A carbohydrate antigenic moiety that consists of proteins with sialylated lacto-N-fucopentose II decoration. Cancer antigen 19-9 (CA 19-9) is a protein that exists on the surface of tumor cells, and is cleaved in a process called tumor shedding. Clinically, it is a useful protein marker that is used to follow the course of persons with cancer; and is especially utilized in advanced pancreatic cancers.',2633462,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Erythropoietin (EPO)','Erythropoietin','Glycoprotein hormone, secreted chiefly by the kidney in the adult and the liver in the fetus, that acts on erythroid stem cells of the bone marrow to stimulate proliferation and differentiation.',2644085,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NK cells (Natural Killer cells)','Natural Killer Cell','White blood cells that attack tumor cells and body cells that have been invaded by foreign substances.',2644709,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IgG (Immunoglobulin G)','IgG','An immunoglobulin isotype (subclass) that characterizes secondary immune responses.  This isotype is further broken down into several smaller subclasses (IgG1, IgG2a, IgG2b, IgG3 in the mouse; IgG1-4 in the human), and each subclass is differentially synthesized and secreted into the serum upon differential immune stimuli.',2658037,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IgA (Immunoglobulin A)','IgA','IgA is the immunoglobulin subclass that is associated with antibody-mediated mucosal immunity.  It is secreted as dimers into the mucosa and is the most effective isotype at fixing complement by the alternative pathway, even though it lacks the ability to fix complement by the classical pathway. There are two subtypes in the human - IgA1 and IgA2.',2658038,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IgD (immunoglobulin D)','IgD','An immunoglobulin isotype (subclass).  This isotype is expressed on naive B cells along with IgM.  Little is known about its physiologic role.',2658039,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('L-Selectin','Selectin L','L-Selectin is a cell surface glycoprotein adhesion molecule that serves as a homing receptor for lymphocytes to lymph node high endothelial venules.  The molecule is composed of multiple domains: one homologous to lectins, one to epidermal growth factor, and two to C3/C4 binding protein consensus repeat units.  L-Selectin may also play a role in neutrophil adhesion to endothelium at sites of inflammation.  A tissue-specific mucin-like endothelial glycoprotein appears to function as ligand for L-selectin, in the role of scaffold that presents carbohydrates to the L-selectin lectin domain.  PLAUR is directly associated with the carbohydrate-binding domain of L-selectin in the membrane of neutrophils, an association analogous to that between PLAUR and beta-2 integrins.  (from OMIM 153240 and NCI)',2664826,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cyclin E1 (CCNE1, CCNE, cyclin Es, cyclin Et, EL1)','Cyclin E1','Cyclin E1, a protein encoded by the CCNE1 gene, forms a complex with and functions as a regulatory subunit of CDK2, whose activity is essential for the control of the cell cycle at the G1/S (start) transition. Cyclin E1 accumulates at the G1-S phase boundary and phosphorylation by CDK2 triggers its release from CDK2 and degradation. Overexpression of this gene is observed in many tumors, which results in chromosome instability and may contribute to tumorigenesis. Cyclin E1 is associated with and involved in the phosphorylation of NPAT protein (nuclear protein mapped to the ATM locus), which participates in cell-cycle regulated histone gene expression and plays a critical role in promoting cell-cycle progression in the absence of pRB. Two isoforms, E1L and E1S, are produced by alternative splicing and E1S cannot complex with CDK2. Cyclin E1 is highly expressed in testis and placenta with low levels in bronchial epithelial cells. (NCI)',2666642,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('P53','Tumor Protein p53','A homo-tetrameric, DNA-binding, trans-activator of genes involved in cell division. p53 induces growth arrest or apoptosis and is mutated or inactivated in about 60% of cancers. JNK-p53 and mdm2-p53 complexes regulate ubiquitination and degradation of p53. (from SWISS-PROT P04637, OMIM 191170, and NCI)',2669809,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BRCA1 ("breast cancer 1, early onset", BRCC1, PPP1R53, RNF53)','BRCA1 Gene','Tumor suppressor genes located on human chromosome 17q12-21. The mutation of these genes is associated with the formation of familial breast and ovarian cancer.',2669812,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BRCA2 ("breast cancer 2, early onset", BRCC2, FAD, FAD1)','BRCA2 Gene','BRCA2 putatively functions as a tumor suppressor gene, however, its exact function has not been well characterized. The similarity of, and functional analysis of, BRCA2 and BRCA1 proteins, suggests that these proteins function in the same genetic pathway. BRCA1 and BRCA2 have transcriptional activation potential and the two proteins are associated with the activation of double-strand break repair and/or homologous recombination. The two proteins have been shown to coexist and colocalize in a biochemical complex. (from LocusLink)',2669813,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('C3 (complement component 3, CPAMD1)','Complement Component 3','Complement Component 3, encoded by the C3 gene plays a central role in the activation of complement system. Its activation is required for both classical and alternative complement activation pathways. People with C3 deficiency are susceptible to bacteria infection. (From LocusLink)',2749013,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Antinuclear Antibody (ANA)','Antinuclear Antibody','An autoimmune antibody that is directed against structures within the nucleus of the cell.',2749018,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('7-Aminoactinomycin D (7-AAD; 7-Amino-actinomycin D; 7-Amino-AMD)','7-Aminoactinomycin D','A fluorescent nucleic acid dye which selectively binds GC sequences in double-stranded DNA. It has a molecular weight of 1270.5, an absorbance maximun at 546 nm, and emission maximum at 647 nm. It is commonly used to discriminate viable from non-viable cells.',2760416,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Trisomy 4 (Trisomy of Chromosome 4)','Trisomy 4','A chromosomal abnormality consisting of the presence of a third copy of chromosome 4 in somatic cells.',2762294,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MS4A1 (CD20, B1, Bp35, MS4A2, IGER, APY, FCER1B)','CD20 ','Expressed during B-cell ontogeny (early pre-B-cell to plasma cell) by human CD20 Gene (MS4A Family), 297-aa 33-kDa CD20 Antigen is a phosphorylated cell surface integral membrane protein shown to participate in B-cell proliferation, development, and differentiation into plasma cells. MS4A family proteins share structural similarity, sequence homology, and unique expression patterns among hematopoietic cells and nonlymphoid tissues. MS4A proteins contain 4 highly conserved transmembrane domains, flanked by N- and C-terminal cytoplasmic regions. CD20 may be involved in regulation of B-cell activation and may be regulated by protein kinases. (NCI)',2802760,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD3','CD3 Complex','Consisting of cell surface type I membrane Delta, Epsilon, Gamma, Zeta, and Eta protein subunits with ITAM domains and noncovalently associated with the disulfide bound heterodimeric alpha/beta and gamma/delta TCR, the CD3 complex couples receptor antigen recognition to signal transduction pathways during T-cell activation. During TCR engagement with MHC-associated antigen on host cell surfaces and synapse formation, CD3 activity leads to Tyr-phosphorylated CD3 subunits, Tyr phosphorylation of LAT colocalized in lipid rafts, and MAPK activation. CD3 signal transduction appears to involve LCK, ZAP70, Nck, SLA, SLA2, and DOCK2. CD3 subunits may also associate with the cytoskeleton. CD3 also mediates TCR signal transduction during the developmental transition through positive selection of immature thymocytes to mature CD4+ or CD8+ T cells. (NCI)',2802761,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('T-cell functionality','T-Lymphocyte Function','One type of white blood cell that attacks virus-infected cells, foreign cells, and cancer cells.  T cells also produce a number of substances that regulate the immune response.: Function; what something is used for.',2815217,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HLA-A2','HLA-A2 Antigen','Encoded by human HLA-A (A2 allele) Gene (HLA Family), HLA-A2 Antigen is a 365-aa 41-kD class I alpha heavy chain glycoprotein heterodimerized with 11.6-kD beta-2 microglobulin. HLA-A protein organization includes a signal peptide, extracellular alpha1, 2, and 3 domains (90-aa each), a transmembrane region, and a cytoplasmic tail. Polymorphic alpha1 and 2 domains determine peptide binding specificity. Ig-like alpha3 mediates CD8 binding on cytotoxic T-lymphocytes. In the immune response, HLA antigens mediate antigen presentation to TCR. HLA-A2 subtypes are associated with decreased risk of HIV-1 infection and increased frequency of early-onset Alzheimer disease.  (from LocusLink, Swiss-Prot, OMIM, and NCI)',2829702,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HLA-C','HLA-C Antigens','MSH2005_2004_10_12',2829704,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HLA-DP','HLA-DP Antigen','HLA-DP antigen is a class of glycoproteins that consist of dimers of alpha and beta subunits, which are encoded by the polymorphic human genes HLA-DPA1 and HLA-DPB1, respectively. This protein complex is expressed primarily in lymphoid cells and function to present antigens for CD4+ T lymphocytes. ',2829705,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HLA-DQ','HLA-DQ Antigen','HLA-DQ antigen is a class of glycoproteins that consist of dimers of alpha and beta subunits, which are encoded by the polymorphic human genes HLA-DQA1 and HLA-DQB1, respectively. This protein complex is expressed primarily in lymphoid cells and function to present antigens for CD4+ T lymphocytes. Certain HLA-DQ protein variants are associated with susceptibility to insulin-dependent diabetes mellitus and several autoimmune diseases. ',2829706,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HLA-DR4 (HLA-DR4 Antigen)','HLA-DR Antigen','Encoded by multiple HLA-DRA and HLA-DRB genes in a complex variable 5 cM region of MHC between HLA-B and -D, HLA-DR Antigens are Class II histocompatibility transmembrane glycoprotein heterodimers of alpha (heavy, 35-kD) and beta (light, 27-kD) chains. Located predominantly on B cells and macrophages, HLA-DR antigens function in antigen presentation to regulatory T cells in the immune response and in self/nonself discrimination. Invariant alpha and polymorphic beta chains have glycosylated N-termini, hydrophobic membrane regions, and hydrophilic C-termini. The heterodimer consists of 4 extracellular domains; invariant alpha-1, polymorphic N-terminal beta-1, and conserved Ig-like alpha-2 and beta-2. Alpha-1 and alpha-2 contain disulfide loops. Beta-1 contains 2 small variable regions. Alpha sequences have relatively simple structure; beta chains carry the major polymorphic determinants. (NCI)',2829707,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('White blood cell count (WBC, Leukocyte count)','Leukocyte Count','A test to determine the number of leukocytes in a sample of blood.',2833093,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Magnesium (Magnesium Measurement)','Magnesium Measurement','A quantitative measurement of the amount of magnesium present in a sample.',2833096,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('N-Cadherin','N-Cadherin','Human Neural-cadherin is encoded by the CDH2 gene. The gene product is 906 amino acids and ~100kD in size. This protein plays a role in calcium-dependent cell adhesion.',2901295,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CDH1 (E-Cadherin, "cadherin 1, type 1, E-cadherin (epithelial)", CD324, uvomorulin)','E-Cadherin','Encoded by human CDH1 Gene (CDH Family), 882-amino acid 97 kD (precursor) invasion suppressor type I membrane protein E-Cadherin is the main homodimeric Ca(2+)-dependent cell-cell adhesion glycoprotein in non-neural epithelia. Structurally similar to immunoglobulins, E-cadherin contains five extracellular cadherin repeats, a transmembrane region, and a conserved cytoplasmic tail required for internalization. E-Cadherin acts as ligand for integrin Alpha-E/Beta-7. CDH1 defects cause Familial Gastric Cancer. CDH1 mutations are correlated with breast, colorectal, thyroid, and ovarian cancer. E-cadherin down regulation often correlates with invasive potential and poor prognosis of human carcinomas; it is likely a main event in cancer proliferation, invasion, and metastasis, due to dysfunction of cell-cell adhesion.',2901297,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RELA','RELA Gene','This gene plays a role in transcriptional regulation and NFKB signal transduction.',2901300,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Lipid Peroxide (Lipid Oxidation, Lipid Peroxidation)','Lipid Peroxidation','The degradation of lipids caused by an oxidative attack from free radicals.',2915648,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Influenza A Virus','Influenza A Virus','A negative-strand linear single-strand RNA virus with an 8 segment genome. Virions are enveloped and usually spherical or pleomorphic, 80-120 nm in diameter. Subtyping is based on the antigenic properties of the hemagglutinin and neuraminidase proteins. Influenza type A viruses can infect people, birds, pigs, horses, and other animals, but wild birds are the natural hosts for these viruses.',2934600,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HPV (Human Papillomavirus)','Human Papillomavirus','Any of various papillomaviruses that infect the skin and mucous membranes of humans.sometimes progress to malignancy.',2934611,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LOH','Loss of Heterozygosity','genetic phenomenon due to deletion or mutation in one allele of a polymorphic gene, as detected by expression after cell fusion; used as a test for tumor-promoting mutations; do not confuse with "loss of heterogeneity" which applies to diverse cell populations within a tissue.',2934716,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('15-PGDH','15-Hydroxyprostaglandin Dehydrogenase [NAD+]','15-hydroxyprostaglandin dehydrogenase [NAD+] (266 aa, ~29 kDa) is encoded by the human HPGD gene. This protein is involved in prostaglandin metabolism.',2934718,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ALB (albumin)','Albumin','family of globular proteins found in many plant and animal tissues that tend to bind a wide variety of ligands.',2936741,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Philadelphia Chromosome (Ph) t(9;22) (q34;q11)','Philadelphia Chromosome','An abnormality of chromosome 22 in which part of chromosome 9 is transferred to it.  Bone marrow cells that contain the Philadelphia chromosome are often found in chronic myelogenous leukemia.',2939336,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Urinary PGE-M','Urinary prostaglandin E metabolite','Encoded by human PTGS1 Gene (PGHS Family), alternative constitutive homodimeric monotopic ER membrane Prostaglandin-Endoperoxide Synthase 1 isoforms contain an EGF-like domain and identical N/C-regions: long (599-aa, 69-kD precursor) and short (562-aa). Additional glycosylated gene products with altered (uncleaved) signal peptide, COX3 and PCOX1A (lacking COX activity), reside in cell membranes. Rate-limiting in prostaglandin and thromboxane synthesis, bifunctional PTGS1 appears involved in cell signaling, angiogenesis, and tissue homeostasis. PGH COX activity converts arachidonate to PGG2; PGH peroxidase converts PGG2 to PGH2. COX1 is inhibited by NSAIDs such as aspirin (irreversible ser529 acetylation). (from LocusLink, Swiss-Prot, OMIM, and NCI): Having to do with urine or the organs of the body that produce and get rid of urine.: Any substance involved in metabolism, either as a product of metabolism or as necessary for metabolism. ',2950663,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Urinary LTE4','Urinary Leukotriene E4','Having to do with urine or the organs of the body that produce and get rid of urine.: A family of biologically active compounds derived from arachidonic acid by oxidative metabolism through the 5-lipoxygenase pathway. They participate in host defense reactions and pathophysiological conditions such as immediate hypersensitivity and inflammation. They have potent actions on many essential organs and systems, including the cardiovascular, pulmonary, and central nervous system as well as the gastrointestinal tract and the immune system.',2950665,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HPV-18 (Human Papillomavirus-18)','Human Papillomavirus-18','A strain of the human papillomavirus virus, (HPV18), has been directly linked to cervical cancer and plays a role in the pathogenesis of the disease. The papillomavirus virus constitutes a protein coat (capsid) surrounding a circular, double-stranded DNA organised into coding and non-coding regions, and induces skin and mucosal epithelial lesions. The virus integrates its DNA at specific chromosomal locations, such as 8q24 and 12q15, which harbours both HPV18 and HPV16. The use of molecular markers such as HPV18 DNA type may allow the identification of patients with early stage cervical cancer at high risk for disease recurrence.',2958894,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ERCC1','ERCC1 Gene','This gene is involved in nucleotide excision repair.',2964454,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Activated Caspase 3 (ActCasp3, cleaved caspase 3, CC3)','ActCasp3','ActCasp3',2964457,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL8','Interleukin-8','A member of the CXC chemokine family. This chemokine is one of the major mediators of the inflammatory response. This chemokine is secreted by several cell types including monocytes, macrophages, T-lymphocytes, fibroblasts, endothelial cells, and keratinocytes. It functions as a chemoattractant, and is also a potent angiogenic factor. (from LocusLink)',2965046,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Mesothelin','Mesothelin','Mesothelin (630 aa, ~69 kDa) is encoded by the human MSLN gene. This protein may play a role in cellular adhesion.',2986773,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TOP2 (topoisomerase (DNA) II alpha 170kDa, TOP2)','Topoisomerase II Alpha','Involved in chromosome condensation and segregation, topoisomerase II alpha is a homodimer that controls DNA topology by transient ATP-dependent double-strand breakage and rejoining.  Topoisomerase II alpha is also associated with the Pol II holoenzyme and required for chromatin-dependent co-activation and productive RNA synthesis.  (from OMIM 126430 and NCI)',3009655,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MKI67','Proliferation-Related Ki-67 Antigen','Antigen Identified by Monoclonal Antibody Ki-67, encoded by the MKI67 gene, is a nuclear antigen expressed in proliferating cells but not in quiescent cells, and required for maintaining cell proliferation. Expression of this antigen occurs preferentially during late G1, S, G2, and M phases of the cell cycle, while in cells in G0 phase the antigen cannot be detected. Consequently, the monoclonal antibody Ki-67 is used in tumor pathology to detect proliferating cells in neoplastic diseases. This antigen is located in the nucleus, predominantly localized in the G1 phase in the perinucleolar region. In the later phases it is also detected throughout the nuclear interior, being predominantly localized in the nuclear matrix. In mitosis, it is present on all chromosomes. This antigen contains 1 FHA domain. Two alternative splicing forms exist, Long and Short. (from Swiss-Prot)',3009658,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('P21 (CDKN1A, cyclin-dependent kinase inhibitor 1A, CIP1, WAF1, SDl1, CAP20, p21CIP1, p21Cip1/Waf1)','Cyclin-Dependent Kinase Inhibitor 1','Cyclin-dependent kinase inhibitor 1 (164 aa, ~18 kDa) is encoded by the human CDKN1A gene. This protein is involved in cell cycle arrest.',3009660,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCND1 (cyclin D1, U21B31, PRAD1, P11S287E, BCL1)','G2/S-Specific Cyclin-D1','G1/S-specific cyclin-D1 (295 aa, ~34 kDa) is encoded by the human CCND1 gene. This protein is involved in the regulation of the G1/S transition of the cell cycle.',3009664,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cytokeratin','Cytokeratin','Cytokeratins are a family of cysteine-rich fibrous structural proteins that form tough filaments or sheets. These proteins are the main component of intermediate filaments in the epidermis, hair, nails, horny tissues, and the organic matrix of tooth ename',3027794,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Mucin','Mucin','An albuminoid substance containing mucopolysaccharides and protein which is contained in mucus, and gives to the latter secretion its peculiar ropy character. It is found in all the secretions from mucous glands, and also between the fibres of connective tissue, as in tendons.',3027795,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Omega-3 fatty acid','Omega-3 Fatty Acid','Any fatty acid that contains an unsaturated bond originating from the 3rd carbon from the methyl end. Omega-3 fatty acids do not occur naturally with chain lengths shorter than 16 carbon units.',3084633,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Omega-6 fatty acid','Omega-6 Fatty Acid','Essential fatty acids obtained from food sources that are necessary for normal biological functions, as well as growth and development.',3084635,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IFN (Interferon)','Interferon','Human interferons have been classified into 3 groups: alpha, beta, and gamma. Both alpha- and beta-IFNs, previously designated type I, are acid-stable, but they differ immunologically and in regard to some biologic and physiochemical properties. The IFNs produced by virus-stimulated leukocytes (leukocyte IFNs) are predominantly of the alpha type. Those produced by lymphoblastoid cells are about 90% alpha and 10% beta. Induced fibroblasts produce mainly or exclusively the beta type. The alpha- and beta-IFNs differ widely in amino acid sequence. The gamma or immune IFNs, which are produced by T lymphocytes in response to mitogens or to antigens to which they are sensitized, are acid-labile and serologically distinct from alpha- and beta-IFNs. (from OMIM 147570)',3119698,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SHBG','Sex Hormone-Binding Globulin','Expressed as 2 alternative isoforms in Sertoli cells and liver by human SHBG Gene, 402-aa 44-kDa (precursor) homodimeric Sex Hormone-Binding Globulin is a secreted beta-globulin plasma glycoprotein containing 2 laminin G-like domains that specifically bind 5-alpha-dihydrotestosterone, testosterone, or 17-beta-estradiol. An androgen transport protein, SHBG regulates the plasma metabolic clearance rate of steroid hormones by controlling plasma concentration and may be involved in receptor-mediated processes as well. (NCI)',3135435,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Maspin','Maspin (Serpin B5)','Serpin B5 (375 aa, 42 kD) is a cell motility process protein that is encoded by the human SERPINB5 gene and has a role in cell motility.',3135437,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cotinine','Cotinine','The major metabolite of nicotine.',3153633,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Platelet count','Platelet','platelet. An irregularly shaped disklike cytoplasmic fragment of a megakaryocyte that is shed in the marrow sinus and subsequently found in the peripheral blood where it functions in clotting. A platelet contains granules in the central part (granulomere) and, peripherally, clear protoplasm (hyalomere), but no definite nucleus; is about one-third to one-half the size of an erythrocyte; and contains no hemoglobin. (STED98)',3187289,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Leptin','Leptin','Leptin (167 aa, ~16 kDa) is encoded by the human LEP gene.  This protein is secreted by adipocytes and plays a role in the regulation of both appetite and body fat stores.',3189687,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Glucose','Glucose','A simple sugar monosaccharide having two isoforms, alpha and beta, with a chemical structure of C6H12O6 that acts as an energy source for both plants and animals by reacting with oxygen to form Carbon Dioxide and Water, releasing energy.(NCI)',3189689,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Adiponectin','Adiponectin','Adiponectin (244 aa, ~26 kDa) is encoded by the human ADIPOQ gene. This protein is involved in the modulation of both glucose metabolism and lipid homeostasis.',3189691,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Trisomy 12 (Trisomy of Chromosome +12)','Trisomy 12','A chromosomal abnormality consisting of the presence of a third copy of chromosome 12 in somatic cells.',3211500,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EGFR (HER-1; Epidermal Growth Factor Receptor Protein-Tyrosine Kinase; erbB-1; Proto-Oncogene c-erbB-1; Receptor Tyrosine-Protein Kinase erbB-1; Urogastrone Receptor; EGF Receptor: Epidermal Growth Factor Receptor; c-erbB-1; Epidermal Growth Factor Recept','EGFR Gene','The EGFR gene at chromosome 7p12.3-p12.1 encodes the EGFreceptor, a cell surface transmembrane protein tyrosine kinase involved in regulation of cell growth and differentiation. The gene is not expressed in mitotically quiescent cells, except in the stomach where it controls the synthesis and release of digestive enzymes and gastric acid. EGFR tyrosine kinase activity is required for internalization or degradation of EGF-EGFR receptor complexes. EGFR signaling involves small RHO GTPases and EGFR trafficking involves small RAB GTPases.',3216619,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('2-hour Postprandial Glucose','2 Hour Postprandial Glucose','A number with no fractional part.::2: In modern usage, an hour is defined as a unit of time 60 minutes, or 3600 seconds in length. It is approximately 1/24 of a median day.: After a meal.: A simple sugar monosaccharide having two isoforms, alpha and beta, with a chemical structure of C6H12O6 that acts as an energy source for both plants and animals by reacting with oxygen to form Carbon Dioxide and Water, releasing energy.(NCI)',3218878,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('2-hour Postprandial Insulin','2 Hour Postprandial Insulin','A number with no fractional part.::2: In modern usage, an hour is defined as a unit of time 60 minutes, or 3600 seconds in length. It is approximately 1/24 of a median day.: After a meal.: (IN-su-lin) A hormone made by the islet cells of the pancreas. Insulin controls the amount of sugar in the blood by moving it into the cells, where it can be used by the body for energy.',3218879,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Apoptotic index (AI)','Apoptotic Index','Pertaining to apoptosis.: Index; a numerical scale used to compare variables with one another or with some reference number.',3218881,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BLCA-4','BLCA-4','BLCA-4 is a bladder-specific, nuclear matrix protein.  Elevated levels of BLCA-4 in the urine may identify individuals with bladder cancer. (from J Urol 2000. 164:634-639 via Medscape)',3218884,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CHFR Methylation Index','CHFR Gene Methylation Index','This gene is involved in the mitotic checkpoint.: The attachment of a methyl group to a molecule. Usually refers to DNA methylation. The expression level of a gene is often regulated by its methylation state; expressed genes are usually hypomethylated. C0025723: Methylation : Index; a numerical scale used to compare variables with one another or with some reference number.',3218887,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Clusterin, normal tissue region','Clusterin Normal Tissue','Clusterin (449 aa, ~52 kDa) is encoded by the human CLU gene. This protein may be involved in lipid metabolism, complement regulation and the initiation of apoptosis.: Being approximately average or within certain limits; conforming with or constituting a norm or standard or level or type or social norm. (NCI): An anatomical structure consisting of similarly specialized cells and intercellular matrix, aggregated according to genetically determined spatial relationships, performing a specific function.',3218889,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Prostaglandin E2 (PGE2)','Prostaglandin-Endoperoxide Synthase 2','A rate-limiting enzyme in the conversion of arachidonic acid to prostaglandins, COX-2 is expressed in cells involved in inflammatory processes and has been implicated in tumor promotion as well as a negative prognosis.  COX-2 is expressed in 50% of pancreatic tumors.  Anti-inflammatory glucocorticoids are potent inhibitors of cyclooxygenase.  Inhibition or lack of COX-2 reduces tumor growth and blocks angiogenesis.  Aspirin and etodolac, both COX-2 inhibitors, inhibit growth of pancreatic cancer cell lines.  (from Cancer 2001. 91:333, Medscape, OMIM 600262, and NCI)',3218892,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ERBB2','HER2/neu','The ERBB2 Gene at 17q21.1 encodes ERRB2 Receptor Protein Tyrosine Kinase, a 185 kD type I membrane glycoprotein that controls cell growth with features similar to EGFR. Ligand binding increases phosphorylation of tyrosine residues. A potential heterodimer with ERBB3 and ERBB4 receptors, p185ERBB2 is an essential component of the heregulin/neuregulin receptor complex. ERBB2 homodimers do not bind heregulin but ERBB2/ERBB3 heterodimers do. Neuregulins do not interact with ERBB2 alone. The IL6 cytokine induces tyrosine phosphorylation of ERBB2 and ERBB3, but not EGFR. ERBB2 forms an IL6-dependent complex with the IL6R gp130 subunit resulting in MAPK activation. Expressed in fetal kidney and liver, herstatin is a 68 kD secreted product of an alternative ERBB2 transcript that retains intron 8. Herstatin binds p185ERBB2 as an inhibitor by disrupting ERBB2 dimers and reducing p185 tyrosine phosphorylation.  (from SWISS-PROT, OMIM and NCI)',3218910,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FHIT','FHIT Gene','This gene is involved in nucleotide metabolism and cell cycle control.',3218912,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('fPSA','Percent Free Prostate-Specific Antigen','PSA circulates in the blood in two forms: free or attached to a protein molecule.  With benign prostate conditions, there is more free PSA, while cancer produces more of the attached form.  A more accurate predictor of cancer than either a patients age or his total PSA level. (from Cancer Information Service)',3218913,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Gastrin','Gastrin','Gastrin (101 aa, ~11 kDa) is encoded by the human GAST gene. This protein plays a role in the modulation of food digestion by the gastrointestinal system.',3218915,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Glucagon','Glucagon','A pancreatic hormone consisting of 29 amino acids that causes increases in blood sugar levels by stimulating hepatic glycogenolysis and gluconeogenesis.',3218917,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IGFBP','Insulin-Like Growth Factor-Binding Protein','A family of soluble proteins that bind insulin-like growth factors and modulate their biological actions at the cellular level.  Serum IGFBP levels have been found to be negatively correlated to the risk of cancer.',3218921,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IGFBP3','Insulin-Like Growth Factor-Binding Protein 3','Insulin-like growth factor-binding protein 3 (291 aa, 32 kD) is a cell fate protein that is encoded by the human IGFBP3 gene and has roles in regulation of myoblast differentiation and regulation of apoptosis.',3218923,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Isoprostane','Isoprostane','A group of compounds similar to prostaglandins with immunomodulating activity. Isoprostanes are formed through free radical catalyzing non-enzymatic reactions involving peroxidation of essential fatty acids, mainly arachidonic acid or any other fatty acid with 3 or more double bonds. Isoprostanes are abundant in tissues and fluids and their concentration is dependent on the amount of oxidative stress and may be upregulated in certain diseases such as cancer, cardiovascular and neurological disorders.',3218937,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MAP Kinase (MAPK)','Mitogen-Activated Protein Kinase','Mitogen-activated protein kinases (MAPKs) are serine-threonine protein kinases activated in response to a variety of extracellular stimuli and encoded by a multigene family. The MAPKs are part of complex protein kinase cascades. One of the several classes of MAPKs includes (among other ERKs) the extracellular signal-regulated kinases ERK1 (p44MAPK) and ERK2 (p42MAPK), activated by the RAF/MEK/ERK signaling pathway. ERK1/2 are widely involved in eukaryotic signal transduction. Upon activation, ERKs translocate to the nucleus and phosphorylate nuclear targets. Phosphorylated ERKs form essential dimers with phosphorylated and unphosphorylated ERK partners. Dimerization is part of the mechanism of MAP kinase family action. Mitogen-activated protein kinases (MAPKs) promote entry in the cell cycle.  (from OMIM 601795, 176948, Swiss-Prot P27361, P28482 and N',3218942,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MAPKAP1 (mitogen-activated protein kinase associated protein 1, SIN1, MIP1, MGC2745)','Mitogen-Activated Protein Kinase 1','Encoded by Human MAPK1 Gene (MAPK Family) as alternative p40 and p41 isoforms, Mitogen-Activated Protein Kinase 1 is a proline-directed Ser/Thr kinase activated in response to extracellular stimuli and widely involved in signal transduction as an integration point for multiple biochemical signals and as part of complex protein kinase cascades involved in a cell proliferation, differentiation, transcription regulation, and development. Autophosphorylated and phosphorylated/activated by upstream kinases on threonine and tyrosine residues, MAPK1 forms dimers with phosphorylated and unphosphorylated ERK partners, translocates to the nucleus and phosphorylates target transcription factors. MAPK1 phosphorylates MAP2, MBP, and ELK-1. (NCI)',3218944,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MCM2','MCM2 Gene','This gene plays a role in the initiation of DNA replication. It is also involved in cell cycle control and cell proliferation.',3218948,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ALOX5 (arachidonate 5-lipoxygenase, 5-LOX)','Arachidonate 5-Lipoxygenase Normal Mucosa','Arachidonate 5-lipoxygenase protein (674 aa, ~78 kDa) is encoded by the human ALOX5 gene. This protein plays a role in the synthesis of leukotrienes from arachidonic acid; thus, it mediates both inflammation and allergen responses.: Being approximately average or within certain limits; conforming with or constituting a norm or standard or level or type or social norm. (NCI): The moist tissue that lines some organs and body cavities (such as the nose, mouth, lungs) and makes mucus (a thick, slippery fluid).',3218954,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BCL2 (Bcl-2, B-cell CLL/lymphoma 2, PPP1R50)','BCL2 gene','This gene is involved in apoptotic regulation. Overexpression of this gene promotes the pathogenesis of B-Cell lymphomas, due to anti-apoptotic activity.',3218958,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ERBB3','ERBB3 Gene','This gene is involved in signal transduction pathways that result in cellular proliferation or differentiation. The gene has also been associated with numerous cancers.',3218964,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('hK2','Glandular Kallikrein 2 Precursor','Glandular Kallikrein 2 isoforms 1 (261-aa, 28.7-kD prepropeptide), 2 (PGK-10A, 222-aa), 3 (164-aa) are encoded by human KLK2 Gene (Kallikrein Family). The mature serine protease is 237 amino acids. Glandular kallikreins comprise specific proteases involved in processing active peptides. KLK2 exhibits 66% and 73% homology with KLK1 and APS. Glandular kallikreins release vasoactive peptides from kininogen; the kininogenase activity of different kallikreins is highly variable. Kallikrein 2 cleaves kininogen Met-X, Arg-X, or Leu-X bonds to release lys-bradykinin (kallidin) involved in vasodilation and smooth muscle contraction. The physiologic role of specific kallikreins is often unrelated to the kininogenase activity. (from LocusLink, Swiss-Prot, OMIM, and NCI)',3218966,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HMG-CoA','3-Hydroxy-3-Methylglutaryl-Coenzyme A Reductase','3-hydroxy-3-methylglutaryl-coenzyme A reductase (888 aa, ~97 kDa) is encoded by the human HMGCR gene. This protein is involved in cholesterol synthesis.',3218968,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MGMT','O-6-Methylguanine-DNA Methyltransferase','enzyme that transfers methyl groups from O(6) methylguanine and other methylated moities of DNA, to a cysteine residue in itself, thus repairing alkylated DNA in a single step reaction',3218974,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MPIF-1','Small Inducible Cytokine A22','Expressed in macrophage, monocyte-derived dendritic cells, thymus, lymph node, appendix, activated monocytes, resting and activated macrophages, lung, small intestine, and spleen by human CCL22 Gene (Intercrine Beta Family), secreted immunoregulatory 93-aa 11-kD (precursor) Small Inducible Cytokine A22 is a chemotactic factor for monocytes, dendritic cells, natural killer cells, and activated T lymphocytes that binds to receptor CCR4 and may play a role in activated/effector T lymphocyte trafficking to inflammatory sites. (NCI)',3218976,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MUC5AC','MUC5AC Gene','This gene plays a role in the protection of the respiratory and gastrointestinal tracts.',3218978,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Neuron-specific enolase','Gamma-Enolase','Human gamma-enolase protein (433 aa, approximately 47 kD) is encoded by the ENO2 gene. This neuron-specific enzyme catalyzes the formation of pyruvate from D-glyceraldehyde 3-phosphate during glycolysis. It is involved in both neurotrophy and neuroprotection.',3218979,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NFKB2 (nuclear factor of kappa light polypeptide gene enhancer in B-cells 1, LYT-10, p52)','Nuclear Factor NF-kappa-B p100 Subunit','Nuclear factor NF-kappa-B p100 subunit (900 aa, ~97 kDa) is encoded by the human NFKB2 gene. This protein plays a role in both transcriptional regulation and signal transduction.',3218981,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CDKN1B (cyclin-dependent kinase inhibitor 1B (p27, Kip1); KIP1, P27KIP1)','Cyclin-Dependent Kinase Inhibitor 1B','Cyclin-dependent kinase inhibitor 1B (198 aa, ~22 kDa) is encoded by the human CDKN1B gene. This protein plays a role in cell cycle arrest.',3218983,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TP53','TP53 Gene','A tumor suppressor gene that normally inhibits the growth of tumors. This gene is altered in many types of cancer.',3218984,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PCNA','Proliferating Cell Nuclear Antigen','Proliferating cell nuclear antigen (261 aa, ~29 kDa) is encoded by the human PCNA gene. This protein is involved in the regulation of both DNA replication and DNA mismatch repair.',3218986,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PGE2-ACF','16,16-Dimethyl Prostaglandin E2 Aberrant Crypt Focus','A stable derivative of prostaglandin E2 (PGE2) with potential hematopoietic activity. Administration of 16,16 dimethyl-prostaglandin E2 (dmPGE2) appears to lead to increased formation of hematopoietic stem and progenitor cells. Even though the exact mechanism of action has yet to be fully elucidated, this agent may stimulate hematopoiesis by activating the Wnt signaling pathway, which increases cellular levels of beta-catenin, a subunit of the cadherin protein complex.: A larger than normal, microscopically elevated colonic crypt that may contain dysplastic epithelium.  It is considered as a possible precursor of colonic adenoma and carcinoma.',3218988,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PgR (progesterone receptor)','Progesterone Receptor','Indicates the progesterone receptor level measured in a primary tumor or in metastases. (>=10 is positive if measured in fmols/mg cytosol protein; Otherwise use institutional standards)',3218989,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ploidy Analysis','DNA Ploidy Analysis','A test used to measure nuclear deoxyribonucleic acid content (ploidy or multiplicity of the basic number of chromosomes) in a cell.',3218991,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PPARG','Peroxisome Proliferative Activated Receptor Gamma','Expressed as multiple variants in adipose tissue (highest), skeletal muscle, spleen, heart, liver placenta, lung, and ovary by human PPARG Gene (NR1/PPAR Family), nuclear Peroxisome Proliferative Activated Receptor Gamma heterodimerizes with RXRs and NCOA6 coactivator to regulate target gene transcription. A receptor that binds peroxisome proliferators, such as hypolipidemic drugs and fatty acids, PPARG is a key regulator of adipocyte differentiation and glucose homeostasis. Once activated by ligand, PPARG binds to an acyl-CoA oxidase gene promoter element, activates transcription, and controls the peroxisomal fatty acid beta-oxidation pathway. Defects in PPARG can lead to type 2 insulin-resistant diabetes and hypertension. (NCI)',3218992,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PTEN','PTEN Gene','This gene plays a role in signal transduction and apoptosis. It is also involved in the regulation of cell cycle progression.',3218993,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RAF1 (Raf-1, v-raf-1 murine leukemia viral oncogene homolog 1, CRAF, c-Raf)','RAF1 Gene','This gene is involved in cell growth, proliferation, differentiation and migration. It also plays a role in apoptosis.',3218995,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RARB','Retinoic Acid Receptor Beta','Encoded by human RARB Gene (NR1 Family), alternative isoforms of Retinoic Acid Receptor Beta (1-4) are composed of three domains: an N-terminal modulating domain, a central DNA-binding domain, and a C-terminal ligand-binding domain. RARB controls embryonic morphogenesis, cell proliferation, and differentiation by directly regulating gene transcription. RARB appears to limit growth of many cell types. (NCI)',3219001,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Somatostatin','Somatostatin','Expressed primarily by human SST Gene (Somatostatin Family) in the hypothalamic median eminence and in pancreatic delta cells, secreted 116-aa 13-kDa (precursor) Somatostatin is an important cyclic tetradecapeptide regulator of endocrine and nervous system function. Somatostatin inhibits release of adenohypophyseal GH, thyrotropin, and corticotropin, pancreatic insulin and glucagon, gastric mucosal gastrin, intestinal mucosal secretin, and renal renin by binding to specific high-affinity cell surface G protein-coupled receptors expressed in a tissue-specific manner. (NCI)',3219005,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Squamous Cell Carcinoma Antigen','Squamous Cell Carcinoma Antigen','A carcinoma derived from stratified squamous epithelium. It may also occur in sites where glandular or columnar epithelium is normally present. (From Stedman, 25th ed): Any substance that appears foreign or potentially adverse to the body and elicits immune response.',3219006,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Telomerase activity','Telomerase','A reverse transcriptase responsible for maintaining the telomere length of replicating cells. Telomerase recognizes a telomere-specific GC rich sequence and adds telomeric repeats by using and RNA template.',3219008,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Total Cholesterol','Serum Total Cholesterol Measurement','A quantitative measurement of the total amount of cholesterol present in a sample of serum.',3219011,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TUNEL','TdT-Mediated dUTP Nick End Labeling Assay','A method to detect apoptosis.',3219014,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PGE2-N1 mucosa','16,16-Dimethyl Prostaglandin E2 Nodal Stage I Mucosa','A stable derivative of prostaglandin E2 (PGE2) with potential hematopoietic activity. Administration of 16,16 dimethyl-prostaglandin E2 (dmPGE2) appears to lead to increased formation of hematopoietic stem and progenitor cells. Even though the exact mechanism of action has yet to be fully elucidated, this agent may stimulate hematopoiesis by activating the Wnt signaling pathway, which increases cellular levels of beta-catenin, a subunit of the cadherin protein complex.: Nodal; of or pertaining to a node, any bulge or swelling of an anatomical structure or part.: Invasive cancer confined to the original anatomic site of growth without lymph node involvement.: The moist tissue that lines some organs and body cavities (such as the nose, mouth, lungs) and makes mucus (a thick, slippery fluid).',3219015,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SNAIL protein','Snail Protein','No Value Exists: Any of a group of complex organic macromolecules that contain carbon, hydrogen, oxygen, nitrogen, and usually sulfur and are composed of one or more chains of amino acids. Proteins are fundamental components of all living cells and include many substances, such as enzymes, hormones, and antibodies, that are necessary for the proper functioning of an organism.',3219016,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CA 15.3','MUC-1 Antigen','MUC-1 antigen is a mammary-type apomucin, a high molecular weight transmembrane glycoprotein, of which the extracellular domain is formed by a repeating 20 amino acid sequence (in tandem) with a high content of serine and threonine on which are O-linked carbohydrate chains. MUC-1 synthesis and secretion are features of glandular epithelial tissues; MUC-1 is overexpressed in lactating breast and in breast, ovary, lung, and prostate malignancies.',3219018,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('1p deletion (del(1p), Loss of Chromosome 1p)','Loss of Chromosome 1p','A cytogenetic abnormality that refers to the allelic loss of the chromosomal arm 1p.  It has been described in gliomas, meningiomas, neuroblastomas, hepatocellular carcinomas, breast carcinomas, acinar prostate adenocarcinomas, pancreatic carcinomas, and adrenal gland adenomas.',3227260,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Mitotic Index','S-Phase Fraction','The percentage of cells in a sample currently undergoing mitosis.',3227312,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Circulating Tumor Cells (CTC)','Circulating Tumor Cell','A metastatic cancer cell found in the peripheral blood.',3227904,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Macrophages','Macrophage','A type of white blood cell that surrounds and kills microorganisms, removes dead cells, and stimulates the action of other immune system cells.',3228041,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ALDH1','Aldehyde dehydrogenase 1','Aldehyde dehydrogenase 1',3234072,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PARP1 (poly (ADP-ribose) polymerase 1, PARP)','PARP1 Gene','This gene is involved in cellular repair and apoptosis.',3234073,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RAD51C (RAD51 homolog C (S. cerevisiae); RAD51L2)','RAD51C Gene','This gene plays a role in DNA repair and meiotic recombination.',3234075,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Gamma-H2AX','Histone H2AX','Encoded by human H2AX Gene (H2A Family) and expressed unlinked to replication in G1 and S-phase, 142-aa basal Histone H2AX has a unique conserved C-terminal sequence, QASQEY. NBS1/phospho-H2AX (gamma-H2AX) associate with irradiation-induced and V(D)J-induced DNA double-strand breaks. In pre-thymocytes, NBS1/gamma-H2AX form at RAG1-mediated TCRA V(D)J cleavage sites. NBS1/gamma-H2AX facilitate AID-dependent DNA break repair in G1 cells undergoing Ig heavy-chain constant region class switch recombination. (from LocusLink, Swiss-Prot, OMIM, and NCI)',3234077,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ALK (Anaplastic Lymphoma Kinase)','Anaplastic Lymphoma Kinase','The 2;5 chromosomal translocation is frequently associated with anaplastic large cell lymphomas (ALCLs). The translocation creates a fusion gene consisting of the ALK (anaplastic lymphoma kinase) gene and the nucleophosmin (NPM) gene: the 3&amp;apos; half of ALK, derived from chromosome 2, is fused to the 5&amp;apos; portion of NPM from chromosome 5. A recent study shows that the product of the NPM-ALK fusion gene is oncogenic. The deduced amino acid sequences reveal that ALK is a novel receptor protein-tyrosine kinase having a putative transmembrane domain and an extracellular domain. These sequences are absent in the product of the transforming NPM-ALK gene.',3234588,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HHV-8 (Human Herpes Virus-8)','Human Herpesvirus 8','A type of herpesvirus that may cause Kaposi sarcoma (a rare cancer that can cause skin lesions) and a type of lymphoma (cancer that begins in the lymph system), especially in patients who have a weak immune system.',3234595,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PAX5 (paired box 5, BSAP, B-cell lineage specific activator)','Paired Box Protein Pax-5','Paired box protein Pax-5 (391 aa, ~42 kDa) is encoded by the human PAX5 gene. This protein plays a role in B-cell differentiation, neural development, spermatogenesis and gene transcription.',3234598,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('9p21','9p21','A chromosome band present on 9p',3234667,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('v-myc myelocytomatosis viral oncogene homolog (avian) (MYC)','MYC Gene','This gene plays a role in cell cycle progression and apoptosis. Cytogenetic aberrations in the gene are involved in cellular transformation and are associated with a variety of hematopoietic tumors, leukemias and lymphomas.',3236016,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('1,25-hydroxy vitamin D3 (Cholecalciferol)','Cholecalciferol','A steroid hormone produced in the skin when exposed to ultraviolet light or obtained from dietary sources. The active form of cholecalciferol, 1,25-dihydroxycholecalciferol (calcitriol) plays an important role in maintaining blood calcium and phosphorus levels and mineralization of bone. The activated form of cholecalciferol binds to vitamin D receptors and modulates gene expression. This leads to an increase in serum calcium concentrations by increasing intestinal absorption of phosphorus and calcium, promoting distal renal tubular reabsorption of calcium and increasing osteoclastic resorption.',3237531,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD15 (CD15 Antigen)','CD15 Antigen','A carbohydrate molecule found on the surface of neutrophils, eosinophils and monocytes. It is involved in neutrophil chemotaxis and phagocytosis. Expression of this antigen is associated with Hodgkin disease, chronic lymphocytic leukemia, and acute lymphoblastic leukemia.',3241851,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PDE5','cGMP-Specific 3,5-Cyclic Phosphodiesterase','cGMP-specific 3,5-cyclic phosphodiesterase (875 aa, ~100 kDa) is encoded by the human PDE5A gene. This protein plays a role in the mediation of cyclic GMP metabolism.',3243311,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('1p19q','Loss of Chromosomes 1p/19q','No Value Exists',3245810,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('8-hydroxydeoxyguanosine (8-OHdG)','8-Oxo-2-Deoxyguanosine','A type of altered DNA base caused by oxidative DNA damage.',3247824,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MUC1 (mucin 1, cell surface associated; PEM, PUM, CD227; mucin 1, transmembrane)','Mucin-1','Mucin-1 (1255 aa, ~122 kDa) is encoded by the human MUC1 gene. This protein plays a role in both signaling and cell adhesion.',3247832,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ACOX2 (acyl-CoA oxidase 2, BRCACOX, BRCOX)','Peroxisomal Acyl-Coenzyme A Oxidase 2','Peroxisomal acyl-coenzyme A oxidase 2 (681 aa, ~77 kDa) is encoded by the human ACOX2 gene. This protein is involved in the mediation of fatty acid oxidation and the synthesis of bile acid.',3251218,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Desmin (DES, CMD1I, CSM1, CSM2, intermediate filament protein)','Desmin','Desmin (470 aa, ~54 kDa) is encoded by the human DES gene. This protein is involved in the regulation of cytoskeletal dynamics in muscle cells.',3251222,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FTAse (Ftase activity)','Farnesyl Protein Transferase','A heterodimeric enzyme (alpha and beta subunits) that catalyzes the addition of farnesyl groups, as farnesyl diphosphate, to the C termini of proteins.',3251226,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Glut-1','Solute Carrier Family 2, Facilitated Glucose Transporter Member 1','Solute carrier family 2, facilitated glucose transporter member 1 (492 aa, ~54 kDa) is encoded by the human SLC2A1 gene. This protein plays a role in glucose transport.',3251228,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Involucrin','Involucrin','Involucrin (585 aa, ~68 kDa) is encoded by the human IVL gene. This protein plays a role in the keratinization of stratified squamous epithelia.',3251231,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('K1 cytokeratin','Keratin, Type II Cytoskeletal 1','Keratin, type II cytoskeletal 1 (644 aa, ~66 kDa) is encoded by the human KRT1 gene. This protein is involved in the development of the epidermis.',3251233,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KRT20','Keratin, Type I Cytoskeletal 20','Keratin, type I cytoskeletal 20 (424 aa, ~48 kDa) is encoded by the human KRT20 gene. This protein plays a role in the organization of keratins in the intestinal epithelium.',3251235,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PPARD','Peroxisome Proliferator-Activated Receptor Delta','Peroxisome proliferator-activated receptor delta (441 aa, ~50 kDa) is encoded by the human PPARD gene. This protein is involved in the regulation of ligand-activated transcription.',3251259,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Survivin','Baculoviral IAP Repeat-Containing Protein 5','Baculoviral IAP repeat-containing protein 5 (142 aa, ~16 kDa) is encoded by the human BIRC5 gene. This protein plays a role in the regulation of both apoptosis and the cell cycle.',3251266,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Thyroglob','Thyroid Antithyroglobulin Antibody','The determination of the amount of thyroid antithyroglobulin antibodies present in a sample.',3251267,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Transglutaminase','Transglutaminase','A family of enzymes that catalyze the formation of a covalent bond between the epsilon-amino group of a protein- or peptide-bound lysine and the gamma-carboxyamide group of a protein- or peptide-bound glutamine. These proteins are involved in the crosslinking of proteins in blood coagulation, skin formation and hair development.',3251271,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('8-iso-PGF2a','8-iso Prostaglandin F2alpha (8-iso-PGF2a)','A lipid peroxidation disease marker detected in the serum, biological fluids, and cell cultures using ELISA immunoassay kits. It is increased in patients with non-insulin dependent diabetes mellitus, coronary heart disease, and hypertension.',3251272,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FSHA','Follicle-Stimulating Hormone Alpha subunit','Follicle-stimulating hormone (FSH) is a hormone found in humans and other animals, synthesized and secreted by gonadotrophs of the anterior pituitary gland. The gene for the alpha subunit is located on chromosome 6p21.1-23, and is expressed in different cell types. (HGNC 1885)',3251820,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Antigen 43-9F','Tumor-associated Antigen 43-9','A novel tumor-associated carbohydrate epitope identified by the 43-9F monoclonal antibody and associated with the growth pattern of squamous cell lung carcinomas. Tumor-associated antigen 43-9F is used to differentiate between normal cells and cancer cells in tumor biopsy specimens.',3251884,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Calponin','Calponin','A family of actin and calcium binding proteins found mostly in smooth muscle-containing tissues. These proteins play a role in the regulation of actin/myosin interactions and the subsequent mediation of smooth muscle contraction.',3251885,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Microvessel density','Microvessel Density','The density of newly formed blood vessels in a tissue. Microvessel density can be used to describe the proliferation speed of a tissue, with higher density indicating faster tissue growth.',3251887,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Soluble Interleukin-2 Receptor','Soluble Interleukin-2 Receptor','An immunoassay that is used to determine the amount of soluble interleukin-2 receptor subunit alpha in a patient serum sample. High levels of the soluble form of the receptor can be indicative of hematological malignancies and other neoplastic disorders.',3251889,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ACTH (Adrenocorticotropic Hormone)','Adrenocorticotropic Hormone','A hormone secreted by the anterior portion of the pituitary gland and regulates hormone, primarily cortisol, secreted by the adrenal gland.(NCI)',3253517,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GnRH','Gonadotropin-Releasing Hormone Analog','(LOO-tin-eye-zing.AG-o-nist) LH-RH agonist.  A drug that inhibits the secretion of sex hormones.  In men, LH-RH agonist causes testosterone levels to fall.  In women, LH-RH agonist causes the levels of estrogen and other sex hormones to fall.',3253518,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AML1-ETO fusion protein','AML1-ETO Fusion Protein Expression','Expression of a fusion protein that results from a t(8;21)(q22;q22) translocation, which involves the human genes RUNX1 and RUNX1T1 and is associated with acute myeloid leukemia.',3257039,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Gli1 (GLI family zinc finger 1)','GLI family zinc finger 1','Zinc finger protein GLI1 (1106 aa, ~118 kDa) is encoded by the human GLI1 gene. This protein is involved in transcriptional regulation, cell differentiation and signaling pathway modulation.',3257598,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MSI1 (musashi homolog 1 (Drosophila), Musashi (Drosophila) homolog 1)','musashi protein, Drosophila','No Value Exists',3259358,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NOTCH IC (Notch intracellular domain)','NOTCH1 gene','This gene is involved in intercellular signal transduction that plays a key role in development.',3259360,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('numb','numb protein, Drosophila','No Value Exists',3259362,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('8-epi-PGF2a (8-epi-prostaglandin F2 alpha, 8-epi-PGF2alpha, 8-isoprostane, 8-isoprostaglandin F2alpha, 8-iso-PGF2a, 15-f2t-isoprostane, 15-F2t-IsoP)','8-epi-Prostaglandin F2 alpha','8-epi-Prostaglandin F2 alpha',3259363,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Phosphoinositide-3-kinase, catalytic, alpha polypeptide (PIK3CA)','Phosphoinositide-3-Kinase Catalytic Alpha Polypeptide','Phosphoinositide-3-Kinase, Catalytic, Alpha Polypeptide, encoded by the PIK3CA gene, belongs to the PI3/PI4-kinase family. Phosphatidylinositol 3 Kinase is a heterodimer of a P110 (catalytic) and a P85 (regulatory) subunit. It phosphorylates PTDINS, PTDINS4P and PTDINS(4,5)P2 with a preference for PTDINS(4,5)P2. (from Swiss-Prot)',3259371,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL1A (Interleukin-1, alpha; IL1F1, IL1-ALPHA, IL1, IL-1A)','Interleukin-1-Alpha','Interleukin-1-Alpha is one of two distinct forms of IL1 encoded by separate genes.  IL1(alpha) is the acidic form and IL1(beta) is the neutral form.  Synthesized by many cells including activated macrophages, keratinocytes, stimulated B-lymphocytes, and fibroblasts, IL1A and IL1B are potent mediators of inflammation and immunity.  Both forms, but particularly IL1B, are expressed in polymorphonuclear leukocytes stimulated with LPS.  Both IL1A and IL1B are potent bone resorbing factors.  Interleukin-1 is also involved in apoptosis.  Both IL1 forms are released as a consequence of cell injury.  (from OMIM 147760 and NCI)',3259373,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Mannose receptor, C type 2','MRC2 gene','No Value Exists',3259382,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Mannose receptor, C type 1','MRC1 gene','No Value Exists',3259384,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TNFAIP1','Tumor Necrosis Factor-Alpha','Tumor Necrosis Factor (TNF) - Serum glycoprotein produced by activated macrophages and other mammalian mononuclear leukocytes which has necrotizing activity against tumor cell lines and increases ability to reject tumor transplants. It mimics the action of endotoxin but differs from it. It has a molecular weight of less than 70,000 kDa.',3259385,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Nitric Oxide Synthase 2, inducible','Nitric Oxide Synthase Type II','A CALCIUM-independent subtype of nitric oxide synthase that may play a role in immune function. It is an inducible enzyme whose expression is transcriptionally regulated by a variety of CYTOKINES.',3259393,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ARG1 (arginase 1, liver arginase)','Arginase A1','No Value Exists',3259395,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL10','Interleukin-10','Expressed primarily in monocytes and less in lymphocytes by human IL10 Gene, Interleukin-10 is a cytokine with pleiotropic effects in immunoregulation and inflammation. It down-regulates expression of Th1 cytokines, MHC class II antigens, and costimulatory molecules on macrophages. It also enhances B cell survival, proliferation, and antibody production. This cytokine can block NF-kappa B activity, and is involved in the regulation of the JAK-STAT signaling pathway. Studies in mice suggest that this cytokine as an essential immunoregulator in the intestinal tract. (From LocusLink)',3259396,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HIF-2 alpha','EPAS1 (HIF-2 alpha)','No Value Exists: No Value Exists',3259398,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('macrophage stimulating 1 receptor (c-met-related tyrosine kinase, c-MET)','MST1R gene','This gene plays a diverse regulatory role in several processes such as: proliferation, migration, host defense and fertilization.',3259400,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL12B (natural killer cell stimulatory factor 2, cytotoxic lymphocyte maturation factor 2, p40)','IL12B Gene','This gene is involved in immunity/defense via the stimulation of both T cells and natural killer cells. It also plays a role in cell differentiation.',3259405,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL12A (natural killer cell stimulatory factor 1, cytotoxic lymphocyte maturation factor 1, p35)','Interleukin-12A','Interleukin-12 is a cytokine that acts on T and natural killer cells, and has a broad array of biological activities. The cytokine is a disulfide-linked heterodimer composed of the 35-kD subunit (Interleukin-12A encoded by the IL12A gene at 3p12-q13.2), and a 40-kD subunit that is a member of the cytokine receptor family. This cytokine is required for the T-cell-independent induction of interferon (IFN)-gamma, and is important for the differentiation of both Th1 and Th2 cells. The responses of lymphocytes to this cytokine are mediated by the activator of transcription protein STAT4. Nitric oxide synthase 2A (NOS2A/NOS2) is found to be required for the signaling process of this cytokine in innate immunity. (From LocusLink)',3259407,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('STAT3 (signal transducer and activator of transcription 3 (acute-phase response factor)','Signal Transducer and Activator of Transcription 3','Signal transducer and activator of transcription 3 (770 aa, ~88 kDa) is encoded by the human STAT3 gene. This protein plays a role in cytokine signaling and gene expression.',3259412,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cyclin B','Cyclin B','A cyclin subtype that is transported into the CELL NUCLEUS at the end of the G2 PHASE. It stimulates the G2/M phase transition by activating CDC2 PROTEIN KINASE.',3259429,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cyclin D3 (CCND3)','Cyclin D3','A broadly expressed type D cyclin. Experiments using KNOCKOUT MICE suggest a role for cyclin D3 in LYMPHOCYTE development.',3259431,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD34','CD34 Gene','This gene is involved in hematopoiesis; however, a specific physiological function has yet to be identified.',3259433,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('carbonic anhydrase IX (CA9, CAIX)','CA9 gene','No Value Exists',3259435,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Estrogen Receptor 1 (ER1)','Estrogen Receptor 1','Encoded by human ESR1 Gene (NR3 Family) as 2 alternative isoforms, Estrogen Receptor 1 is a ligand-activated nuclear hormone receptor transcription factor composed of an N-terminal transcription activation/modulation domain, a DNA-binding domain, and a C-terminal steroid-binding domain. ESR1 binds DNA as a homodimer or as a heterodimer with ESR2 and interacts with NCOA3, NCOA5, and NCOA6 coactivators. Hormone-ESR1 complexes appear to recognize discrete upstream target ERE DNA sequences to regulate gene expression, cell proliferation, and differentiation. Phosphorylated by cyclin A/CDK2 may enhances transcriptional activity. (NCI)','3259437','ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MMP1','MMP1 (matrix metallopeptidase 1)','This gene plays a role in cell migration, inflammation and the regulation of extracellular matrix remodeling.',3260388,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CASP9 (Caspase-9, caspase 9, apoptosis-related cysteine peptidase; APAF-3, ICE-LAP6, MCH6, PPP1R56)','caspase-9','Caspase-9 is encoded by the CASP9 Gene. Caspase-9 is the most upstream member of the apoptotic protease cascade that is triggered by cytochrome c and dATP. Caspase-9 and APAF1 bind to each other in the presence of cytochrome c and dATP, an event that leads to caspase-9 activation. Activation of procaspase-9 by APAF1 requires proteolytic cleavage to generate the mature caspase molecule. Activated caspase-9 in turn cleaves and activates caspase-3. APAF1-mediated processing of procaspase-9 occurs at asp315 by an intrinsic autocatalytic activity of procaspase-9 itself. APAF1 can form oligomers and may facilitate procaspase-9 autoactivation by oligomerizing its precursor molecules. Once activated, caspase-9 can initiate a biochemical cascade involving the downstream executioners caspase-3, -6, and -7. Alternative splicing of this gene results in two transcript variants which encode different isoforms. (From LocusLink, OMIM and NCI)',3260392,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BAX (BCL2-associated X protein, BCL2L4)','BAX gene','This gene is involved in the regulation of apoptosis by binding p53 protein, which accelerates this mechanism of cell death.',3260545,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IRS1','IRS1 gene','This gene plays a role in signal transduction and carbohydrate metabolism. It is involved in mediation of the insulin response.',3260547,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CXCR4 (CD184, D2S201E, fusin, HM89, HSY3RR, LESTR, NPY3R, NPYR, NPYY3R)','CXCR4 gene','This gene is involved in the mediation of viral entry into cells and cellular migration and chemotaxis.',3260551,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CYP3A4 ("cytochrome P450, family 3, subfamily A, polypeptide 4")','cytochrome P450, family 3, subfamily A, polypeptide 4 (CYP3A4 gene)','This gene plays an role in the metabolism of numerous clinically-relevant drugs. It is also involved in the oxidation of both endogenous substrates and xenobiotics.',3260559,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CYP3A5 ("cytochrome P450, family 3, subfamily A, polypeptide 5", CP35, P450PCN3, PCN3)','cytochrome P450, family 3, subfamily A, polypeptide 5 (CYP3A5 gene)','This gene is involved in the metabolism of fatty acids, steroids, drugs and xenobiotics. It also plays a role in the metabolism of sex hormones.',3260561,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ABCB1 (ATP-binding cassette, sub-family B (MDR/TAP), member 1; MDR1, P-gp, P-glycoprotein, PGY1, CLCS, CD243, ABC20, GP170)','ATP-binding cassette, sub-family B (MDR/TAP), member 1 (ABCB1 gene)','This gene plays a role in multi-drug resistance and is involved in blood-brain barrier transport.',3260563,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ABCC2 ("ATP-binding cassette, sub-family C (CFTR/MRP), member 2", cMRP, DJS, MRP2, CMOAT)','ATP-binding cassette, sub-family C (CFTR/MRP), member 2 (ABCC2 gene)','No Value Exists',3260565,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD4','CD4 gene','This gene is involved in the initiation of T-cell activation.',3260819,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('melanoma antigen family A, 3 (MAGEA3)','MAGEA3 gene','This gene may be involved in embryonal development. It may also play a role in carcinogenesis.',3260821,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD8A (CD8)','CD8A gene','No Value Exists',3260823,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Alpha-carotene','Alpha-carotene','Carotenoid consisting of a cyclic structure on each end with additional double bonds at the number 5 and 4 carbon atoms of the cyclic structures.',3260978,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Carotenoids','Carotenoid','A class of hydrocarbons (carotenes) and their oxygenated derivatives which exhibit chemopreventive properties.  Carotenoids are pigments found in green, yellow, and leafy vegetables, and yellow fruits. The pigments are fat-soluble, unsaturated aliphatic hydrocarbons functioning as provitamins and are converted to vitamin A through enzymatic processes in the intestinal wall.',3260980,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('S100B','S100B gene','No Value Exists',3260982,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Creatinine','Creatinine','The breakdown product of creatine, a constituent of muscle tissue, that is excreted by the kidney and whose serum level is used to evaluate kidney function.(NCI)',3260983,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Beta-cryptoxanthin','Beta-cryptoxanthin','Carotenoid having a chemical structure similar to beta-carotene with addition of a hydroxyl group at the number 3 carbon atom.',3260985,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PCA3','PCA3 gene','This gene may be involved in prostate cancer.',3261215,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('APC (adenomatous polyposis coli, DP2, DP2.5, DP3, PPP1R46)','APC gene','This gene plays a role in signal transduction. It is involved in both adhesion and migration of cells.',3261217,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('neural cell adhesion molecule 1 (NCAM 1, CD56)','NCAM1 gene (neural cell adhesion molecule 1)','This gene plays a role in cellular adhesion mechanisms that involve cell-cell and cell-matrix interactions.',3261246,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('forkhead box P3 (FOXP3)','FOXP3 gene','No Value Exists',3261248,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD19','CD19 gene','This gene plays a role in signal transduction and regulates the response of B cells to antigens.',3261255,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('integrin, alpha X (complement component 3 receptor 4 subunit) (CD11c)','integrin, alpha X (complement component 3 receptor 4 subunit) (ITGAX gene)','This gene is involved in the initiation of immune cell chemotaxis and phagocytosis.',3261437,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD14','CD14 gene','This gene plays a role in apoptosis and in ligand-binding interactions.',3261439,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD40 (TNF receptor superfamily member 5, Bp50, p50)','CD40 gene','This gene is involved in the regulation of apoptosis, inflammatory responses, and immune responses.',3261445,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD83 (BL11, HB15)','CD83 gene','This gene may play a role in antigen presentation.',3261454,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('5-HETE-ACF','5-Hydroxyeicosatetraenoic Acid Aberrant Crypt Focus ','A larger than normal, microscopically elevated colonic crypt that may contain dysplastic epithelium.  It is considered as a possible precursor of colonic adenoma and carcinoma.: A lipoxygenase metabolite of arachidonic acid and an intermediate in the pathway of leukotriene synthesis. 5-hydroxyeicosatetraenoic acid (5-HETE) is also a modulator of tubuloglomerular feedback, one of the mechanism the kidney uses to regulate glomerular filtration rate. Along with leukotriene B4, 5-HETE is often used as biomarker in evaluating eicosanoid metabolism and disease state.',3261492,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('5-HETE-N1 mucosa','5-Hydroxyeicosatetraenoic Acid Nodal Stage 1 mucosa','The moist tissue that lines some organs and body cavities (such as the nose, mouth, lungs) and makes mucus (a thick, slippery fluid).: A lipoxygenase metabolite of arachidonic acid and an intermediate in the pathway of leukotriene synthesis. 5-hydroxyeicosatetraenoic acid (5-HETE) is also a modulator of tubuloglomerular feedback, one of the mechanism the kidney uses to regulate glomerular filtration rate. Along with leukotriene B4, 5-HETE is often used as biomarker in evaluating eicosanoid metabolism and disease state.',3261493,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AKR1C3 (DDX, dihydrodiol dehydrogenase X, HAKRB, KIAA0119, PGFS, prostaglandin F synthase)','AKR1C3 gene','Human PCA3 wild-type allele is located within 9q21-q22 and is approximately 23 kb in length. This allele, which encodes prostate cancer antigen 3 non-coding RNA, may play a role in prostate carcinogenesis. Aberrant expression is associated with prostate carcinoma.',3261495,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AKT1 (AKT, PKB, PRKBA, RAC, v-akt murine thymoma viral oncogene homolog 1)','AKT1 gene','This gene is involved in signal transduction and negative regulation of apoptosis. It also plays a role in glucose transport, glycogen synthesis, protein synthesis and neuronal survival.',3261497,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AMH','Anti-Mullerian Hormone Receptor Type II','Encoded by human AMHR2 Gene, the 573-amino acid 62.7 kD Anti-Mullerian Hormone Receptor Type II Ser/Thr protein kinase (TGFB Receptor Family) is a type I membrane protein.  Type II receptors bind ligand but require a type I receptor for signal transduction.  Anti-Mullerian Hormone (AMH/MIS/MIF), produced by Sertoli cells, induces regression of Mullerian ducts, which differentiate into the uterus and fallopian tubes.  Type I persistent Mullerian duct syndrome is caused by AMH gene mutation; type II syndrome is due to AMHR mutation.  (OMIM, Swiss-Prot, and NCI)',3261500,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ERG','ERG gene','This gene plays a regulatory role in transcription, cellular maintenance and hematopoiesis.',3261552,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FCGR3A','FCGR3A gene','This gene plays a role in the mediation of antibody-dependent cytotoxicity and phagocytosis.',3261554,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HIF-1 alpha','HIF1A gene','This gene plays a role in cardiovascular development and systemic oxygen homeostasis.',3261556,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KRT7','KRT7 gene','No Value Exists',3261561,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Micronuclei','Micronucleus','the smaller of the two nuclei when more than one is present in a eukaryotic cell; induction is a common toxicologic indicator; a diploid nucleus involved in meiosis and sexual reproduction which does not produce RNA.',3261596,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NPPB (BNP, Brain Natriuretic Peptide,B-Type Natriuretic Peptide)','NPPB gene','This gene is involved in cardiac homeostasis.',3261623,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TK','TK Gene','The TK Gene encodes thymidine kinase, a transferase class pyrimidine salvage enzyme that catalyzes ATP-dependent phosphorylation of thymine deoxyribonucleoside. The TK gene and promoter are used widely in genetic research because of the easily selectable phenotype',3261657,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TMPRSS2','TMPRSS2 gene','This gene plays a role in the activation of pathway signaling.',3261659,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD44 (CSPG8, HCELL, MC56)','CD44 gene','This gene plays a role in cellular matrix adhesion and in lymphocyte activation.',3261663,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IGFBP1','IGFBP1 gene','This gene plays a role in insulin-like growth factor modulation and degradation.',3261665,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL2','IL2 gene','This gene is involved in growth and lymphokine regulation.',3261667,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL4','IL4 gene','This gene is involved in the regulation of the proliferation and differentiation of B-cells.',3261669,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL7','IL7 gene','This gene is involved in regulating immune responses in the intestinal mucosa.',3261671,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL15','IL15 gene','This gene is involved in the regulation of memory T cells and cytokine production.',3261673,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Disseminated Tumor Cells (DTC)','Disseminated Tumor Cells','Disseminated tumor cells are metastatic, often dormant and transient, tumor cells found singly or in small clumps in tissues such as the marrow, lung, liver, but not in peripheral blood.',3261884,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LFA-1','Lymphocyte Function-Associated Antigen-1 (LFA-1)','Lymphocyte function-associated antigen 1, also known as LFA-1 is found on all T-cells and also on B-cells, macrophages and neutrophils and is involved in recruitment to the site of infection. It binds to ICAM-1 on antigen-presenting cells and functions as an adhesion molecule.',3261885,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('VLA-4','Very Late Antigen 4 (VLA-4)','Very Late Antigen 4 (VLA-4) is an integrin dimer composed of CD49d (alpha) and CD29 (beta), and binds to VCAM-1 (integrin receptor) normally expressed on leukocyte plasma membranes.',3261886,'ACTIVE');
