INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Acetylated Histones','Histone Acetylation','Histone Acetylation involves covalent linkage of acetyl groups to highly basic histone proteins associated with DNA, particularly in active chromatin, and may be involved in regulation of gene expression.',3263626,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('nerve growth factor (beta polypeptide)','Nerve Growth Factor','Nerve growth factor.  A peptide of 118 amino acids with both chemotropic and chemotrophic properties for sympathetic and sensory neurons.  Found in a variety of peripheral tissues, NGF attracts neurites to the tissues by chemotropism, where they form synapses.  NGF was the first of a family of nerve tropic factors to be discovered.',3263674,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KLH','Keyhole Limpet Hemocyanin','A natural protein isolated from the marine mollusc keyhole limpet.  Keyhole limpet hemocyanin is an immunogenic carrier protein that, in vivo, increases antigenic immune responses to haptens and other weak antigens such as idiotype proteins. (NCI04)',3263676,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HPV-16 (Human Papillomavirus-16)','Protein E6, Human Papillomavirus Type 16','Protein E6 (158 aa, ~19 kDa) is encoded by the human papillomavirus type 16 E6 gene. This protein is involved in both transcriptional activation and degradation of cellular tumor antigen p53.',3263691,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('kallikrein-related peptidase 11','KLK11 gene','This gene is involved in protein degradation.',3263695,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('lactate','Lactic Acid','A substance made from sugars in milk, by the action of certain enzymes. It is used in skin care products to reduce wrinkles and soften the skin. It is also being studied in the treatment of hand-foot syndrome (a condition marked by pain, swelling, numbness, tingling, or redness of the hands or feet) in patients receiving chemotherapy. Lactic acid is also made in muscles in the body and is used in many chemical processes in the body. It is a type of alpha hydroxyl acid.',3264672,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('4E-BP (4E-BP (Eukaryotic Translation Initiation Factor 4E-Binding Protein 1)','Eukaryotic Translation Initiation Factor 4E-Binding Protein 1','Eukaryotic translation initiation factor 4E-binding protein 1 (118 aa, ~13 kDa) is encoded by the human EIF4EBP1 gene. This protein is involved in the modulation of translation and the sequestration of eukaryotic translation initiation factor 4E.',3264703,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('alanine','Alanine','A small non-essential amino acid in humans, Alanine is one of the most widely used for protein construction and is involved in the metabolism of tryptophan and vitamin pyridoxine. Alanine is an important source of energy for muscles and central nervous system, strengthens the immune system, helps in the metabolism of sugars and organic acids, and displays a cholesterol-reducing effect in animals. (NCI04)',3264707,'ACTIVE');
