INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Fibroblast growth factor (FGF)','Fibroblast Growth Factor','Peptide isolated from the pituitary gland and from the brain. It is a potent mitogen which stimulates growth of a variety of mesodermal cells including chondrocytes, granulosa, and endothelial cells. The peptide may be active in wound healing and animal limb regeneration.',3269638,'ACTIVE');
