INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GD3 (GD3 Ganglioside)','Ganglioside GD3','A cell surface antigen expressed on all tumors of neuroectodermal origin, including melanoma, neuroblastomas, sarcoma, astrocytomas, and small cell lung cancer. GD3, an O-acetylated disialoganglioside, belongs to the group of glycosphingolipids that are widely expressed in many tissues and organs in vertebrates and have been suggested to be involved in the regulation of development and differentiation as recognition molecules or signal modulators. GD3 and GD2 gangliosides represent distinct and relevant immunotherapeutic target structures on melanoma, thereby both have the potential to be used as components of anti-melanoma vaccines.',3270402,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GD2 (GD2 Ganglioside)','Ganglioside GD2','A cell surface antigen expressed on all tumors of neuroectodermal origin, including melanoma, neuroblastomas, sarcoma, astrocytomas, and small cell lung cancer. GD2, an O-acetylated disialoganglioside, belongs to the group of glycosphingolipids that are widely expressed in many tissues and organs in vertebrates and have been suggested to be involved in the regulation of development and differentiation as recognition molecules or signal modulators. Due to its high level of expression in neuroblastoma, GD2 has the potential to be used as a component of anti-neuroblastoma vaccines, in addition to being used in polyvalent anti-melanoma vaccines.',3270404,'ACTIVE');
