INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Sca-1 (Stem Cell Antigen 1)','Antigen Integer::1 Stem Cell','Any substance that appears foreign or potentially adverse to the body and elicits immune response.: A number with no fractional part.::1: Relatively undifferentiated cells of the same lineage (family type) that retain the ability to divide throughout postnatal life to reproduce themselves and to give rise to other more specialized types of cells to take the place of those that die or are lost. (MeSH)',3270638,'ACTIVE');
