INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Stathmin','Stathmin','A ubiquitous phosphoprotein that serves as an intracellular substrate for a variety of SIGNAL TRANSDUCTION PATHWAYS. PHOSPHORYLATION of stathmin occurs during CELL CYCLE progression, and stathmin functions as a microtubule-destabilizing protein that promotes MICROTUBULE depolymerization during INTERPHASE and late MITOSIS. Stathmin is expressed at very high levels in a variety of human CANCERS.',3270702,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FCGR3 (Fc fragment of IgG low affinity III receptor, CD16)','Antigens, CD16','Fc-Gamma Receptor III is expressed on natural killer cells, granulocytes, and monocytes. It is included in the zeta natural killer cell receptor complex. Fc receptor III is encoded by two separate genes: one for the neutrophil receptor (CD16) and another for the receptor on natural killer cells and macrophages. Some gamma-delta T-cells express CD16. Mitogenic stimulation of circulating gamma-delta T-cells results in decreased expression of CD16. (from OMIM 146740 and NCI)',3270704,'ACTIVE');
