INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('metallothionein','Metallothionein','Enzymes that use cysteine residues to transport metals such as copper and zinc throughout the body. The native polypeptide is found in abundant levels in the kidney cortex and liver.',3282627,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL-1B (Interleukin-1-Beta)','Interleukin-1-Beta','Interleukin-1 (endogenous pyrogen), produced primarily by monocytes, is an important pro-inflammatory cytokine that mediates the acute phase host response.  The biologic activities of IL1 are properties of a protein derived from a larger precursor.  Inflammation causes induction of COX2, leading to release of prostanoids, which sensitize peripheral nociceptor terminals and produce local pain hypersensitivity.  Inflammation also generates sensitivity in neighboring tissue, muscle and joint pain, fever, lethargy, and anorexia.  COX2 induction in regions of the CNS is mediated by IL1B.  Interleukin-1-beta also stimulates bone resorption.  IL1RN is a competitive inhibitor of IL1B.  Mature IL1-beta levels are a sensitive and specific indicator of caspase-1 activation.  (from OMIM 147720 and NCI)',3282648,'ACTIVE');
