INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Estrogen Receptor (ER)-beta','Estrogen Receptor beta','Widely expressed by human ESR2 Gene (NR3 Family) as 8 alternative isoforms, Estrogen Receptor 2 is a ligand-activated nuclear hormone receptor transcription factor composed of an N-terminal transcription activation/modulation domain, a DNA-binding domain, and a C-terminal steroid-binding domain. ESR2 binds estrogens with an affinity similar to ESR1 and transduces extracellular hormone signals into transcriptional responses by binding ERE DNA as a homodimer or as a heterodimer with ESR1, NCOA3, NCOA5, or NCOA6 coactivators and activating target gene expression in an estrogen-dependent manner; DNA-binding is lost in the absence of ligand. Lacking ligand binding ability and ERE binding activity, isoform Beta-2/CX preferentially forms a heterodimer with ESR1 and inhibits ligand-dependent DNA-binding and transactivation. (NCI)',3294190,'ACTIVE');
