INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PMEL (premelanosome protein, SIL, SILV, D12S53E, SI, Pmel17, gp100)','Melanocyte Protein Pmel 17','Melanocyte protein Pmel 17 (661 aa, ~70 kDa) is encoded by the human SILV gene. This protein may be involved in melanogenesis.',3296104,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('melan-A (MLANA, MART1)','MLANA gene','This gene plays a role in the development and maturation of melanosomes.',3296106,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ATM (ataxia telangiectasia mutated, TEL1, telomere maintenance 1 homolog (S. cerevisiae), TELO1, ATA, ATC, ATD, ATDC)','ATM gene','This gene is involved in apoptosis, DNA repair and cell cycle regulation.',3296181,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('adenosine Triphosphate (ATP)','Adenosine Triphosphate','An adenine nucleotide comprised of three phosphate groups esterified to the sugar moiety, found in all living cells. Adenosine triphosphate is involved in energy production for metabolic processes and RNA synthesis.  In addition, this substance acts as a neurotransmitter.  In cancer studies, adenosine triphosphate is synthesized to examine its use to decrease weight loss and improve muscle strength.',3296183,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('hypoxia up-regulated 1 (HYOU1, GRp170)','HYOU1 gene','This gene plays in the regulation of cellular response to ischemic stress conditions.',3296198,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Interleukin-6 receptor (IL6R)','IL6R gene','This gene in involved in the regulation of cellular responses; such as the immune response, hematopoiesis, and acute-phase inflammatory reactions.',3296200,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Epstein-Barr Virus (EBV, Human Herpes Virus-4, HHV-4)','Epstein-Barr Virus DNA','A species of Herpetoviridae that is responsible for infectious mononucleosis (glandular fever). Discovered in 1964, this virus has been associated with Burkitts lymphoma in South African children and with nasopharyngeal carcinoma in Asian populations. (On-line Medical Dictionary): A long linear double-stranded polymer formed from nucleotides attached to a deoxyribose backbone and found in the nucleus of a cell; associated with the transmission of genetic information. ',3297707,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PTPRC (GP180, LCA, T200, CD45, B220)','CD45 Antigens','High-molecular weight glycoproteins uniquely expressed on the surface of LEUKOCYTES and their hemopoietic progenitors. They contain a cytoplasmic protein tyrosine phosphatase activity which plays a role in intracellular signaling from the CELL SURFACE RECEPTORS. The CD45 antigens occur as multiple isoforms that result from alternative mRNA splicing and differential usage of three exons.',3297709,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HHV-6 (Human Herpes Virus-6)','Human herpes virus 6 serology','No Value Exists',3297711,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('B3GAT1 (CD57, HNK-1, NK-1, "beta-1,3-glucuronyltransferase 1", glucuronosyltransferase P)','CD57 Antigens','Oligosaccharide antigenic determinants found principally on NK cells and T-cells. Their role in the immune response is poorly understood.',3298527,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CDR3 (complementary determining region 3)','CDR3 Spectratyping','A laboratory procedure that analyzes the genetic profile of the T-cell receptor variable complementary determining region 3 (CDR3) for an individual. The genetic sequence for CDR3 is amplified using the polymerase chain reaction and specific primers.',3298529,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HHV-4 (Human Herpes Virus-4, LMP1)','LMP1','EBV latent membrane protein (NCI)',3298530,'ACTIVE');
