INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('X-ray repair complementing defective repair in Chinese hamster cells 1 (XRCC1)','XRCC1 gene','This gene is involved in single-strand DNA break repair.',3298726,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Dihydrotestosterone (DHT)','DPYD gene','This gene is involved in pyrimidine catabolism.',3298728,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Caspase 7 (CASP7, CMH-1, ICE-LAP3, MCH3)','CASP7 gene','This gene plays a role in the execution phase of apoptosis and is also involved in the regulation of lipogenic and cholesterogenic gene transcription.',3298744,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('von Willebrand factor (VWF)','VWF gene','This gene is critical for cellular homeostasis and plays a role in the regulation of blood coagulation by platelet function modulation. Mutations in the gene result in von Willebrands disease.',3298746,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('programmed cell death 1 (PD1, PDCD1)','PDCD1 Gene','This gene plays a role in apoptosis.',3298918,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TNF receptor-associated factor 2 (TRAF2, soluble TNF receptor 2)','TRAF2 Gene','This gene is involved in signal transduction and inhibition of apoptosis.',3298958,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('melanoma cell adhesion molecule (MCAM, CD146)','MCAM Gene','This gene plays a role in cell adhesion and receptor signaling.',3298960,'ACTIVE');
