INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD70 (CD27L, TNFSF7)','CD70 gene','No Value Exists',3300578,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('major histocompatibility complex, Class II (MHC Class II)','MHC Class II Protein','MHC Class-II Proteins are non-covalently linked polymorphic alpha/beta transmembrane glycoproteins. The immunological function of MHC Class-II proteins is to bind and present antigenic peptides on the surfaces of cells for recognition by the antigen-specific T cell receptors of lymphocytes. These proteins plays an important role in the mediation of immune response.',3300579,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Type I collagen (Collagen I)','Collagen I (Alpha 1)','Collagen I (Alpha 1), encoded by the COL1A1 gene, is the major component of type I collagen, the fibrillar collagen found in most connective tissues, and the only component of the collagen found in cartilage. Mutations in this gene are associated with osteogenesis imperfecta, Ehlers-Danlos syndrome, and idiopathic osteoporosis. Reciprocal translocations between chromosomes 17 and 22, where this gene and the gene for platelet-derived growth factor beta are located, are associated with a particular type of skin tumor called dermatofibrosarcoma protuberans, resulting from unregulated expression of the growth factor. Two transcripts, resulting from the use of alternate polyadenylation signals, have been identified for this gene. (from LocusLink)',3300581,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('6-thioguanine nucleotide (6-TGN)','6-Thioguanine Nucleotide','No Value Exists: The monomeric units from which DNA or RNA polymers are constructed. They consist of a purine or pyrimidine base, a pentose sugar, and a phosphate group. (From King & Stansfield, A Dictionary of Genetics, 4th ed)',3300583,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TNF receptor-associated factor 1 (TRAF1, soluble TNF receptor 1)','TRAF1 gene','No Value Exists',3300586,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('v-rel reticuloendotheliosis viral oncogene homolog (avian) (REL)','REL Gene','This gene is involved in transcriptional regulation and signal transduction through the nuclear factor kappa B NFKB signal transduction pathway.',3300588,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('hromogranin','Chromogranin','Chromogranins are acidic secretory glycoproteins with a widespread but specific distribution in neuroendocrine tissues. The chromogranin family is heterogenous, consisting of propeptides such as chromogranin-A, chromogranin-B and secretogranin II, which can either elicit an effect themselves, or serve as precursors to a large number of peptides, which are biologically more active.',3300590,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Synaptophysin (SYP)','SYP gene','No Value Exists',3300592,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('tumor necrosis factor receptor superfamily, member 8 (TNFRSF8, CD30)','TNFRSF8 Gene','This gene is involved in pro-apoptotic regulation via the NF-kappaB signal transduction pathway.',3300596,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('jun proto-oncogene (JUN)','JUN Gene','This gene plays a critical role in transcriptional regulation and cellular growth.',3300598,'ACTIVE');
