INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('serum/glucocorticoid regulated kinase 1 (SGK1)','SGK1 gene','No Value Exists',3303090,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cortisol (hydrocortisone)','Cortisol','The main glucocorticoid secreted by the adrenal cortex. Its synthetic counterpart is used, either as an injection or topically, in the treatment of inflammation, allergy, collagen diseases, asthma, adrenocortical deficiency, shock, and some neoplastic conditions.',3303092,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('nuclear receptor subfamily 3, group C, member 1 (glucocorticoid receptor), (NR3C1)','NR3C1 Gene','This gene is involved in ligand-activated transcriptional regulation and mutations in the gene are associated with glucocorticoid resistance.',3303097,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DUSP1 (dual specificity phosphatase 1, CL100, HVH1, MKP-1, PTPN10)','DUSP1 Gene','This gene is a transcriptional target of TP53 protein and plays a role in cell cycle regulation.',3303099,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TSC22 domain family, member 3 (TSC22D3, GILZ)','TSC22D3 gene','No Value Exists',3303101,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Circulating Endothelial Progenitor Cells (Circulating Progenitor Cells, CEP)','Circulating Endothelial Progenitor Cells','Establishment of a self replicating population of stem cells with subsequent repopulation of differentiated cell types.: The determination of the amount of circulating endothelial cells present in a sample.',3303109,'ACTIVE');
