INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('lipoprotein lipase (LPL)','LPL gene','No Value Exists',3303115,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('fatty acid synthase (FASN, FAS)','FASN Gene','This gene is involved in the production of both lung surfactant and the fatty components of milk. It also plays a role in the conversion and storage of energy in liver and adipose tissues.',3303117,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ribosomal protein S14 (RPS14, S14)','RPS14 gene','No Value Exists',3303119,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('chemokine (C-C motif) ligand 2 (CCL2, MCP-1, MCP1, MCAF)','CCL2 Gene','This gene is involved in inflammatory processes and disease development.',3303121,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('selectin E (SELE, soluble E-selectin)','SELE Gene','This gene plays a role in inflammation by mediating cellular adhesion to vasculature.',3303123,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('C Peptide','C Peptide','C peptide (31 aa, ~3 kDa) is encoded by the human INS gene. This protein is involved in both signal transduction and the modulation of blood flow.',3303126,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD40LG (CD40 ligand, CD40L, CD154, TRAP)','CD40LG Gene','This gene plays a role in the stimulation of B cells in immune responses.',3303199,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DPP4 (dipeptidyl-peptidase 4, DPPIV, ADCP2, CD26)','Dipeptidyl Peptidase 4','Dipeptidyl peptidase 4 (766 aa, ~88 kDa) is encoded by the human DPP4 gene. This protein is involved in proteolytic regulation of T cell activation.',3303201,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('insulin receptor (INSR)','Insulin Receptor','Insulin receptor (1382 aa, ~156 kDa) is encoded by the human INSR gene. This protein plays a role in both signal transduction and glucose homeostasis.',3303202,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('insulin-like growth factor 1 receptor (IGF1R)','Insulin-Like Growth Factor 1 Receptor','Insulin-like growth factor 1 receptor (1367 aa, ~155 kDa) is encoded by the human IGF1R gene. This protein is involved in cell proliferation and apoptosis inhibition.',3303203,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('transferrin receptor (p90, CD71, TFRC)','TFRC Gene','This gene plays a regulatory role in receptor-mediated endocytosis and iron metabolism.',3303207,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IGF-2 (insulin-like growth factor 2, somatomedin A)','IGF2 Gene','This gene plays a role in cell growth and proliferation. It is also involved in the regulation of prenatal skeletal and muscular development.',3303209,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('UGT1A1 (UDP glucuronosyltransferase 1 family, polypeptide A1)','UGT1A1 Gene','This gene is involved in controlling serum levels of bilirubin and in glucuronidation.',3304822,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TLR5 (toll-like receptor 5)','TLR5 Gene','This gene plays a role in the mediation of cytokine production and immunity.',3304824,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Epigallocatechin gallate (EGCG, (-)-Epigallocatechin-3-gallate)','Epigallocatechin Gallate','A phenolic antioxidant found in a number of plants such as green and black tea. It inhibits cellular oxidation and prevents free radical damage to cells. It is under study as a potential cancer chemopreventive agent. (NCI)',3304839,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('tenascin C (TNC)','TNC Gene','This gene is involved in cell adhesion, differentiation and proliferation.',3304861,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('heparin-binding EGF-like growth factor (HBEGF)','HBEGF Gene','This gene plays a role in macrophage-mediated cellular proliferation and growth regulation in fibroblasts and smooth muscle cells.',3304863,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Epiregulin (EREG)','Epiregulin','Epiregulin is a member of the epidermal growth factor family. Epiregulin can function as a ligand of EGFR (epidermal growth factor receptor), as well as a ligand of most members of the ERBB (v-erb-b2 oncogene homolog) family of tyrosine-kinase receptors. Epiregulin functions as a tumor growth-inhibitory factor in HeLa cells. (LocusLink and OMIM)',3304865,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Betacellulin (BTC)','Betacellulin','Betacellulin is a member of the EGF family of growth factors; a potent mitogen for retinal pigment epithelia and vascular smooth muscle cells. Betacellulin effects may be mediated by the EGF receptor and/or related receptors. The precursor form is a type I membrane protein that contains one EGF-like domain and is synthesized in several tissues and tumor cells. Betacellulin from pancreatic beta cells could play a role in the vascular complications associated with diabetes. (from Swiss-Prot P35070 and NCI)',3304867,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('folate hydrolase (prostate-specific membrane antigen) 1 (FOLH1, PSMA)','FOLH1 Gene','This gene plays a role in folate metabolism. It is also involved in neuronal transmission.',3304878,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HLA-A 0201','HLA-A*0201 Positive Cells Present','No Value Exists',3304880,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MAPK3 (ERK1)','MAPK3 Gene','This gene is involved in signal transduction and positive regulation of the cell cycle.',3305243,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('eIF4F (eukaryotic translation initiation factor 4F)','Eukaryotic Translation Initiation Factor 4F (eIF4F)','eukaryotic translation initiation factor 4F (eIF4F)',3305247,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL18 (Interleukin-18)','Interleukin-18','Cytokine which resembles IL-1 structurally and IL-12 functionally. It enhances the cytotoxic activity of NK cells and CTLs, and appears to play a role both as neuroimmunomodulator and in the induction of mucosal immunity.',3305282,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ACTA2 (ACTSA, ""actin, alpha 2, smooth muscle, aorta"")','ACTA2 gene','No Value Exists',3308478,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('eukaryotic translation factor 4G (eIF4G)','eukaryotic translation factor 4G','eukaryotic translation factor 4G',3308479,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('free T4 (Free Thyroxine)','Free Thyroxine Measurement','The determination of the amount of free thyroxine present in a sample.',3308481,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TSH (Thyroid Stimulating Hormone)','Thyroid Stimulating Hormone','A hormone produced by the pituitary gland. TSH stimulates the release of thyroid hormone from thyroglobulin. It also stimulates the growth of thyroid follicular cells. An abnormal TSH level may mean that the thyroid hormonal regulation system is out of control, usually as a result of a benign condition (hyperthyroidism or hypothyroidism).',3308482,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SLC5A5 Gene (NIS, sodium/iodide supporter)','SLC5A5 wt Allele','Human SLC5A5 wild-type allele is located within 19p13.2-p12 and is approximately 22 kb in length. This allele, which encodes sodium/iodide cotransporter protein , plays a role in the mediation of iodide transport into the thyroid. Mutations in the gene are linked to hypothyroidism due to an iodide transport defect.',3308484,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL23 (interleukin-23)','interleukin-23','A heterodimeric cytokine that plays a role in innate and adaptive immune responses. Interleukin-23 is comprised of a unique 19 kDa subunit and 40 kDa subunit that is shared with INTERLEUKIN-12. It is produced by DENDRITIC CELLS; MACROPHAGES and a variety of other immune cells',3308486,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DAPK1 (Death-associated Protein Kinase 1, DAPK)','Death-associated protein kinase','Death-associated protein kinase',3308533,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SOCS1 (Suppressor of cytokine signalling-1)','SOCS1 gene','No Value Exists',3308535,'ACTIVE');
