INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('secreted frizzled-related protein 2 (SFRP2)','SFRP2 gene','No Value Exists',3308548,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('kinase insert domain receptor (a type III receptor tyrosine kinase) (KDR, VEGFR)','KDR Gene','This gene plays a role in angiogenesis and vascular regulation.',3308568,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('fibroblast growth factor 19 (FGF19)','FGF19 Gene','This gene is involved in growth factor signaling.',3308570,'ACTIVE');
