INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('lymphocyte-activation gene 3 (LAG3)','LAG3 gene','No Value Exists',3308574,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Thyroglobulin','Thyroglobulin','A glycoprotein hormone that is synthesized by the thyroid follicular cell and is incorporated, by peptide bonds, with thyroid hormones (T3 and T4).  Thyroid hormone release occurs when T3 and T4 are enzymatically split from thyroglobulin.  Thyroglobulin levels serve as a tumor marker for monitoring the status of differentiated thyroid carcinomas.',3308581,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('p15','protease p15','No Value Exists',3309087,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Deoxycytidine triphosphate (dCTP)','Deoxycytidine triphosphate','Deoxycytidine triphosphate',3309128,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('immunoglobulin heavy variable group','Immunoglobulin Heavy Chain','A protein complex that consists of two heavy chains (gamma, alpha, delta, epsilon or mu). The larger of the two immunoglobulin chain types determines the immunoglobulin class (G, A, D, E or M, respectively). The heavy chain molecules exhibit the same structure and composition, which consists of constant, variable, and hypervariable regions.',3309129,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('fms-related tyrosine kinase 1 (vascular endothelial growth factor/vascular permeability factor receptor, FLT1, FLT)','FLT1 Gene','This gene is involved in cellular proliferation, differentiation and tyrosine kinase signal transduction.',3309131,'ACTIVE');
