INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('C4A (complement component 4A, C4A2, C4A3, C4A4, C4A6, C4B, C4S, CO4, CPAMD2, RG)','Complement component C4a','The smaller fragment formed when complement C4 is cleaved by COMPLEMENT C1S. It is an anaphylatoxin that causes symptoms of immediate hypersensitivity (HYPERSENSITIVITY, IMMEDIATE) but its activity is weaker than that of COMPLEMENT C3A or COMPLEMENT C5A.',3310777,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SDHA (Succinate dehydrogenase complex, subunit A, flavoprotein variant)','Caused by mutation in the succinate dehydrogenase complex, subunit A, flavoprotein gene (SDHA, {600857.0001})','No Value Exists',3310780,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CAV1 (CAV, CAV-1, caveolin 1, caveolin-1)','Caveolin 1','Caveolin 1 (CAV1), encoded by the CAV1 gene, is a scaffolding protein and the main component of the caveolae plasma membranes found in most cell types. CAV1 and CAV2 form Caveolin, a stable hetero-oligomeric complex important in the formation and maintenance of caveolae. In the absence of caveolin no morphologically identifiable caveolae exist, with one exception where in neuronal cells CAV 1 and CAV 2 are expressed but there are no morphologically recognizable caveolae. Caveolin 1 links integrin subunits to the tyrosine kinase FYN, an initiating step in coupling integrins to the Ras-ERK pathway and promoting cell cycle progression. Caveolin expression is correlated both to oncogenic transformation and its reversal. CAV1 is a tumor suppressor candidate and a negative regulator of the Ras-p42/44 MAP kinase cascade. Alternative splicing results in 2 isoform proteins (alpha, beta). (NCI)',3310782,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SPARC (secreted protein acidic and rich in cysteine)','SPARC','SPARC (303 aa, ~35 kDa) is encoded by the human SPARC gene. This protein is involved in calcium binding and deposition, cell cycle progression, extracellular matrix synthesis and cell morphology.',3310784,'ACTIVE');
