INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCAAT/enhancer binding protein (C/EBP), alpha (CEBPA)','CEBPA Gene','This gene plays a role in body weight homeostasis and cellular proliferation. Mutations in the gene are associated with acute myeloid leukemia.',3322717,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Quercetin','Quercetin','A polyphenolic flavonoid with potential chemopreventive activity. Quercetin, ubiquitous in plant food sources and a major bioflavonoid in the human diet, may produce antiproliferative effects resulting from the modulation of either EGFR or estrogen-receptor mediated signal transduction pathways. Although the mechanism of action of action is not fully known, the following effects have been described with this agent in vitro: decreased expression of mutant p53 protein and p21-ras oncogene, induction of cell cycle arrest at the G1 phase and inhibition of heat shock protein synthesis. This compound also demonstrates synergy and reversal of the multidrug resistance phenotype, when combined with chemotherapeutic drugs, in vitro. Quercetin also produces anti-inflammatory and anti-allergy effects mediated through the inhibition of the lipoxygenase and cyclooxygenase pathways, thereby preventing the production of pro-inflammatory mediators.',3322719,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ellagic Acid','Ellagic Acid','No Value Exists',3322721,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MEK1/2 (MAPK Kinase)','Mitogen-Activated Protein Kinase (MAPK) Kinase','Encoded by Kinase Family Genes, Kinase enzymes covalently transfer the terminal, gamma phosphate group from ATP to a variety of substrates and typically play key regulatory roles in diverse cellular functions. (NCI): Mitogen-activated protein kinases (MAPKs) are serine-threonine protein kinases activated in response to a variety of extracellular stimuli and encoded by a multigene family. The MAPKs are part of complex protein kinase cascades. One of the several classes of MAPKs includes (among other ERKs) the extracellular signal-regulated kinases ERK1 (p44MAPK) and ERK2 (p42MAPK), activated by the RAF/MEK/ERK signaling pathway. ERK1/2 are widely involved in eukaryotic signal transduction. Upon activation, ERKs translocate to the nucleus and phosphorylate nuclear targets. Phosphorylated ERKs form essential dimers with phosphorylated and unphosphorylated ERK partners. Dimerization is part of the mechanism of MAP kinase family action. Mitogen-activated protein kinases (MAPKs) promote entry in the cell cycle.  (from OMIM 601795, 176948, Swiss-Prot P27361, P28482 and NCI)',3323075,'ACTIVE');
