INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Trap5b (Tartrate-resistant acid phosphatase isoenzyme 5b, Tartrate-Resistant Acid Phosphatase-5b, Tartrate-Resistant Acid Phosphatase Type 5b, TRACP-5b, Tartrate-resistant acid phosphatase (TRACP)-5b)','Tartrate-resistant acid phosphatase Type 5b','Tartrate-resistant acid phosphatase type 5b (325 aa, ~37 kDa) is encoded by the human ACP5 gene. This protein is involved in acid phosphatase activity and is comprised of two disulfide linked polypeptides which are the result of proteolytic cleavage of the tartrate-resistant acid phosphatase type 5 protein. Tartrate-resistant acid phosphatase type 5b is predominantly secreted by osteoclasts and is a potential marker for both bone resorption and bone metastasis.',3330125,'ACTIVE');
