INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CYP1A1 (cytochrome P450, family 1, subfamily A, polypeptide 1, CYP1, P450DX, P1-450, P450-C, CP11)','Cytochrome P450 1A1','A cytochrome P-450 enzyme capable of activating procarcinogenic polycyclic hydrocarbons and halogenated aromatic hydrocarbons into mutagenic compounds. Ethoxyresorufin acts as a substrate for CYP1A1 and measurement of ethoxyresorufin O-deethylase provides a more direct method of detection for this enzyme. EC 1.',3338728,'ACTIVE');
