INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GIP (gastric inhibitory polypeptide, glucose-dependent insulinotropic polypeptide)','GIP gene','No Value Exists',3338748,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HDAC1 (histone deacetylase 1, HD1, GON-10, RPD3L1)','Histone Deacetylase 1','Histone acetylation and deacetylation, catalyzed by multisubunit complexes, play a key role in the regulation of eukaryotic gene expression. This protein belongs to the histone deacetylase/acuc/apha family and is a component of the histone deacetylase complex. It also interacts with retinoblastoma tumor-suppressor protein and this complex is a key element in the control of cell proliferation and differentiation. Together with metastasis-associated protein-2, it deacetylates p53 and modulates its effect on cell growth and apoptosis. (LocusLink)',3338825,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Histone acetyltransferase activity','Histone Acetyltransferase 1','Histone acetylation, particularly of histone H4, has been proposed to play an important role in replication-dependent nucleosome assembly. The HAT1 protein contains D, A, and B motifs, which are present in many N-acetyltransferases, including those that acetylate substrates other than histones. The HAT1 holoenzyme consists of 2 subunits: the catalytic 46-kD HAT1 and the accessory p46 (RBBP7). The p46 subunit stimulated the activity of HAT1 and bound to core histones. The HAT1 holoenzyme acetylated newly synthesized but not nucleosomal histone H4 at lys5 and lys12, and, to a lesser extent, histone H2A at lys5. HAT1 and p46 polypeptides are located in the nucleus of S-phase cells. (from LocusLink)',3338827,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RHO (Rhodopsin, RP4, OPN2, opsin 2, rod pigment)','Rhodopsin','photoreceptor protein found in retinal rods; it is a complex formed by the binding of retinaldehyde, the oxidized form of retinol, to the protein opsin and undergoes a series of complex reactions in response to visible light resulting in the transmission of nerve impulses to the brain.',3338829,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ALOX12 (arachidonate 12-lipoxygenase, platelet 12-LOX, 12S-LOX)','ALOX12 gene','No Value Exists',3338831,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HDAC6 (histone deacetylase 6, KIAA0901, JM21, HD6, FLJ16239)','Histone Deacetylase 6','HDAC6 functions as a tubulin deacetylase. HDAC6 is localized exclusively in the cytoplasm, where it associates with microtubules and localizes with the microtubule motor complex. In vivo the overexpression of HDAC6 led to a global deacetylation of alpha-tubulin, whereas a decrease in HDAC6 increased alpha-tubulin acetylation. In vitro, purified HDAC6 potently deacetylated alpha-tubulin in assembled microtubules. Furthermore, overexpression of HDAC6 promoted chemotactic cell movement, supporting the idea that HDAC6-mediated deacetylation regulates microtubule-dependent cell motility. Hubbert et al. (2002) concluded that HDAC6 is the tubulin deacetylase, and provided evidence that reversible acetylation regulates important biologic processes beyond histone metabolism and gene transcription. (from OMIM)',3340203,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HDAC5 (histone deacetylase 5, KIAA0600, NY-CO-9, FLJ90614)','Histone Deacetylase 5','Histone deacetylase 5 is one of three identified histone deacetylases with similarity to the yeast Hda1 histone deacetylase.  It is expressed differentially, is found in complexes with HDAC4 and HDAC3, and possesses deacetylation activity with all four core histones.  MEF2A transcription factors interact with HDAC4 and HDAC5, resulting in repression of MEF2-dependent genes.  Muscle differentiation requires release of MEF2 from repression by HDACs.  HDAC5 shuttles from nucleus to cytoplasm when myoblasts are triggered to differentiate.  CAMK1 signaling prevents formation of MEF2/HDAC complexes and induces nuclear export of HDAC4 and HDAC5 by phosphorylation.',3340205,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HDAC11 (histone deacetylase 11)','HDAC11 gene','No Value Exists',3340207,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HDAC4 (histone deacetylase 4, KIAA0288, HDAC-A, HDACA, HD4, HA6116, HDAC-4)','Histone Deacetylase 4','Histone deacetylase 4 is one of three identified histone deacetylases with similarity to the yeast Hda1 histone deacetylase.  It is expressed differentially in brain, heart, and skeletal muscle and is found in complexes with HDAC3 and HDAC5.  HDAC4 possesses deacetylation activity with all four core histones.  HDAC4 interacts with multiple proteins.  HDAC4 does not bind DNA directly, but rather through MEF2C and MEF2D.  Binding of HDAC4 to MEF2C represses MEF2C transcription activity.  (from OMIM 605314 and NCI)',3340209,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HDAC3 (histone deacetylase 3, RPD3, HD3, RPD3-2)','Histone Deacetylase 3','Histone deacetylase 3 is one of three identified histone deacetylases with similarity to the yeast global transcriptional regulator Rpd3p.  Two isoforms are produced by alternative splicing and it appears to be expressed ubiquitously.  HDAC3 can be found in complexes that include HDAC4 and HDAC5, deacetylases with similarity to yeast Hda1 deacetylase.  HDAC3 may regulate transcription through binding the zinc-finger transcription factor YY1, increasing its repression activity.  RELA is a nonhistone substrate of HDAC3.  IKBA-dependent nuclear export of deacetylated RELA replenishes the cytoplasmic pool of NFKB/IKBA complexes for NFKB responses.  (from OMIM 605166 and NCI)',3340211,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HDAC2 (histone deacetylase 2, RPD3, YAF1)','Histone Deacetylase 2','One of three identified histone deacetylases with similarity to the yeast global transcriptional regulator Rpd3p, HDAC2 is found in transcription factor co-repressor complexes that include HDAC1.  BRCA1 interacts with HDAC1 and HDAC2.  Acetylation of histone destabilizes nucleosomes allowing transcription factors access to recognition elements in DNA.  Deacetylation reseals the chromosomal package, repressing transcription.  DNMT1 can establish a repressive transcription complex with HDAC2, and DMAP1.  HDAC2 joins DNMT1 and DMAP1 during late S-phase, suggesting how histones may become deacetylated in heterochromatin following replication.  (from OMIM 605164 and NCI)',3340213,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CYP17A1 (cytochrome P450, family 17, subfamily A, polypeptide 1, CPY 17,P450C17, CPT7, S17AH)','CYP17A1 Gene','This gene plays a role in the metabolism of estrogen and glucocorticoids. It is also involved in sexual maturation.',3340215,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('miRNA Profile (MicroRNA Profile)','MicroRNA Profile','A sequence of single-stranded RNA which is typically 20-25 nucleotides in length and may regulate the expression of other genes. miRNAs are RNA genes which are transcribed from DNA, but are not translated into proteins.: An analysis (often in graphical form) representing the extent to which something exhibits various characteristics.',3340691,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DNA methylation index (DNA MI)','DNA Methylation Index','The process by which methyl groups are added to nucleotides in genomic DNA.: Index; a numerical scale used to compare variables with one another or with some reference number.',3340692,'ACTIVE');
