INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HAVCR2 (hepatitis A virus cellular receptor 2, Tim-3, TIM3, FLJ14428, TIMD3)','HAVCR2 gene','No Value Exists',3350726,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PRTN3 (proteinase 3, PR-3, ACPA, C-ANCA, AGP7, MBT, P29)','Proteinase 3','Encoded by human PRTN3 Gene (Peptidase S1 Family), 256-aa 29-kD Proteinase 3 precursor is coordinately expressed with and packed in neutrophilic azurophil granules with ELA2 and AZU during myeloid development. An antibiotic neutral serine protease, PRTN3 appears to degrade elastin, fibronectin, laminin, vitronectin, and collagen types I, III, and IV by preferential cleavage at Ala-X and Val-X bonds. (from LocusLink, Swiss-Prot, OMIM, and NCI)',3350727,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('D-dimer','D-Dimer','The determination of the amount of d-dimers present in a sample.',3351588,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TAT (Thrombin-Antithrombin Complex)','Thrombin-Antithrombin Complex','A protease involved in clotting',3351590,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TNFRSF9 (tumor necrosis factor receptor superfamily, member 9, CD137, 4-1BB)','TNFRSF9 gene','No Value Exists',3351676,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BCL2A1 (BCL2-related protein A1, GRS, BFL1, BCL2L5, ACC-1, ACC-2, HBPA1)','BCL2A1 gene','No Value Exists',3351678,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SDC2 (syndecan 2, HSPG1, HSPG, SYND2, CD362)','SDC2 gene','No Value Exists',3351680,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SELP (selectin P (granule membrane protein 140kDa, antigen CD62), CD62, PSEL, PADGEM, GMP140, CD62P, GRMP)','SELP Gene','This gene plays a role in cellular adhesion and mediates immune and endothelial cell interactions.',3351682,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Proteasome activity','Proteasome Activity','Proteolytic complexes, proteolytic core of the proteasome system, that degrade cytosolic and nuclear proteins are implicated in ATP dependent ubiquitin protein complex degradation and in antigen processing in antigen presenting cells. The 20S proteasome (700 kD), essential in ATP ubiquitin degradation pathway, has 13-15 subunits each of which has three or four different peptidase activities. The 20S proteasome interacts with additional subunits, PA700 and PA28, to form an ATP-dependent multicatalytic proteinase complex (MPC) involved in the degradation of ubiquitinated cellular proteins and certain non-ubiquitinated proteins. 26S proteasomes may be formed in an ATP dependent fashion from a 20S proteasome and additional components, CF1 (660 kD), CF2 (250 kD) and CF3 (600 kD).: The state of being active; any specific activity.',3351688,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PTCH1 (patched 1, BCNS, NBCCS, PTCH','PTCH1 Gene','This gene is involved in tumor suppression and mutations in this gene have been associated with several cancers and cancer related diseases.',3351690,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PDK1 (pyruvate dehydrogenase kinase, isozyme 1, PDK-1)','PDK1 gene','No Value Exists',3351715,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('VPS18 (vacuolar protein sorting 18 homolog (S. cerevisiae), KIAA1475, PEP3)','VPS18 gene','No Value Exists',3351779,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EGFRvIII (Epidermal Growth Factor Receptor variant III)','EGFR variant III','A synthetic peptide sequence derived from the tumor specific mutant variant of epidermal growth factor receptor EGFRvIII originally found in glioblastoma multiforme, caused by the deletion of exons 2-7. Unlike wild-type EGFR, EGFRvIII is a dominant oncogene that can directly lead to cancer. EGFRvIII is expressed in multiple cancer types including breast, ovarian, and metastatic prostate cancers, and other types of solid tumors due to alternative splicing; has not been observed in normal human tissues. Vaccination with EGFRvIII peptide may stimulate the host immune system to mount a cytotoxic T lymphocyte response against tumor cells positive for EGFRvIII, resulting in decreased tumor growth. (NCI04)',3351848,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HLA-G (major histocompatibility complex, class I, G, b2 microglobulin)','HLA-G gene','No Value Exists',3351850,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CXCL5 (chemokine (C-X-C motif) ligand 2, ENA-78, SCYB5)','CXCL5 Gene','This gene plays a role in chemotaxis and neutrophil activation.',3351852,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ZEB1 (zinc finger E-box binding homeobox 1, BZP, ZEB, AREB6, NIL-2-A, Zfhep, Zfhx1a, PPCD3, TCF8)','ZEB1 gene','No Value Exists',3351854,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CLEC4C (C-type lectin domain family 4, member C, CLECSF11, CLECSF7, HECL, DLEC, BDCA2, CD303)','CLEC4C gene','No Value Exists',3351856,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IgH (immunoglobulin heavy locus, IGHDY1)','Immunoglobulin Heavy Locus','This region represents the germline organization of the immunoglobulin heavy chain locus. The locus includes V (variable), J (joining), diversity (D), and C (constant) segments. During B cell development, a recombination event at the DNA level joins a D segment with a J segment; a V segment is then joined to the D-J gene. The C segment is later joined by splicing at the RNA level. Recombination of many different V segments with several D and J segments provides a wide range of antigen recognition. Additional diversity is attained by junctional diversity, resulting from the random additional of nucleotides by terminal deoxynucleotidyltransferase, and by somatic hypermutation, which occurs during B cell maturation in the spleen and lymph nodes. (from LocusLink)',3351857,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CNTNAP1 (contactin associated protein 1, neurexin 4, NRXN4, p190, Caspr, CNTNAP)','CNTNAP1 Gene','This gene plays a role in brain signal transduction, and may be involved in cellular adhesion.',3351859,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('B2M (beta-2-microglobulin)','Beta-2-Microglobulin Protein','Beta-2-microglobulin protein (119 aa, ~14 kDa) is  encoded by the human B2M gene. This protein plays a role in immune  responses and is a key component of major histocompatibility complex  class I molecules. The protein is localized to the surface of cells and  is utilized as a prognostic marker in persons with cancers that involve  white blood cells. The polypeptide is also used as a marker in kidney  damage diagnosis and in the detection of viral infection.',3351860,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cryoglobulins','Cryoglobulin','An abnormal plasma protein that precipitates within the microvasculature on exposure to cold; microvasculature effects of cryoglobulinemia may result in restricted tissue blood flow, tissue hypoxia, and tissue necrosis.',3351885,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIR21 (microRNA 21, MIRN21, hsa-mir-21)','MIR21 Gene','This gene is involved in the regulation of gene expression and plays an oncogenic role in hepatocellular, breast, esophageal, gastric, pancreatic, prostatic and squamous cell carcinomas, glioblastoma and glioma.',3359734,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIR15A (microRNA 15a, MIRN15A, hsa-mir-15A)','MIR15A Gene','This gene is involved in the regulation of gene expression and plays a potential tumor suppressor role in prostate carcinomas, various leukemias, pituitary adenoma, polycystic kidney disease and polycystic liver disease.',3359736,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIR146B (microRNA 146b, MIRN146B, microRNA 146b)','MIR146B Gene','This gene is involved in the regulation of gene expression and plays a role in the development of carcinoma of the breast and glioma.',3359739,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIR19A (microRNA 19a, MIRN19A, hsa-mir-19a)','MIR19A Gene','This gene is involved in the regulation of gene expression and plays a role in the development of hepatocellular, lung and thyroid carcinomas, plasma cell myeloma, medulloblastoma, Cowdens syndrome and spinocerebellar ataxia.',3359741,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIR181A2 (microRNA 181a-2, MIRN181A, MIRN181A2, MIR181A, hsa-mir-181a, microRNA 181a)','MIR181A2 Gene','This gene is involved in the regulation of gene expression and plays a role in the development of plasma cell myeloma and glioma.',3359743,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIR222 (microRNA 222, MIRN222, hsa-mir-222)','MIR222 Gene','and acts as an oncogene in breast, lung, thyroid and prostate carcinomas as well as metastatic melanoma and glioblastoma multiforme.',3359745,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIR382 (microRNA 382, MIRN382, hsa-mir-382)','MIR382 gene','No Value Exists',3359747,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIR155 (microRNA 155, MIRN155, hsa-mir-155)','MIR155 Gene','This gene is involved in the regulation of gene expression and plays a potential tumor suppressor role in breast and pancreatic carcinomas, acute lymphoblastic leukemia and diffuse large B-cell lymphoma.',3359749,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CSK (c-src tyrosine kinase)','CSK Gene','This gene is involved in signal transduction and intercellular adhesion.',3359751,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SPP1 (secreted phosphoprotein 1, bone sialoprotein 1, BNSP, SPIl, ETA-1, OPN. osteopontin)','SPP1 Gene','This gene is involved in signaling and tissue mineralization.',3363761,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PTHLH (parathyroid hormone-like hormone, PTHRP, HHM, PLP, PTHR, osteostatin)','Parathyroid Hormone-Like Hormone','Parathyroid Hormone-Related protein signals through its receptor PTHR1, regulating endochondral bone development and epithelial-mesenchymal interactions.  PTHRP is an anti-proliferative factor that regulates epidermal cell growth.  Because of its structural homology with PTH and binding to the PTH/PTHRP receptor, PTHRP can mimic the action of PTH, but has evolved to regulate local tissue functions, in contrast to the systemic function of parathyroid hormone.  To carry out its diverse biologic roles, PTHRP functions as a poly-hormone that gives rise to several biologically active peptides, each of which presumably has its own receptor.  To broaden its repertoire even further, it appears to have intracrine effects in the nucleus of cells that produce it, in addition to having autocrine, juxtacrine, paracrine, and possibly endocrine effects after secretion.  (from OMIM 168470 and NCI)',3363762,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('gamma-delta TCR (T-cell Receptor, Gamma-Delta)','T-Cell Receptor, Gamma-Delta','T-cell receptors composed of CD3-associated gamma and delta polypeptide chains and expressed primarily in CD4-/CD8- T-cells. The receptors appear to be preferentially located in epithelial sites and probably play a role in the recognition of bacterial antigens. The T-cell receptor gamma/delta chains are separate and not related to the gamma and delta chains which are subunits of CD3 (see ANTIGENS, CD3).',3364660,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NPM1 (nucleophosmin (nucleolar phosphoprotein B23, numatrin, B23, NPM)','Nucleophosmin','A human nuclear matrix protein with demonstrated immunohistochemical staining differences between benign and malignant prostate tissue.',3364663,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('STAT5B (signal transducer and activator of transcription 5B)','Signal Transducer and Activator of Transcription 5B','Signal transducer and activator of transcription 5B (787 aa, ~90 kDa) is encoded by the human STAT5B gene. This protein plays a role in the metabolism of small molecules, transcriptional regulation and signal transduction.',3364665,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IMPDH Activity (inosine monophosphate dehydrogenase)','inosine monophosphate dehydrogenase activity','No Value Exists',3364680,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IGFBP2 (insulin-like growth factor binding protein 2, 36kDa, IBP2)','Insulin-Like Growth Factor-Binding Protein 2','Encoded by human IGFBP2 Gene, cysteine-rich high molecular weight secreted 328-aa 35-kD Insulin-Like Growth Factor-Binding Protein 2 precursor contains an IGFBP domain and a thyroglobulin type-I domain. IGF-binding proteins prolong plasma IGF half-life and alter IGF interaction with cell surface receptors. The predominant form in plasma (150-kD) contains IGF-BP53 with apparent molecular mass of 53-kD. IGFBP2 binds IGF-II with high affinity more than IGF-I. (from LocusLink, Swiss-Prot, OMIM, and NCI)',3364682,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LRRC19 (leucine rich repeat containing 19, FLJ21302)','LRRC19 gene','No Value Exists',3364684,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL28A (interleukin 28A (interferon, lambda 2), IFNL2)','IL28A gene','No Value Exists',3364686,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TLR7 (toll-like receptor 7)','Toll-Like Receptor 7','Expressed in lung, placenta, spleen, brain, stomach, small intestine, and pre-dendritic cells by human TLR7 Gene (TLR Family), 104-aa 121-kDa (precursor) type I membrane protein Toll-Like Receptor 7 contains a TIR domain and 27 LRR repeats. TLR7 has a fundamental role in pathogen recognition and activation of innate immunity to microbial agents. Sharing structural and functional similarities, highly conserved TLRs recognize pathogen-associated molecular patterns expressed on infectious agents and mediate cytokine production necessary for effective immunity. TLR7 likely acts via MyD88 (TIR interaction) and TRAF6, leading to NF-kappa-B activation, cytokine secretion and the inflammatory response. (NCI)',3364694,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD276 (CD276 molecule, B7-H3, B7H3)','CD276 Gene','This gene is involved in the regulation of T cell immune responses.',3364696,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LDH (lactate dehydrogenase)','Lactate Dehydrogenase','A family of homotetrameric cytoplasmic enzymes involved in the conversion of L-lactate and NAD to pyruvate and NADH in the final step of anaerobic glycolysis. In vertebrates, genes for three different subunits (LDH-A, LDH-B and LDH-C) exist.',3364697,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PRAME (preferentially expressed antigen in melanoma, CT130, MAPE, cancer/testis antigen 130)','PRAME protein, human','No Value Exists',3364718,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GLI2 (GLI family zinc finger 2, THP2, HPE9, THP1)','GLI2 Gene','This gene is involved in transcriptional regulation and plays a role in sonic hedgehog signal transduction.',3364918,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PTCH2 (patched 2)','PTCH2 Gene','This gene plays a role in intercellular communication, embryonic structure development, and in tumorigenesis.',3364920,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SMO (smoothened, frizzled family receptor, SMOH, FZD11, frizzled family member 11)','SMO Gene','This gene plays a role in G protein-coupled receptor signal transduction and sonic hedgehog pathway activation.',3364922,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PDGF (Platelet-Derived Growth Factor)','Platelet-Derived Growth Factor','Expressed in platelets, human Platelet-Derived Growth Factor (PDGF/VEGF Family) is a mitogenic factor for mesenchymal cells characterized by a motif of eight cysteines and released upon wounding to stimulate adjacent cell growth. PDGF can exist as antiparallel disulfide-linked homodimers (PDGFA, PDGFB) or heterodimers (PDGFA/PDGFB) that bind to PDGF receptor and elicit a variety of cellular responses. A and B homodimers are implicated in transformation processes. (NCI)',3364924,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Anti-CEA Antibody','Anti-CEA Antibody','An antibody against carcinoembryonic antigen (CEA), a protein present on certain types of cancer cells.',3365316,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BRS (TGF-Beta Responsive Gene Signature)','TGF-Beta Responsive Gene Signature','No Value Exists: A form of gene expression profiling that is indicative of the biological behavior of a tumor or cancer. This pattern of expression is comprised of unique clusters of genes that display differential levels of expression. The technology is based on microarray analysis and allows for accurate prognostication based upon these criteria.',3365319,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('D-PYR (Deoxypyridinoline, Deoxypyridinium)','Deoxypyridinoline (Deoxypyridinium)','Deoxypyridinoline (Deoxypyridinium)',3365320,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TLR3 (toll-like receptor 3, CD283)','Toll-Like Receptor 3','Expressed most in placenta, pancreas, and CD11c+ immature dendritic leukocytes by human TLR3 Gene (TLR Family), 904-aa 104-kDa (precursor) type I membrane protein Toll-Like Receptor 3 contains a TIR domain and 22 LRR repeats. Likely involved in host viral defense, TLR3 recognizes viral dsRNA and has a fundamental role in pathogen recognition and activation of innate immunity to microbial agents. Sharing structural and functional similarities, highly conserved TLRs recognize pathogen-associated molecular patterns expressed on infectious agents and mediate cytokine production necessary for effective immunity. TLR3 appears to act via MyD88 (TIR interaction) and TRAF6, leading to NF-Kappa-B activation and production of type I interferons. (NCI)',3365697,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EGFR T790M (T790M EGFR Gene Mutation)','T790M EGFR Gene Mutation','A change in the amino acid residue at position 790 in the epidermal growth factor receptor protein where threonine has been replaced by methionine.: A change in the nucleotide sequence of the EGFR gene.',3370180,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SMAD4 (MAD, mothers against decapentaplegic homolog 4 (Drosophila),SMAD, mothers against DPP homolog 4 (Drosophila), DPC4, MADH4)','SMAD4 Gene','This gene plays a role in signal transduction and transcriptional activation. It is also involved in suppression of angiogenesis.',3370182,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GNAS (guanine nucleotide binding protein (G protein), alpha stimulating activity polypeptide 1, GNAS1, NESP55, NESP, GNASXL, GPSA, SCG6, secretogranin VI)','GNAS Gene','This gene plays a role in signal transduction and is associated with pituitary tumors.',3370184,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PALB2 (Fanconi anemia, complementation group N; FLJ21816, FANCN)','PALB2 Gene','This gene may play a role in the repair of DNA damage that is resolved by recombination.',3370186,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FANC Gene Family (Fanconi Anemia complementation group genes)','Fanconi Anemia Complementation Group Protein','A protein that is a member of a structurally diverse group that forms a protein complex which may regulate both DNA repair and the cell cycle. Mutation of any member of this group may inhibit the formation of the complex and is associated with Fanconi anemia.',3370197,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DNTT (Terminal deoxynucleotidyltransferase, TDT)','Terminal Deoxyribonucleotidyl Transferase','Terminal deoxynucleotidyltransferase is a unique DNA polymerase that without template direction catalyzes the addition of deoxyribonucleotides onto the 3-prime-hydroxyl end of DNA primers. TDT catalyzes the insertion of nucleotides (N regions) at the V(H)-D and D-J(H) junctions of immunoglobulin genes. The enzyme is present in immature thymocytes, some bone marrow cells, transformed pre-B and pre-T cell lines, and leukemia cells.',3370204,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MLL (myeloid/lymphoid or mixed-lineage leukemia (trithorax homolog, Drosophila; TRX1, HRX, ALL-1, HTRX1, CXXC7, MLL1A, KMT2A)','MLL Gene','This gene is involved in transcriptional regulation and alterations in the gene are associated with acute lymphoblastic leukemia.',3370205,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ETV6-RUNX1 fusion mutation (TEL-AML1)','ETV6-RUNX1 fusion protein, human','No Value Exists',3370207,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL21 (interleukin 21, Za11, IL-21)','IL21 gene','No Value Exists',3370209,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('C2 (complement component 2)','Complement compound 2','Complement compound 2',3370212,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NOS3 (endothelial nitric oxide synthase, eNOS, ECNOS, nitric oxide synthase 3 (endothelial cell)','Nitric Oxide Synthase 3','Expressed in platelets and endothelia by human NOS3 Gene (NOS Family), conserved constitutive 1202-aa 133-kDa Nitric Oxide Synthase 3 is a calcium/calmodulin stimulated homodimer stabilized by BH4 that contains a flavodoxin-like domain, binds FAD and FMN cofactors, and synthesizes NO from L-arginine. Endothelial NO appears to exert EDRF activity that inhibits vascular smooth muscle contraction through a cGMP pathway. NOS3 activity also inhibits platelet aggregation and mediates VEGF-induced angiogenesis. Vascular shear stress activates endothelial PI3K and AKT, which directly phosphorylates (Ser1177) and enhances NOS3 activity and calcium sensitivity. Potentially influencing the control of energy balance, NO also triggers cGMP-dependent mitochondrial biogenesis mediated by induction of the master regulator PPARGC1. (NCI)',3370214,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HBsAb (Hepatitis B Surface Antibody)','Hepatitis B Surface Antibody Measurement','The determination of the surface antibody reaction of a sample to the Hepatitis B virus.',3370217,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HBcAb (Hepatitis B Core Antibody)','Hepatitis B Virus Core Antibody','An antibody produced by B lymphocytes to the hepatitis B core antigen as part of the immune response to hepatitis B viral infection.',3370218,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HBsAg (Hepatitis B Surface Antigen)','Hepatitis B Surface Antigen','Any one of the hepatitis B antigens found on the surface of the Dane particle and on the 20 nm spherical and tubular particles. Several subspecificities of the surface antigen are known. These were formerly called the Australia antigen.',3370219,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DNMT1 (DNA (cytosine-5-)-methyltransferase 1, DNMT, MCMT, CXXC9)','DNMT1 Gene','This gene is involved in epigenetic modification of DNA.',3370221,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DMYOD1 (myoblast determination protein 1, myogenic factor 3, MYF3, myogenic differentiation 1, PUM, MYOD, bHLHc1)','MYOD1 Gene','This gene plays a role in DNA binding and myogenesis.',3370223,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EGFR exon 19 deletion mutation','EGFR exon 19 deletion mutation','The sequences of a gene that are present in the final, mature, spliced messenger RNA molecule from that gene.: A number with no fractional part, including the negative and positive numbers as well as zero.::19: A change in the nucleotide sequence of the EGFR gene.',3376326,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EGFR exon 21 L858R mutation','EGFR exon 21 L858R mutation','A change in the amino acid residue at position 858 in the epidermal growth factor receptor protein where leucine has been replaced by arginine.: A change in the nucleotide sequence of the EGFR gene.',3376328,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PDGFR (Platelet-Derived Growth Factor Receptor)','Platelet-Derived Growth Factor Receptor','A cell surface protein that has tyrosine-kinase activity. This receptor specifically binds to platelet derived growth factor, and its analogs and antagonists. Ligand binding causes homodimerization or heterodimerization, resulting in receptor activation.',3376370,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RET/PTC1 (RET/PTC1 Protein)','RET/PTC1 (RET/PTC1 Protein)','Human RET Oncoprotein is a product of mutated variants (Oncogene RET) of RET Gene, which encodes Tyrosine-Protein Kinase Receptor RET, a type I membrane protein receptor for Glial Cell Line-Derived with an extracellular cadherin-like domain and important in neural crest development. Some oncogenic RET point mutations cause constitutive kinase activation.  PTC1 oncogene involves fusion of RET kinase to the H4 dimerization leucine zipper.  In PTC6, RET is fused to the N-terminal part of Transcriptional Intermediary Factor-1-Alpha. In PTC7, RET is fused to a C-terminal part of TIF1-Gamma. Oncogenic RET mutations are associated with Hirschsprungs disease, Multiple Endocrine Neoplasia, pheochromocytoma, hyperparathyroidism and medullary thyroid cancer. RET Oncoprotein disrupts normal cell function.: No Value Exists: Any of a group of complex organic macromolecules that contain carbon, hydrogen, oxygen, nitrogen, and usually sulfur and are composed of one or more chains of amino acids. Proteins are fundamental components of all living cells and include many substances, such as enzymes, hormones, and antibodies, that are necessary for the proper functioning of an organism.',3376373,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RET/PTC3 (RET/PTC3 Protein)','RET/PTC3 (RET/PTC3 Protein)','Human RET Oncoprotein is a product of mutated variants (Oncogene RET) of RET Gene, which encodes Tyrosine-Protein Kinase Receptor RET, a type I membrane protein receptor for Glial Cell Line-Derived with an extracellular cadherin-like domain and important in neural crest development. Some oncogenic RET point mutations cause constitutive kinase activation.  PTC1 oncogene involves fusion of RET kinase to the H4 dimerization leucine zipper.  In PTC6, RET is fused to the N-terminal part of Transcriptional Intermediary Factor-1-Alpha. In PTC7, RET is fused to a C-terminal part of TIF1-Gamma. Oncogenic RET mutations are associated with Hirschsprungs disease, Multiple Endocrine Neoplasia, pheochromocytoma, hyperparathyroidism and medullary thyroid cancer. RET Oncoprotein disrupts normal cell function.: No Value Exists: Any of a group of complex organic macromolecules that contain carbon, hydrogen, oxygen, nitrogen, and usually sulfur and are composed of one or more chains of amino acids. Proteins are fundamental components of all living cells and include many substances, such as enzymes, hormones, and antibodies, that are necessary for the proper functioning of an organism.',3376376,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HIV RNA','Human Immunodeficiency Virus Ribonucleic Acid','Human immunodeficiency virus. Species of LENTIVIRUS, subgenus primate lentiviruses (LENTIVIRUSES, PRIMATE), formerly designated T-cell lymphotropic virus type III/lymphadenopathy-associated virus (HTLV-III/LAV). It is acknowledged to be the agent responsible for the acute infectious manifestations, neurologic disorders, and immunologic abnormalities linked to the ACQUIRED IMMUNODEFICIENCY SYNDROME.: A nucleic acid molecule similar to DNA but containing ribose rather than deoxyribose. RNA is formed upon a DNA template. There are several classes of RNA molecules. They play crucial roles in protein synthesis and other cell activities. (MedicineNet.com)',3376675,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Endothelial Precursor Cells (EPCs)','Endothelial Cell Precursor','The main type of cell forming the lining of blood and lymph vessels and the inner layer of the endocardium. SYN endotheliocyte.: A substance from which another substance is formed.',3376676,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EPHA2 (EPH receptor A2, ECK)','Ephrin Receptor Epha2','EphA2 is overexpressed in many cancers, including 40% of breast cancers.  EphA2 can also transform breast epithelial cells in vitro to display properties commonly associated with the development of metastasis. (from Microsc Res Tech 2002 Oct 1;59(1):58-67)',3376834,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ABL1 (v-abl Abelson murine leukemia viral oncogene homolog 1, c-abl oncogene 1, receptor tyrosine kinase, ABL, JTK7, c-ABL, p150)','ABL1 Gene','This gene is involved in cell adhesion, differentiation, division and stress response.',3376836,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RPS6KA1 (ribosomal protein S6 kinase, 90kD, polypeptide 1; RSK, RSK1, HU-1)','RPS6KA1 gene','No Value Exists',3376838,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Dehydroepiandrostenedione (DHEA)','Dehydroepiandrosterone','The determination of the amount of dehydroepiandrosterone hormone present in a sample.',3377231,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Intrachromosomal Amplication Chromosome 21 (iAMP21)','Intrachromosomal Amplification Chromosome 21','One of the bodies (normally 46 in humans) in the cell nucleus that is the bearer of genes, has the form of a delicate chromatin filament during interphase, contracts to form a compact cylinder segmented into two arms by the centromere during metaphase and anaphase stages of cell division, and is capable of reproducing its physical and chemical structure through successive cell divisions. In microbes, the chromosome is prokaryotic, not being enclosed within a nuclear membrane and not being subject to a mitotic mechanism.: Addition of extra material.: The designation for each member of the second smallest human autosomal chromosome pair. Chromosome 21 spans around 47 million nucleotides and represents about 1.5% of the total DNA in normal diploid cells.',3377239,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Trisomy 10 (Trisomy of Chromosome 10)','Trisomy Chromosome 10','A chromosomal abnormality consisting of the presence of one chromosome in addition to the normal diploid number.: The designation for each member of the tenth largest human autosomal chromosome pair. Chromosome 10 spans about 135 million base pairs and represents between 4 and 4.5% of the total DNA in normal diploid cells.',3377240,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CSF Blasts (Hematogenous CSF blasts)','Hematogenous Blast Cell Cerebrospinal Fluid','Originating in the blood or spread through the bloodstream.: Immature blood cells.: (seh-REE-broe-SPY-nal) The fluid flowing around the brain and spinal cord. Cerebrospinal fluid is produced in the ventricles in the brain.',3377243,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Thiopurine S-Methyltransferase Activity (TPMT Activity)','Thiopurine S-Methyltransferase','Thiopurine S-methyltransferase catalyzes S-methylation of thiopurine drugs such as 6-mercaptopurine. (locusLink)',3377244,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Hypoploidy','Hypoploidy','A cell or organism which has less than the normal total number of chromosomes',3377497,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FYN (FYN oncogene related to SRC, FGR, YES; SYN, SLK, MGC45350)','FYN Gene','This gene plays a role in the regulation of cell growth and proliferation.',3377499,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LYN (v-yes-1 Yamaguchi sarcoma viral related oncogene homolog, JTK8)','v-yes-1 Yamaguchi sarcoma viral related oncogene homolog, human','No Value Exists',3377540,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HCK (hemopoietic cell kinase, JTK9)','Hematopoietic cell Kinase','No Value Exists: Encoded by Kinase Family Genes, Kinase enzymes covalently transfer the terminal, gamma phosphate group from ATP to a variety of substrates and typically play key regulatory roles in diverse cellular functions. (NCI)',3377542,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LCK (lymphocyte-specific protein tyrosine kinase)','p56-LCK','A protein tyrosine kinase activated within seconds after crosslinking the mIg complex on B cells or the TCR on T cells.',3377544,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PTK2 (protein tyrosine kinase 2, FAK, FADK, FAK1, PPP1R71)','Protein Tyrosine Kinase 2','Kinases that phosphorylate protein tyrosine residues. These kinases play major roles in mitogenic signalling, and can be divided into two subfamilies: receptor tyrosine kinases, that have an extracellular ligand-binding domain, a single transmembrane domain, and an intracellular tyrosine kinase domain; and nonreceptor tyrosine kinases, which are soluble, cytoplasmic kinases. (Dictionary of Cell and Molecular Biology Online)',3377546,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MAPK14 (mitogen-activated protein kinase 14, CSBP1, CSBP2, CSPB1, PRKM14, p38, Mxi2, PRKM15, p38/MAPK)','MAP Kinase 14','Expressed in brain, heart, placenta, pancreas, skeletal muscle, lung, liver, and kidney, by human MAPK14 Gene (MAPK Family), the four isoforms (varying by internal segments and C-termini) of (Ser/Thr) Mitogen-Activated Protein Kinase 14 are involved in oxidative/hypoxic/environmental/genotoxic stress, transcription, cell cycle regulation, and apoptosis. Bound to cytoplasmic PTPRR and activated by cell stress, proinflammatory cytokines, LPS, Thr/Tyr phosphorylation by MAP2K3, MAP2K6, and MAP2K4, and autophosphorylation by MAP3K7IP1/TAB1 interaction, p38 MAPK phosphorylates MAPKAPK2, MAPKAPK5, ELK-1, ATF2, MEF2C, MAX, CDC25B, and p53. p38 is inhibited by DUSP1 and CSAID drugs. (NCI)',3377554,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('INHBE (activin, MGC4638, inhibin, beta E)','Activin','Disulfide-linked homo- and heterodimeric growth factors (Activin A, Activin B, Activin AB) of the TGF Family with effects on a range of cell types in addition to promoting FSH release in gonadal sites, depending on subunit composition. Composed of Beta-A and Beta-B subunits.',3377557,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GDF9 (Growth Differentiation Factor 9)','Growth Differentiation Factor 9','Growth Differentiation Factor 9, encoded by the human GDF9 gene, is a member of the TGF-beta superfamily. This protein interacts with bone morphogenetic protein-15 and Bone morphogenetic protein receptor type II is a receptor for Growth Differentiation Factor-9. Both GDF9 mRNA and protein are abundantly expressed in oocytes of primary follicles in human ovary, suggesting that the GDF9 transcript is translated at this early stage of folliculogenesis. GDF9 is crucial for normal ovarian folliculogenesis and female fertility. GDF9 regulates human folliculogenesis in a manner specific to the ovary. A dysregulation of GDF9 expression may contribute to aberrant folliculogenesis in PCOS and PCO women. (From OMIM, Swiss-Prot and NCI)',3377559,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD80 (CD80 molecule, B7.1, B7-1, CD28LG, CD28LG1, B-lymphocyte activation antigen B7, CD80 antigen)','CD80 Antigen','CD80 antigen (288 aa, 33 kD) is a cell communication protein that is encoded by the human CD80 gene and has a role in regulation of peptidyl-tyrosine phosphorylation.',3377561,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD86 (CD86 molecule, B7.2, B7-2, CD28LG2, B-lymphocyte antigen B7-2, CD86 antigen)','CD86 Antigen','A CD antigen that plays a role in T-lymphocyte proliferation and interleukin 2 production. It is a co-stimulatory ligand for the CD28 ANTIGEN on T-LYMPHOCYTES and initiates T-cell activation and immune response.',3377563,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PD-L1 (CD274 molecule, programmed cell death 1 ligand 1, CD274, PDCD1LG1, B7-H, B7H1, PDL1, B7-H1)','Programmed Cell Death 1 Ligand 1','Programmed cell death 1 ligand 1 (290 aa, ~33 kDa) is encoded by the human CD274 gene. This protein is involved in the mediation of both the activation and proliferation of T cells.',3377565,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TYMP (thymidine phosphorylase, gliostatin, ECGF1, MNGIE)','Thymidine Phosphorylase, Platelet-Derived Endothelial Cell Growth Factor 1','Endothelial Cell Growth Factor 1 (Platelet-Derived), encoded by the human ECGF1 gene, catalyses the reversible phosphorolysis of thymidine. The produced molecules are then utilized as carbon and energy sources or in the rescue of pyrimidine bases for nucleotide synthesis. This protein may have a role in maintaining the integrity of the blood vessels. It promotes angiogenesis in vivo and stimulates the in vitro growth of a variety of endothelial cells. ECGF1 has a highly restricted target cell specificity acting only on endothelial cells. It also limits glial cell proliferation as gliostatin. Defects in ECGF1 are the cause of mitochondrial neurogastrointestinal encephalomyopathy (MNGIE), an autosomal recessive human disease associated with multiple deletions of skeletal muscle mitochondrial DNA (MTDNA). (From LocusLink, Swiss-Prot and NCI)',3377574,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FGR (Gardner-Rasheed feline sarcoma viral (v-fgr) oncogene homolog, SRC2, c-fgr, p55c-fgr)','Oncogene FGR','Human Oncogene FGR is a mutated variant of FGR Gene (SRC Family), which encodes 529-aa 60-kDa p55-FGR, a protein tyrosine kinase that may bind PTPNS1 and contains 1 SH2 and 1 SH3 domain. Oncogene FGR disrupts normal cell function.',3377576,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Vimentin','Vimentin','Human vimentin protein (465 aa, ~53.5 kDa) is encoded by the human vimentin (VIM) gene. This phosphoprotein is a structural protein belonging to the intermediate filament family and is highly expressed in fibroblasts.',3377578,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TYR (tyrosinase, OCAIA)','Tyrosinase','A group of copper proteins that also catalyze the reaction of EC 1.10.3.1 catechol oxidase, if only 1,2-benzenediols are available as substrate. (from IUBMB)',3377580,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DHEA-S (Dehydroepiandrosterone sulfate)','Dehydroepiandrosterone sulfate (DHEA-S)','The determination of the amount of sulfated dehydroepiandrosterone (DHEA) present in a sample.',3377595,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TOP1(topoisomerase (DNA) I)','Topoisomerase I','Encoded by human TOP1 Gene (TOPI Family), 765-aa 90.7-kD monomeric DNA Topoisomerase I catalyzes transient ATP-independent breaking/rejoining of DNA and controls DNA topology during transcription. DNA topoisomerases I and II relax negative and positive supercoils; TOP1 breaks single DNA strands, TOP2 breaks duplex DNA. Specifically inhibited by the antitumor plant alkaloid CPT, when TOP1 breaks the DNA backbone bond it forms a protein-DNA link (a tyrosyl oxygen joins to a DNA strand end phosphorus). (from LocusLink, Swiss-Prot, OMIM, and NCI)',3377596,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DCK (deoxycytidine kinase)','Deoxycytidine Kinase','Deoxycytidine Kinase, encoded by the DCK gene, is required for the phosphorylation of several deoxyribonucleosides and their nucleoside analogs. Deficiency of DCK is associated with resistance to antiviral and anticancer chemotherapeutic agents. Conversely, increased deoxycytidine kinase activity is associated with increased activation of these compounds to cytotoxic nucleoside triphosphate derivatives. DCK is clinically important because of its relationship to drug resistance and sensitivity. (from LocusLink)',3377598,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Tubulin','Tubulin','Microtubules of the eukaryotic cytoskeleton perform essential and diverse functions and are composed of a heterodimer of alpha and beta tubulin. The genes encoding these microtubule constituents are part of the tubulin superfamily, which is composed of six distinct families. Genes from the alpha, beta and gamma tubulin families are found in all eukaryotes. The alpha and beta tubulins represent the major components of microtubules, while gamma tubulin plays a critical role in the nucleation of microtubule assembly. There are multiple alpha and beta tubulin genes and they are highly conserved among and between species. (from LocusLink)',3377599,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Anti-Her2 Antibody','Human Epidermal Growth Factor Receptor 2 (Her2) Antibody','The ERBB2 gene encodes a putative tyrosine kinase growth factor receptor EGFR2, p185 HER2/NEU antigen, similar to the EGF receptor.  The ERBB2, ERBB3, and ERBB4 genes encode heregulin/neuregulin receptors, members of the EGFR-related type I receptor tyrosine kinase subfamily.  The encoded proteins form homo- and heterodimers, which complicates assignment of function: ERBB2 homodimers do not bind heregulin, but ERBB2/ERBB3 heterodimers do.  Herstatin is a secreted alternative ERBB2 product, of the extracellular domain, that binds to p185ERBB2, disrupts ERBB2 dimers, reduces p185 phosphorylation, and inhibits growth.  Human ERBB2 gene is located at 17p12-21.  Overexpression of HER-2 correlates with poor prognosis in breast carcinoma.: (AN-tih-BOD-ee) A type of protein made by certain white blood cells in response to a foreign substance (antigen). Each antibody can bind to only a specific antigen. The purpose of this binding is to help destroy the antigen. Antibodies can work in several ways, depending on the nature of the antigen. Some antibodies destroy antigens directly. Others make it easier for white blood cells to destroy the antigen.',3377621,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Anti-Muc-1 Antibody (Mucin-1 Antibody)','Mucin-1 Antibody','Mucin-1 (1255 aa, ~122 kDa) is encoded by the human MUC1 gene. This protein plays a role in both signaling and cell adhesion.: (AN-tih-BOD-ee) A type of protein made by certain white blood cells in response to a foreign substance (antigen). Each antibody can bind to only a specific antigen. The purpose of this binding is to help destroy the antigen. Antibodies can work in several ways, depending on the nature of the antigen. Some antibodies destroy antigens directly. Others make it easier for white blood cells to destroy the antigen.',3377686,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BCR/ABL p190 breakpoint mutation','p190 Fusion Protein Expression BCR-ABL Oncoprotein Chromosomal mutation','Expression of a fusion protein with an apparent molecular weight of 190 kilodaltons that results from a fusion of the human genes BCR and ABL1. An onco-protein generated from the fusion of Bcr and Abl genes by translocation process between chromosome 9 and 22 (Philadelphia chromosome), in CML (P210) and some ALL (P190).: No Value Exists',3377688,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BCR/ABL p210 breakpoint mutation','BCR-ABL Oncoprotein p210 Fusion Protein Expression Chromosomal mutation','An onco-protein generated from the fusion of Bcr and Abl genes by translocation process between chromosome 9 and 22 (Philadelphia chromosome), in CML (P210) and some ALL (P190).: Expression of a fusion protein with an apparent molecular weight of 210 kilodaltons that results from a fusion of the human genes BCR and ABL1.No Value Exists',3377689,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CEACOM1 (carcinoembryonic antigen-related cell adhesion molecule 1 (biliary glycoprotein), BGP1, CD66a, BGP)','carcinoembryonic antigen-related cell adhesion molecule 1 (biliary glycoprotein)','No Value Exists',3379236,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BID (BH3-Interacting Domain Death Agonist)','BH3-Interacting Domain Death Agonist','BH3-interacting domain death agonist (195 aa, ~22 kDa) is encoded by the human BID gene. This protein plays a role in the promotion of apoptosis.',3379238,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BIRC2 (baculoviral IAP repeat containing 2, cIAP1, IAP-2, hiap-2, MIHB, RNF48, c-IAP1)','Baculoviral IAP Repeat-Containing Protein 2','Baculoviral IAP repeat-containing protein 2 (618 aa, ~70 kDa) is encoded by the human BIRC2 gene. This protein plays a role in the regulation of apoptosis.',3379240,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BCL10 (B-cell CLL/lymphoma 10, BCL 10, CARMEN, CIPER, mE10, c-E10, CLAP)','B-Cell Lymphoma/Leukemia 10','B-cell lymphoma/leukemia 10 (233 aa, ~26 kDa) is encoded by the human BCL10 gene. This protein is involved in both the promotion of apoptosis and the activation of nuclear factor-kappa-B signaling.',3379242,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Triglycerides','Triglycerides','Fats composed of three fatty acid chains linked to a glycerol molecule.',3379243,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ras Activity','RAS Superfamily Protein','Small cellular monomeric proteins with GTPase activity, RAS Superfamily Proteins are involved in signal transduction in normal cellular growth, differentiation, and development.',3379245,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EIF2AK2 (eukaryotic translation initiation factor 2-alpha kinase 2, PKR, PRKR, protein kinase R)','Interferon-Induced, Double-Stranded RNA-Activated Protein Kinase','Interferon-induced, double-stranded RNA-activated protein kinase (551 aa, ~62 kDa) is encoded by the human EIF2AK2 gene. This protein is involved in both serine/threonine phosphorylation and the inhibition of protein synthesis.',3379247,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIR146A (microRNA 146, MIR146A, MIRN146, hsa-mir-146a)','MIR146A Gene','This gene is involved in the regulation of gene expression and plays a role in the development of hepatocellular, breast, thyroid, ovarian and prostatic carcinomas.',3379249,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DHFR (dihydrofolate reductase)','Dihydrofolate Reductase','Dihydrofolate reductase converts dihydrofolate into tetrahydrofolate, a methyl group shuttle required for the de novo synthesis of purines, thymidylic acid, and certain amino acids.  It is a drug target.  Variation in gene expression or sequence may alter the efficacy of chemotherapy. (from LocusLink and NCI)',3379257,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MTRR (5-methyltetrahydrofolate-homocysteine methyltransferase reductase, cbIE)','Methylenetetrahydrofolate Reductase','A flavoprotein (FAD).  [EC 1.5.1.20 created 1978 as EC 1.1.1.171, transferred 1984 to EC 1.5.1.20] (from IUBMB).',3379259,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SLAMF6 (SLAM family member 6, KALI, NTBA, KALIb, Ly108, SF2000, NTB-A, CD352)','SLAMF6 gene','No Value Exists',3379261,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD244 (natural killer cell receptor 2B4, CD244 molecule, 2B4, NAIL, NKR2B4, Nmrk, SLAMF4)','CD244 protein, human','No Value Exists',3379263,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KIR3DL1 (killer cell immunoglobulin-like receptor, three domains, long cytoplasmic tail, 1; cl-2, NKB1, cl-11, nkat3, NKB1B, AMB11, CD158e1/2, CD158e1, CD158e2, KIR)','KIR3DL1 protein,human','No Value Exists',3379265,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MYCN (v-myc myelocytomatosis viral related oncogene, neuroblastoma derived (avian), bHLHe37, N-myc, NMYC)','N-Myc Proto-Oncogene Protein','N-myc proto-oncogene protein (464 aa, ~50 kDa) is encoded by the human MYCN gene. This protein plays a role in the regulation of transcription and DNA binding.',3384658,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RLF (rearranged L-myc fusion, ZNF292L, Zn-15L)','rlf-L-myc fusion protein, human','No Value Exists',3384660,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BAD (BCL2-associated agonist of cell death, BCL2L8, BBC2)','Bcl2 Antagonist of Cell Death','Bcl2 antagonist of cell death (168 aa, ~18 kDa) is encoded by the human BAD gene. This protein is involved in the mediation of apoptosis.',3384662,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD7 (CD7 antigen (p41), CD7 molecule, GP40, LEU-9, TP41, Tp40)','T-Cell Antigen CD7','Expressed in thymocytes and mature T cells by human CD7 Gene (Immunoglobulin Superfamily), 240-aa 25-kDa (precursor) T-Cell Antigen CD7 is a cell surface type I transmembrane glycoprotein that interacts with SECTM1, contains an Ig-like domain, and is essential in T-cell interactions and in T-cell/B-cell interaction during early lymphoid development. One of the earliest antigens on cells of the T-lymphocyte lineage, CD7 is the most reliable clinical marker of T-cell acute lymphocytic leukemia. (NCI)',3384663,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Microsatellite Instability (MSI)','Microsatellite Instability','Genomic instability associated with defective DNA mismatch repair in tumors.',3384664,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CBS (cystathionine-beta-synthase, HIP4)','Cystathionine beta-Synthase','A multifunctional pyridoxal phosphate enzyme. In the second stage of cysteine biosynthesis it catalyzes the reaction of homocysteine with serine to form cystathionine with the elimination of water. Deficiency of this enzyme leads to HYPERHOMOCYSTEINEMIA and HOMOCYSTINURIA. EC 4.2.1.22.',3384668,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RASSF5 (Ras association (RalGDS/AF-6) domain family member 5, Maxp1, NORE1, RAPL)','Ras association (RalGDS/AF-6) domain family member 5','No Value Exists',3384671,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BDNF (Brain-Derived Neurotrophic Factor, neurotropin)','Brain-Derived Neurotrophic Factor','Brain-Derived Neurotrophic Factor is a member of the nerve growth factor family.  It exerts trophic action on retinal, cholinergic, and dopaminergic neurons in the brain and on motor and sensory neurons in the peripheral nervous system.  Target cells regulate neuronal survival by producing neurotrophic factors, such as NGF and BDNF, which show sequence similarity.  Proforms of NGF and BDNF are secreted and cleaved by plasmin serine protease and matrix metalloproteinases (MMP7, MMP3); proforms preferentially activate p75(NTR) to mediate apoptosis and mature forms activate TRK receptors to promote survival.  Huntingtin up regulates transcription of BDNF.  Mutated Huntingtin decreases production of BDNF leading to neuronal death.  (from OMIM 113505 and NCI)',3384673,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PPP2R1A (protein phosphatase 2, regulatory subunit A, alpha; PR65A, PP2A-Aalpha,','Serine/Threonine-Protein Phosphatase 2A 65 kDa Regulatory Subunit A Alpha Isoform','Serine/threonine-protein phosphatase 2A 65 kDa regulatory subunit A alpha isoform (589 aa, ~65 kDa) is encoded by the human PPP2R1A gene. This protein is involved in the regulation of protein phosphatase 2A complex assembly.',3384675,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ARRB2 (arrestin, beta 2; BARR2, DKFZp686L0365, ARR2)','Arrestin','A 48-Kd protein of the outer segment of the retinal rods and a component of the phototransduction cascade. Arrestin quenches G-protein activation by binding to phosphorylated photolyzed rhodopsin. Arrestin causes experimental autoimmune uveitis when injected into laboratory animals.',3384677,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GSK3B (glycogen synthase kinase 3 beta)','glycogen synthase kinase 3 beta','No Value Exists',3384679,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ANXA5 (annexin A5, ANX5, ENX5)','Annexin A5 Protein','Encoded by human Annexin A5 Gene, Annexin A5 is a 35 kD 320-amino acid monomeric placental protein similar to PP4-X that contains 4 annexin repeats; some may bind calcium and phospholipid.  PP4 and PP4-X (Lipocortin family) are similar to lipocortin I and calpactin I.  PP4 is also an Annexin family member, Ca(2+)-dependent phospholipid binding proteins located on the plasma membrane cytosolic face.  PP4 forms a voltage-dependent membrane Ca(2+) channel; key amino acids act as selectivity filters and voltage sensors, regulating pore permeability to ions.  As an anticoagulant protein, PP4 acts as an indirect inhibitor of the blood coagulation cascade thromboplastin-specific complex.  PP4 may bind ATRX.  (OMIM, Swiss-Prot, and NCI)',3384681,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MiR-181b (MicroRNA 181-beta)','MicroRNA 181b','A number with no fractional part, including the negative and positive numbers as well as zero.::181b: A sequence of single-stranded RNA which is typically 20-25 nucleotides in length and may regulate the expression of other genes. miRNAs are RNA genes which are transcribed from DNA, but are not translated into proteins.',3384686,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MiR-16 (MicroRNA 16)','MicroRNA 16','A number with no fractional part, including the negative and positive numbers as well as zero.::16: A sequence of single-stranded RNA which is typically 20-25 nucleotides in length and may regulate the expression of other genes. miRNAs are RNA genes which are transcribed from DNA, but are not translated into proteins.',3384687,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MiR-19b (MircoRNA 19-beta)','MircoRNA 19-beta','A number with no fractional part, including the negative and positive numbers as well as zero.::19B: A sequence of single-stranded RNA which is typically 20-25 nucleotides in length and may regulate the expression of other genes. miRNAs are RNA genes which are transcribed from DNA, but are not translated into proteins.',3384688,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TRAF3 (TNF receptor-associated factor 3, CAP-1, CD40bp, CRAF1, LAP1)','TNF Receptor-Associated Factor 3','TNF receptor-associated factor 3 (568 aa, ~64 kDa) is encoded by the human TRAF3 gene. This protein is involved in the induction of apoptosis and signaling.',3384692,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ADA (Adenosine Deaminase)','Adenosine Deaminase','Adenosine deaminase catalyzes the hydrolysis of adenosine to inosine. ADA deficiency causes one form of severe combined immunodeficiency disease (SCID), in which there is dysfunction of both B and T lymphocytes with impaired cellular immunity and decreased production of immunoglobulins. (LocusLink)',3385599,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CHUK (conserved helix-loop-helix ubiquitous kinase, IKK1, IKK-alpha, IkBKA, NFKBIKA, IKKA, TCF16)','Conserved Helix-Loop-Helix Ubiquitous Kinase','Widely expressed by human CHUK Gene (Ser/Thr IKBK Family), 745-aa 85-kDa Conserved Helix-Loop-Helix Ubiquitous Kinase is an autophosphorylated cytoplasmic protein found in active heterodimer with IKK-beta bound to MAP3K14/NIK, MEKK1, IKAP, IKB-alpha-p65-p50 complex, and in complex with NCOA2, NCOA3, IKKB, IKBKG, and CREBBP. CHUK may interact with TRAF2, IKK-gamma/NEMO, and TRPC4AP. Inactivated by PP2A and activated by MAP3K14/NIK, AKT, and MEKK1, CHUK (or IKBKB) serine phosphorylates NFKB inhibitors (I-Kappa-Bs, NFKBIA or NFKBIB) leading to dissociation from cytoplasmically-trapped NFKB and ubiquitinated inhibitor degradation. Activated NFKB translocates to the nucleus, binds at kappa-B DNA binding motifs, and regulates transcription of target genes. CHUK also phosphorylates NCOA3. (NCI)',3385601,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Poly-ADP-ribosylated (PAR) substrates','Poly(ADP Ribose) Polymerase Substrate','The human protein poly(ADP ribose) polymerase protein (1013aa, ~113 kDa) is encoded by the PARP1 gene (PARP1). Poly(ADP ribose) polymerase (PARP) is a cytosolic protein, and when activated is cleaved into two fragments of 89kd and 24kd. The enzyme modifies various nuclear proteins by poly(ADP-rybosyl)ation. The protein is involved in the regulation of various important cellular processes such as differentiation, proliferation, tumor transformation, and recovery from DNA damage. Its inhibition has been studied in cancerous cells and degenerative diseases to demonstrate how apoptosis can be inhibited when the PARP is inactive or absent.: A Substrate Domain is a protein region that physically interacts stereospecifically, and usually at high affinity, with a specific target substrate. In enzymes, the substrate domain is often, though not necessarily, coincident with the catalytic domain. Typically, substrate interaction results in some protein conformational alteration and functional modification. (NCI)',3389913,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NEDD9 (neural precursor cell expressed, developmentally down-regulated 9; HEF1, CAS-L, CASS2)','neural precursor cell expressed,developmentally down-regulated 9','This gene is involved in the modulation of signal pathways induced by cellular adhesion.',3389957,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BAK1 (BCL2-antagonist/killer 1, BCL2L7, BAK, CDN1)','BCL2-antagonist/killer 1 (BAK1)','This gene is involved in the regulation of apoptosis by inhibiting cell death.',3389990,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FADS1 (fatty acid desaturase 1, LLCDL1, D5D, FADSD5, TU12, FADS6, delta-5 desaturase)','Fatty Acid Desaturase 1','Fatty acid desaturase 1 (444 aa, ~52 kDa) is encoded by the human FADS1 gene. This protein plays a role in catalyzing saturation and desaturation of fatty acids.',3390028,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SYK (Spleen Tyrosine Kinase )','Spleen Tyrosine Kinase','Related to B cell activation, PTK72 is a tyrosine kinase that becomes tyrosine phosphorylated and activated soon after anti-Ig stimulation of B cells.  It is found associated with the mIg receptor complex.  Unlike the membrane-bound Src-family tyrosine kinases, PTK72 is primarily present as a soluble cytosolic protein.  It is probably the product of the syk gene and is highly related to the ZAP-70 protein associated with T cell activation.',3390030,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MAPK8 (mitogen-activated protein kinase 8, JNK, JNK1, SAPK1, PRKM8, JUN N-terminal kinase)','MAP Kinase 8','Encoded by Human MAPK8 Gene (MAPK Family) as alternative isoforms (alpha-1, -2, beta-1, -2), MAP Kinase 8 is a stress/cytokine-induced Ser/Thr kinase that acts as an integration point for multiple biochemical signals involved in target transcription factor regulation, such as c-Jun and ATF2. Beta-1 binds c-Jun; alpha-1, -2, and beta-2 bind c-Jun or ATF2. Inhibited by dual specificity phosphatases, and phosphothreonine/tyrosine activated by a Ras-dependent dual specificity MAP2K4/MAP2K7 cascade, MAPK8 mediates immediate-early gene expression. MAPK8 binds scaffolding proteins MAPK8IP1/2/3. MAPK8/UV-induced apoptosis appears related to cytochrome c-mediated cell death. MAPK8 activation by TNF-alpha induces apoptosis. MAPK8 appears to be required for T-helper cell differentiation into Th1 cells. (NCI)',3390032,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TNFSF13B (tumor necrosis factor (ligand) superfamily, member 13b, BAFF, THANK, BLYS, TALL-1, TALL1, CD257, TNFSF20)','Tumor Necrosis Factor Ligand Superfamily Member 13B','Tumor necrosis factor ligand superfamily member 13B (285 aa, ~31 kDa) is encoded by the human TNFSF13B gene. This protein is involved in signal transduction and the modulation of B- and T-cell proliferation.',3396682,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IDO2 (indoleamine 2,3-dioxygenase 2, INDOL1)','Indoleamine 2,3-Dioxygenase 2','Indoleamine 2,3-dioxygenase (403 aa, ~45 kDa) is encoded by the human INDO gene. This protein is involved in the degradation of tryptophan.',3411948,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Matrix Metalloproteinase (MMP)','Matrix Metalloproteinase','Matrix metalloproteinases are Zn(2+)-binding endopeptidases that degrade components of the extracellular matrix. These enzymes are implicated in tissue remodeling processes, wound healing, angiogenesis, and tumor invasion. Matrix metalloproteinases have been associated with the development of advanced-stage cancer via their role in tumor progression, invasion, and metastasis.',3411955,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PDGF-AB (platelet-derived growth factor-AB)','Platelet-derived growth factor-AB','Platelet-derived growth factor-AB',3411956,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PDGF-AA (platelet-derived growth factor-AA)','Platelet-derived growth factor-AA','Platelet-derived growth factor-AA',3411957,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CT45 (cancer/testis antigen family 45)','CancerTestis Antigen family 45','A tumor composed of atypical neoplastic, often pleomorphic cells that invade other tissues.  Malignant neoplasms usually metastasize to distant anatomic sites and may recur after excision.  The most common malignant neoplasms are carcinomas (adenocarcinomas or squamous cell carcinomas), Hodgkins and non-Hodgkins lymphomas, leukemias, melanomas, and sarcomas. -- 2004: Either of the paired male reproductive glands that produce the male germ cells and the male hormones.: A number with no fractional part, including the negative and positive numbers as well as zero.::45: Any substance that appears foreign or potentially adverse to the body and elicits immune response.',3412039,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Circulating myeloid cells','Circulating Myeloid Cell','A Circulatory Process consists of functions of cellular, cell, or tissue components of the heart and vessels by which blood and lymph is circulated through the body.: Cells which include the monocytes and the granulocytes. (MeSH)',3412041,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('UGT1A (UDP glycosyltransferase 1 family, polypeptide A cluster, UDP glucuronosyltransferase 1 family, polypeptide A complex locus, UGT)','UGT1A gene','No Value Exists',3412043,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Myeloid chemokine','Myeloid Chemokine','(MYE-eh-loyd) Pertaining to, derived from, or manifesting certain features of the bone marrow. In some cases also pertains to certain types of non-lymphocyte white blood cells found in the bone marrow, including granulocyte, monocyte, and platelet lineages. Also called myelogenous.: Chemokines constitute a superfamily of small (8-10 kDa), inducible, secreted, pro-inflammatory cytokines that are involved in a variety of immune and inflammatory responses as well as in viral infection.  Chemokines act primarily as chemoattractants and activators of specific types of leukocytes.  Some members of this family were initially identified on the basis of their biological activities (e.g., IL-8, GRO), others were discovered using subtractive hybridization (e.g., RANTES) or signal sequence trap (e.g., PBSF/SDF-1)11 cloning strategies.  They attract and activate leukocytes and regulate diverse cellular systems and organs ranging from blood vessels to the central nervous system.',3412045,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('S100 calcium binding protein','S100 Calcium Binding Protein','Encoded by S100 Family Gene members, S100 Calcium Binding Proteins, localized in the cytoplasm and/or nucleus of many cells, often regulate cellular processes such as cell cycle progression and differentiation.',3412073,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NCOA2 (nuclear receptor coactivator 2, TIF2, GRIP1, NCoA-2, KAT13C, bHLHe75)','Nuclear Receptor Coactivator 2','Nuclear receptor coactivator 2 (1464 aa, ~159 kDa) is encoded by the human NCOA2 gene. This protein plays a role in the regulation of steroid-mediated gene transcription.',3412075,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TIMP2 (tissue inhibitor of metalloproteinase 2, CSC-21K, TIMP metallopeptidase inhibitor 2)','Metalloproteinase Inhibitor 2','Metalloproteinase inhibitor 2 (220aa, ~24 kDa) is encoded by the human TIMP2 gene. This protein plays a role in metalloproteinase inhibition.',3412077,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TIMP1 (tissue inhibitor of metalloproteinase 1, CLGI, EPO, TIMP, TIMP metallopeptidase inhibitor 1)','Tissue Inhibitor of Metalloproteinase 1 Measurement','A measurement of the tissue inhibitor of metalloproteinase 1 in a biological specimen.',3412079,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Sezary Cell','Sezary Cell','No Value Exists',3412081,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Neopterin','Neopterin','A pteridine derivative present in body fluids; elevated levels result from immune system activation, malignant disease, allograft rejection, and viral infections. (From Stedman, 26th ed) Neopterin also serves as a precursor in the biosynthesis of biopterin.',3412106,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('B-RAF Protein Kinase (B-type Raf Kinase)','B-RAF Protein Kinase','The 94 kD B-RAF serine/threonine protein kinase is a signaling factor critical for formation of the vascular system.  Fusion of TIF1A to B-RAF results in production of a TIF1-alpha-B-RAF oncoprotein.  The BRAF gene encodes the human homologue of the avian c-Rmil proto-oncogene.  (from OMIM 164757 and NCI)',3412272,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AKT2','AKT2 Gene','This gene plays a role in glucose homeostasis and the inhibition of apoptosis.',3412274,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PI3K (Phosphatidylinositol 3 Kinase , PI3-K)','Phosphatidylinositol 3 Kinase','An enzyme that catalyzes the conversion of phosphatidylinositol to phosphatidylinositol 3-phosphate. This is the first committed step in the biosynthesis of phosphatidylinositol 3,4-bisphosphate and phosphatidylinositol 3,4,5-trisphosphate. This pathway is thought to play a critical role in DNA repair, V(D)J recombination and cell cycle checkpoints. (from LocusLink)',3412291,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KIT (KIT Gene)','KIT Gene','This gene plays a role in cellular hematopoiesis and differentiations. Mutations in the gene are associated with several diseases, including acute myelogenous leukemia, gastrointestinal tumors, and mast cell disease.',3412292,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIB1 (mindbomb homolog 1 (Drosophila), DIP-1, KIAA1323, ZZANK2, ZZZ6)','MIB1 protein, human','No Value Exists',3415129,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Malondialdehyde','Malondialdehyde','An organic compound with the formula CH2(CHO)2, and a byproduct of lipid metabolism in the body. Malondialdehyde, a highly reactive compound, is one of the many reactive electrophile species that cause toxic stress in cells and form covalent protein adducts, called advanced lipoxidation end products (ALE). This compound also forms mutagenic DNA adducts when it reacts with deoxyadenosine and deoxyguanosine in DNA. Malondialdehyde is also found in many foods and is present in high levels in rancid foods.',3415764,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CYP2B6 (cytochrome P450, family 2, subfamily B, polypeptide 6; CPB6, CYPIIB6, CYP2B)','Cytochrome P450 2B6','Expressed in liver, lung, and heart by phenobarbital-induced human CYP2B6 Gene (Cytochrome P450 Family), 491-aa 56-kDa Cytochrome P450 2B6 is an endoplasmic reticulum membrane-bound P450 heme-thiolate monooxygenase involved in an NADPH-dependent electron transport pathway that oxidizes diverse unrelated compounds, including steroids, fatty acids, and xenobiotics such as cyclophosphamide and ifosfamide. Phosphorylation may decrease CYP2B6 activity. P450 enzymes catalyze reactions involved in drug metabolism and synthesis of cholesterol, steroids and other lipids. (NCI)',3415766,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CYP2C19 (cytochrome P450, family 2, subfamily C, polypeptide 19; CYP2C, P450IIC19, CPCJ)','Cytochrome P450, Family 2, Subfamily C, Polypeptide 19','This protein is a member of the cytochrome P450 superfamily of enzymes. The cytochrome P450 proteins are monooxygenases which catalyze many reactions involved in drug metabolism and synthesis of cholesterol, steroids and other lipids. This protein localizes to the endoplasmic reticulum and is known to metabolize many xenobiotics, including the anticonvulsive drug mephenytoin, omeprazole, diazepam and some barbiturates. Polymorphism within this gene is associated with variable ability to metabolize mephenytoin, known as the poor metabolizer and extensive metabolizer phenotypes. (from LocusLink)',3415768,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Histone 4 (H4)','Histone H4','Histone H4 is a core subunit of the eukaryotic nucleosome complex. Histones are basic nuclear proteins responsible for the nucleosome structure of chromatin. Repeating nucleosome units contain two molecules each of Histones H2A, H2B, H3, and H4 that form an octamer complex around which approximately 146 base pairs of DNA is wrapped. The nucleosome interacts with DNA between nucleosome units in mediating chromatin compaction into higher order structures.',3416098,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Histone 3 (H3)','Histone H3','Arginine rich histone.  One of four histones assembled into a nucleosomal core octamer.  Various posttranslationally modified forms and variants exist.  Combines with histone H4 in a heterotetramer of composition (H3)2(H4)2; one tetramer is incorporated in the nucleosomal octamer.',3416100,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('INHBB (inhibin, beta B)','Inhibin B','Inhibin B, consisting of an alpha subunit and a beta B subunit linked by disulphide bonds, is a heterodimer hormone produced by the follicle cells of the ovary and by the Sertoli and Ledig cells of testis.  Although other forms of inhibin also exist in men, inhibin B is the predominant form in the circulation in men.',3416102,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('INHA (inhibin, alpha)','Inhibin A','Gonadal glycoprotein hormone, Inhibin A, consists of an alpha subunit covalently linked to a beta-A subunit and strongly inhibits pituitary FSH secretion.  Serum concentrations transit during the menstrual cycle.  Dimers of the beta subunit (a TGF-beta superfamily member), termed activin, are potent stimulators of FSH secretion.  (from OMIM 147380 and NCI)',3416104,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Factor VIII (Coagulation Factor VIII)','Coagulation Factor VIII','Human coagulation factor-VIII (2351 aa, 267 kDa precursor) is encoded by human factor eight (F8) gene. The protein is an extracellular anti-hemophilic factor that is part of the von Willebrand factor complex. The protein plays a role in the blood coagulation pathway.',3416106,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RASSF1 (Ras association (RalGDS/AF-6) domain family member 1, RASSF1A, 123F2, NORE2A, RDA32, REH3P21)','Ras Association Domain-Containing Protein 1','Ras association domain family 1 protein (344 aa, ~39 kDa) is encoded by the RASSF1 gene. This protein is inextricably involved in death receptor-dependent apoptosis and is a potential tumor suppressor.',3419140,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('APAF1 (apoptotic peptidase activating factor 1, APAF-1, CED4)','Apoptotic Protease-Activating Factor 1','Apoptotic protease-activating factor 1 (1248 aa, ~142 kDa) is encoded by the human APAF1 gene. This protein plays a role in protein-protein interactions, protein modification and apoptosis induction.',3419144,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MMP2 (matrix metallopeptidase 2 (gelatinase A, 72kDa gelatinase, 72kDa type IV collagenase), CLG4, CLG4A, TBE-1)','Matrix Metalloproteinase 2 (gelatinase A,72kDa type IV collagenase)','72 kDa type IV collagenase (660 aa, ~74 kDa) is encoded by the human MMP2 gene. This protein is involved in both proteolysis and angiogenesis.: The determination of the amount of matrix metalloproteinase 2 present in a sample.',3419147,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Heregulin (HRG)','Neuregulin','Neuregulin (heregulin) polypeptides have been shown to interact with and activate the ErbB2, ErbB3 and ErbB4 receptor proteins, and have been found to be essential for the normal development of the cardiovascular, pancreatic and nervous systems. Neuregulins are involved in the normal development of mammary gland, are secreted by breast cancer cells, and can alternatively promote or inhibit breast cancer cell division.',3419149,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ADAM11 (ADAM metallopeptidase domain 11, MDC, metalloproteinase-like, disintegrin-like, cysteine-rich protein)','ADAM11 Protein','This protein is a member of the ADAM protein family. Members of this family are membrane-anchored proteins structurally related to snake venom disintegrins, and have been implicated in a variety of biologic processes involving cell-cell and cell-matrix interactions, including fertilization, muscle development, and neurogenesis. The gene represents a candidate tumor supressor gene for human breast cancer based on its location within a minimal region of chromosome 17q21 previously defined by tumor deletion mapping. (LocusLink)',3419154,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Hepatocyte growth factor (hepapoietin A; scatter factor, HGF)','Hepatocyte Growth Factor','Human Hepatocyte Growth Factor is also known as Scatter Factor and Hepatopoeitin A.  HGF is a potent mitogen for mature parenchymal hepatocyte cells and acts as a growth factor for a broad spectrum of tissues and cell types, including renal tubular epithelial cells, epidermal keratinocytes and melanocytes.  A single chain precursor is cleaved to 70 kD and 30kD chains that are linked by one disulfide bond. Both the single chain and cleaved form are active.',3419156,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IGF2R (insulin-like growth factor 2 receptor, CD222, MPRI, MPR1, CIMPR, M6P-R)','Insulin-Like Growth Factor 2 Receptor Insulin-Like Growth Factor 2 Receptor','IGF2R is a 250kDa transmembrane protein. It was originally identified as a receptor for IGFII and M6P-containing proteins (e.g. lysosomal hydrolases). Lysosomal enzymes are sorted to lysosomes via IGF2R either from the Golgi, where the enzymes acquire M6P, or from the extracellular space. The majority of IGF2R molecules are located intracellularly, only 5-10% is present on the cell membrane. IGF2R is also a receptor for TGFbeta latency associated peptide (LAP), proliferin and may bind several molecules independently of M6P, including plasminogen, CD87 or retinoic acid. It is involved in activation of latent TGFbeta.  It is a putative hepatocellular tumor suppressor. (from LocusLink): IGF2R is a 250kDa transmembrane protein. It was originally identified as a receptor for IGFII and M6P-containing proteins (e.g. lysosomal hydrolases). Lysosomal enzymes are sorted to lysosomes via IGF2R either from the Golgi, where the enzymes acquire M6P, or from the extracellular space. The majority of IGF2R molecules are located intracellularly, only 5-10% is present on the cell membrane. IGF2R is also a receptor for TGFbeta latency associated peptide (LAP), proliferin and may bind several molecules independently of M6P, including plasminogen, CD87 or retinoic acid. It is involved in activation of latent TGFbeta.  It is a putative hepatocellular tumor suppressor. (from LocusLink)',3419176,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CYP27A1 (cytochrome P450, family 27, subfamily A, polypeptide 1; CTX, CP27, CYP27, cytochrome P450, subfamily XXVIIA (steroid 27-hydroxylase, cerebrotendinous xanthomatosis), polypeptide 1)','cytochrome P450 27A1 activity','No Value Exists',3419178,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BMI1 (polycomb ring finger oncogene, PCGF4, RNF51)','Polycomb Complex Protein BMI-1','Polycomb complex protein BMI-1 (326 aa, ~37 kDa) is encoded by the human BMI1 gene. This protein is involved in transcriptional repression during embryonic development.',3420541,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('JAK1 (Janus Kinase 1)','Janus Kinase 1','Janus kinase 1 (JAK1), is a member of a class of protein-tyrosine kinases (PTK) characterized by the presence of a second phosphotransferase-related domain immediately N-terminal to the PTK domain. JAK1 is a large, widely expressed membrane-associated phosphoprotein. It is involved in the interferon-alpha/beta and -gamma signal transduction pathways. The reciprocal interdependence between JAK1 and TYK2 activities in the interferon-alpha pathway, and between JAK1 and JAK2 in the interferon-gamma pathway, may reflect a requirement for these kinases in the correct assembly of interferon receptor complexes. These kinases couple cytokine ligand binding to tyrosine phosphorylation of various known signaling proteins and of a unique family of transcription factors termed the signal transducers and activators of transcription, or STATs. (from LocusLink)',3420543,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TRDMT1 (tRNA aspartic acid methyltransferase 1, RNMT1, DNMT2, DNA (cytosine-5-)-methyltransferase 2)','TRDMT1 protein, human','No Value Exists',3420858,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('JAK2 V617F mutation','JAK2.p.V617F','No Value Exists',3420860,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MDM2 (Mdm2 p53 binding protein homolog (mouse), HDM2, HDMX, MGC5370)','E3 Ubiquitin-Protein Ligase MDM2','E3 ubiquitin-protein ligase MDM2 (491 aa, 55 kD) is a cellular division process protein that is encoded by the human MDM2 gene and has a role in negative regulation of cell proliferation.',3420862,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MPL515L/K mutational status','MPL gene.p.W515 mutation analysis','No Value Exists',3420864,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MET (met proto-oncogene, c-met, hepatocyte growth factor receptor, HGFR, RCCP2)','Oncogene MET','The MET oncogene is derived from a chromosomal rearrangement involving the MET and TPR (translocated promoter region) loci and is a cloned gene for Hereditary Papillary Renal Carcinoma.  The MET proto-oncogene encodes hepatocyte growth factor receptor, a disulfide-linked two subunit receptor protein tyrosine kinase.  The human gene is located at 7q31.',3420866,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CDC25C (cell division cycle 25 homolog C (S. pombe), PPP1R60, CDC25, cell division cycle 25C)','CDC25C protein, human','No Value Exists',3420868,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCNB1 (cyclin B1, CCNB, G2/mitotic-specific cyclin B1)','G2/Mitotic-Specific Cyclin-B1','G2/mitotic-specific cyclin-B1 (433 aa, ~48 kDa) is encoded by the human CCNB1 gene. This protein plays a role in mediating the progression of the cell cycle from G2 to mitosis.',3420870,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Vitamin D (25-hydroxy vitamin D, 25 OHD)','25-Hydroxyvitamin D','The determination of the amount of 25-Hydroxyvitamin D present in a sample.',3420872,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Dendritic Cells (DCs)','Dendritic Cell','A special type of antigen-presenting cell (APC) that activates T lymphocytes.',3420873,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Antithyroperoxidase Antibody (ATPOAB)','Thyroperoxidase Antibody Measurement','The determination of the amount of thyroperoxidase antibody present in a sample.',3420875,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Thyroid Stimulating Immunoglobulin (TSI)','Thyroid Stimulating Immunoglobulin','A hormone produced by the pituitary gland. TSH stimulates the release of thyroid hormone from thyroglobulin. It also stimulates the growth of thyroid follicular cells. An abnormal TSH level may mean that the thyroid hormonal regulation system is out of control, usually as a result of a benign condition (hyperthyroidism or hypothyroidism).: Glycoproteins present in the blood (ANTIBODIES) and in other tissue. They are classified by structure and activity into five classes (IMMUNOGLOBULIN A; IMMUNOGLOBULIN D; IMMUNOGLOBULIN E; IMMUNOGLOBULIN G; IMMUNOGLOBULIN M).',3421300,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Thyroid Microsomal Antibody','Thyroid Antimicrosomal Antibody','The determination of the amount of thyroid antimicrosomal antibodies present in a sample.',3421301,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Anticardiolipin Antibodies (ACA)','Anticardiolipin Antibody','An autoantibody that reacts with cardiolipin.  Different immunoglobulin subclasses and isotypes are associated with different diseases and conditions.  Some anticardiolipin antibodes prolong phospholipid dependent clotting while others are associated with spontaneous abortion.',3421302,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SLC4A3 (solute carrier family 4, anion exchanger, member 3; AE3, SLC2C, Anion exchanger 3, neuronal)','SLC4A3 protein, human','No Value Exists',3421307,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SLC4A1 (solute carrier family 4, anion exchanger, member 1 (erythrocyte membrane protein band 3, Diego blood group), RTA1A, CD233, FR, SW, WR, EPB3, AE1, Waldner blood group)','SLC4A1 protein, human','No Value Exists',3421309,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PIAS1 (protein inhibitor of activated STAT, 1; GBP, GU/RH-II, ZMIZ3, DDXBP1, zinc finger, MIZ-type containing 3)','PIAS1 Protein','No Value Exists',3421469,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCR9 (chemokine (C-C motif) receptor 9, GPR-9-6, CDw199, GPR28)','C-C Chemokine Receptor Type 9','C-C chemokine receptor type 9 (369 aa, 42 kD) is a cell motility protein that is encoded by the human CCR9 gene and has roles in cellular defense response, chemotaxis, immune response and signal transduction.',3421471,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCR4 (chemokine (C-C motif) receptor 4, CC-CKR-4, CMKBR4, CKR4, k5-5, ChemR13, CD194)','CCR4 chemokine receptor binding','Interacting selectively and non-covalently with a CCR4 chemokine receptor. [GOC:mah, GOC:nln]',3421473,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FCGR1A (Fc fragment of IgG, high affinity Ia, receptor (CD64), CD64, CD64A)','FCGR1A protein, human','No Value Exists',3421475,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FCGR2A (Fc fragment of IgG, low affinity IIa, receptor (CD32), FCG2, FCGR2, FCGR2A1, Immunoglobulin G Fc receptor II)','IgG Fc Receptor IIA','Expressed in monocytes, macrophages, neutrophils, eosinophils, platelets, NK cells, and T- and B-lymphocytes by human FCGR2A Gene, 281-aa (mature) IgG Fc Receptor IIA is a type I cell surface membrane protein with 2 extracellular IgC2 domains and a low affinity receptor for aggregated IgG Fc region. FCGR2A binding to IgG initiates essential effector and regulatory cellular responses against foreign pathogens and soluble antigens that induce phagocytosis of antigen-antibody complexes, removing them from circulation, and modulate B-cell antibody production. An Arg167His polymorphism affects efficiency of IgG2 recognition. (NCI)',3421477,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('E2F (Transcription Factor)','Transcription Factor','Transcription factors are a diverse group of proteins that bind to DNA at specific promoter or enhancer regions. They also bind to DNA-associated proteins to initiate, stimulate, inhibit or terminate transcription. The proteins are often physically associated in a preinitiation complex and contain structural motifs.',3421499,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RB (Retinoblastoma Protein)','Retinoblastoma-Associated Protein','Retinoblastoma-associated protein (928 aa, ~106 kDa) is encoded by the human RB1 gene. This protein plays a role in the regulation of cell cycle progression.',3421501,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RPS6KB1 (ribosomal protein S6 kinase, 70kD, polypeptide 1, S6K1, p70(S6K)-alpha, PS6K, STK14A)','Ribosomal Protein S6 Kinase Beta-1','Ribosomal protein S6 kinase beta-1 (525 aa, ~59 kDa) is encoded by the human RPS6KB1 gene. This protein is involved in phosphorylation of ribosomal protein S6.',3421503,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Calcium','Calcium','A malleable silvery-white metallic element of the alkaline hearth group; the fifth most abundant element in the earth crust, occurring especially as forms of calcium carbonate. It is an essential constituent of bones and teeth.  It has the symbol Ca and atomic number 20.',3421504,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IFNAR2 (interferon (alpha, beta and omega) receptor 2, IFNABR)','IFNAR2 protein,human','No Value Exists',3421506,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('rheumatoid factor','Rheumatoid Factor','Antibodies in the serum of individuals with rheumatoid arthritis that react with antigenic determinants or immunoglobulins that enhance agglutination of suspended particles coated with pooled human gamma -globulin. Rheumatoid factors also occur in other autoimmune and certain infectious diseases.',3421566,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EET (Epoxyeicosatrienoic Acid)','EET','No Value Exists',3421568,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FOXO3 (forkhead box O3, FKHRL1, AF6q21, FOXO2)','Forkhead Box Protein O3','Forkhead box protein O3 (673 aa, ~71 kDa) is encoded by the human FOXO3 gene. This protein is involved in the modulation of transcription, apoptosis and embryonic pattern formation.',3421570,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HSP90B2P (heat shock protein 90kDa beta (Grp94), member 1, TRA1, GP96, GRP94, tumor rejection antigen (gp96) 1)','Heat Shock Protein HSP 90-Beta','Heat shock protein HSP 90-beta (724 aa, ~83 kDa) is encoded by the human HSP90AB1 gene. This protein plays a role in the modulation of both interferon signaling and protein folding.',3421572,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FGFR3 (fibroblast growth factor receptor 3, CEK2, JTK4, CD333, ACH)','Fibroblast Growth Factor Receptor 3','Expressed in brain, kidney, testis, and widely in fetal tissues by human FGFR3 Gene (FGFR Family), 3 alternative isoforms of highly conserved type I membrane protein Fibroblast Growth Factor Receptor 3, consisting of an acidic- and basic-FGF binding extracellular region (containing 3 Ig C2-type domains), a transmembrane segment, and a cytoplasmic tyrosine kinase domain, activate downstream signal cascades involved in mitogenesis and differentiation, as well as bone development and maintenance. FGFR3 defects cause achondroplasia, crouzon syndrome, thanatophoric dysplasia, coronal synostosis, hypochondroplasia, bladder and cervix cancers. (NCI)',3421574,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IkappaB Kinase (IKK; Inhibitor of nuclear factor kappa-B kinase; I-kappa-B kinase; Nuclear factor NF-kappa-B inhibitor kinase; Nuclear Factor NFKappaB Inhibitor Kinase; IkappaB kinase complex)','I-Kappa-B Kinase','An enzyme complex that is involved in serine/threonine phosphorylation, inflammation and the regulation of the nuclear factor kappa-light-chain-enhancer of activated B cells protein complex. I-kappa-B kinase is comprised of three proteins, inhibitor of nuclear factor kappa-B kinase subunit alpha, beta and gamma.',3421576,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Mp1 (thrombopoietin receptor)','Thrombopoietin Receptor','Thrombopoietin receptor (635 aa, 71 kD) is a cell division process protein that is encoded by the human MPL gene and has roles in cell proliferation and signal transduction.',3421592,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CAMK2N1 (calcium/calmodulin-dependent protein kinase II inhibitor 1, CamKII, CaMKIINalpha)','CAMKIINalpha protein, human','No Value Exists',3425252,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CRLF2 (cytokine receptor-like factor 2, CRL2, TSLPR)','Cytokine Receptor-Like Factor 2','Cytokine receptor-like factor 2 (371 aa, ~42 kDa) is encoded by the human CRLF2 gene. This protein is involved in the mediation of both cytokine binding and signaling.',3425254,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IKZF1 (IKAROS family zinc finger 1 (Ikaros), ZNFN1A1, zinc finger protein, subfamily 1A, 1 (Ikaros), hIk-1, LyF-1, Hs.54452, IKAROS)','IKZF1 Gene','This gene is involved in B-cell and T-cell maturation.',3425256,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CBL (oncogene CBL2, CBL2, RNF55, c-Cbl, Cas-Br-M (murine) ecotropic retroviral transforming sequence)','CBL Protein Proto-Oncogene','The cellular homologue of v-cbl, CBL protein is expressed in a range of hemopoietic lineages.  Malignancies are associated with translocations of the CBL gene.  Adaptor protein CBL2, containing a RING finger and multiple SH3 domains, encodes a protein similar to SLI1, a negative regulator of an EGF receptor tyrosine kinase homologue.  Through its SH2 domain, CBL regulates activated tyrosine-phosphorylated receptor PTK ubiquitination as an E3 ubiquitin ligase and recruits, and activates, an E2 ubiquitin-conjugating enzyme through its RING domain.  CBL is recruited to the tyrosine kinase insulin receptor by CAP adaptor protein, through a CAP SH3 domain.  Upon CBL phosphorylation, CAP/CBL dissociates from the receptor to complex with caveolar flotillin and localize to plasma membrane lipid rafts.  (from OMIM 165360 and NCI): Oncogenes are altered forms of normal cellular genes called proto-oncogene. Many proto-oncogenes are homologous to viral oncogenes and involved in the control of cell proliferation or differentiation. Mutations, amplifications or rearrangements of proto-oncogenes lead to upregulated or deregulated cell growth and allow them to function as oncogenes.',3425258,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('13q deletion (13q del)','13q Chromosomal Deletion','Distal (long) arm of chromosome 13: Loss of a portion of a chromosome arm.',3425292,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PTPN11 (protein tyrosine phosphatase, non-receptor type 11, BPTP3, SH-PTP2, SHP-2, PTP2C, SHP2, NS1)','Protein Tyrosine Phosphatase, Non-Receptor Type 11','SHP2 phosphatase is a widely expressed intracellular tyrosine phosphatase, containing two tandem SH2 domains and a catalytic domain.  The SH2 domains mediate binding to specific phosphotyrosine residues within target proteins.  Activated by IL6, SHP2 regulates RAFT kinase activity and appears to be involved in regulation of apoptosis.  SHP2 also appears to be involved in EGFR signaling and potentiates the MAP kinase signaling pathway.  MPZL1 and PTPNS1 are also SHP2 substrates.  SHP2 appears to affect morphogenetic cell shape, movement, or adhesion, as well as blood cell development.  (from OMIM 176876 and NCI)',3425294,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NF1 (neurofibromin 1)','NF1 Gene','This gene plays a role in signal transduction and cytoskeletal remodeling.',3425296,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TXN (Thioredoxin, TRX)','Thioredoxin','Hydrogen-donating proteins that participates in a variety of biochemical reactions including ribonucleotide reduction and reduction of PEROXIREDOXINS. Thioredoxin is oxidized from a dithiol to a disulfide when acting as a reducing cofactor. The disulfide form is then reduced by NADPH in a reaction catalyzed by THIOREDOXIN REDUCTASE.',3425298,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('17p deletion (17p del)','17p Chromosomal Deletion','Proximal (short) arm of chromosome 17: Loss of a portion of a chromosome arm.',3425299,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('11q deletion (11q del)','11q Chromosomal Deletion','Distal (long) arm of chromosome 11: Loss of a portion of a chromosome arm.',3425300,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ITGA4 (integrin, alpha 4 (antigen CD49D, alpha 4 subunit of VLA-4 receptor), CD49D, CD49d)','Integrin Alpha-4','Integrin alpha-4 (1032 aa, ~115 kDa) is encoded by the human ITGA4 gene. This protein is involved in the mediation of both cell-cell and cell-matrix interactions in leukocytes.',3425310,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GRK4 (G protein-coupled receptor kinase 4, GPRK4, GPRK2L)','G Protein-Coupled Receptor Kinase 2-Like','Expressed primarily in testis and brain by human GPRK2L Gene (GPRK Family), one of 4 alternative isoforms (GRK4A, B, C, D) of 578-/546-/532-aa 67-kDa G Protein-Coupled Receptor Kinase 2-Like is a Ser/Thr kinase containing an RGS domain that phosphorylates activated GPCRs and may play a role in receptor desensitization. Only full-length GRK4D has kinase activity, can phosphorylate rhodopsin, and is inhibited by calmodulin. The other isoforms do not phosphorylate rhodopsin and do not interact with calmodulin. (NCI)',3430841,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('WNK1 (WNK lysine deficient protein kinase 1, PRKWNK1, HSAN2 )','WNK1 protein, human','No Value Exists',3430843,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ANG (angiogenin, RNASE5)','Angiogenin','Angiogenin (147 aa, ~17 kDa) is encoded by the human ANG gene. This protein plays a role in the modulation of both vascular development and transcription.',3430845,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IGHV3-21 (immunoglobulin heavy variable 3-21)','IGHV3-21 gene','No Value Exists',3430847,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Aspergillus Galactomannan (GM)','Aspergillus Galactomannan','An enzyme-linked serum immunoassay used for the detection of aspergillosis.',3431157,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KLKB1 (kallikrein B, plasma (Fletcher factor) 1, KLK3)','KLKB1 Gene','This gene plays a role in proteolytic processing.',3431159,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Fibroblast growth factor receptor family','Fibroblast Growth Factor Receptor Family','Family of receptor tyrosine kinases for fibroblast growth factor. Amino acid sequence is highly conserved between members and throughout evolution. FGFR family members differ from one another in their ligand affinities and tissue distribution.',3431162,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('2-Deoxyglucose (2DG)','2-Deoxyglucose (2DG)','2-Deoxyglucose (2DG)',3431163,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Oxidized Glutathione (Glutathione Disulfide, GSSG)','Glutathione Disulfide','The oxidized disulfide form of glutathione (GSH) with potential protective activity. Glutathione disulfide (GSSG) is reduced by glutathione reductase to GSH. GSSG and GSH together play important roles in numerous redox reactions, such as those involved in the detoxification of harmful substances and free radicals, and in reactions preventing oxidative damage in erythrocytes. Upon ocular administration in irrigation solution, glutathione disulfide may exert a beneficial effect on the intracellular redox state of glutathione, thereby protecting the integrity and barrier function of the corneal endothelial cells.',3431165,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GSH (glutathione,  Glutham, N-(N-L-gamma-glutamyl-L-cysteinyl)glycine, Reduced Glutathione)','Reduced Glutathione','A tripeptide comprised of three amino acids (cysteine, glutamic acid, and glycine) present in most mammalian tissue. Glutathione acts as an antioxidant, a free radical scavenger and as a detoxifying agent. Glutathione is also important as a cofactor for the enzyme glutathione peroxidase, in the uptake of amino acids and participates in leukotriene synthesis. Under the influence of glutathione S-transferase, glutathione can react with a number of harmful products, such as halides, epoxides and free radicals, to form harmless inactive products. In erythrocytes, these reactions prevent oxidative damage by reduction of methemoglobin and peroxides. Glutathione is also involved in the formation and maintenance of disulfide bonds in proteins and in transport of amino acids across cell membranes.',3431166,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MYB (v-myb myeloblastosis viral oncogene homolog (avian), c-myb, ""v-myb avian myeloblastosis viral oncogene homolog)','MYB wt Allele','Human MYB wild-type allele is located within 6q22-q23 and is approximately 38 kb in length. This allele, which encodes Myb proto-oncogene protein, plays a role in both the modulation of transcription by RNA polymerase II and differentiation of hematopoietic progenitor cells.',3431168,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Beta-D Glucan (Beta-Glucan)','Beta-Glucan','A polysaccharide isolated from the cell walls of bacteria, plants, and fungi with immunostimulant and antineoplastic activities. In a solubilized form, beta-glucan binds to a lectin site within complement receptor 3 (CR3) on leukocytes, priming the receptor to trigger cytotoxic degranulation of leukocytes when leukocyte CR3 binds to complement 3 (iC3b)-coated tumors. Thus, the attachment of beta-glucan to CR3 of circulating leukocytes simulates leukocytes to kill iC3b-coated tumor cells in the same way as they kill iC3b-coated yeast. (NCI04)',3431170,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TRAIL (Tumor necrosis factor-related apoptosis-inducing ligand)','TRAIL (Tumor necrosis factor-related apoptosis-inducing ligand)','TRAIL (Tumor necrosis factor-related apoptosis-inducing ligand)',3431171,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EML4-ALK translocation mutation','EML4-ALK translocation mutation','Movement from one place to another.: A general term referring to single or multiple alterations in the genetic material of an organism that ranges from a single base change in a gene to the loss or addition of complete chromosomes. A mutation abnormality may be heritable or occur somatically.: No Value Exists',3431420,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HAMP (hepcidin antimicrobial peptide, HFE2B, LEAP-1, LEAP1, HEPC)','hepcidin antimicrobial peptide, human','No Value Exists',3431423,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ascorbate','Ascorbate','water soluble vitamin found in many plant and animal tissues; deficiency results in scurvy.',3431425,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TBXA2R (thromboxane A2 receptor)','Thromboxane A2 Receptor','No Value Exists',3431427,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BMP6 (bone morphogenetic protein 6, VGR, vegetal related growth factor (TGFB-related), VGR1)','Bone Morphogenetic Protein 6','Bone morphogenetic protein 6, encoded by the BMP6 gene, is a member of the TGF-beta family. It has strong similarity to murine Bmp6, signals through receptor serine/threonine kinases, and is involved in endochondral bone formation. (From LocusLink)',3431429,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BMP2 (bone morphogenetic protein 2, BMP2A)','Bone Morphogenetic Protein 2','Bone Morphogenetic Protein 2, encoded by the BMP2 gene, is a protein that belongs to the transforming growth factor-beta (TGFB) superfamily. By signaling through receptor serine/threonine kinases, Bone morphogenic protein 2 induces bone formation. BMP2 is a candidate gene for the autosomal dominant disease of fibrodysplasia (myositis) ossificans progressiva. (From LocusLink)',3431431,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SOST (sclerostin, sclerosteosis, VBCH)','SOST protein, human','No Value Exists',3431433,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('JAK (Janus kinase family)','Janus kinase','nonEC; family of cytoplasmic protein tyrosine kinases.',3431435,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Circulating tumor reactive T-cell','Circulating Tumor Reactive T-Lymphocyte','A Circulatory Process consists of functions of cellular, cell, or tissue components of the heart and vessels by which blood and lymph is circulated through the body.: A benign or malignant tissue growth resulting from uncontrolled cell proliferation. Benign neoplastic cells resemble normal cells without exhibiting significant cytologic atypia, while malignant cells exhibit overt signs such as dysplastic features, atypical mitotic figures, necrosis, nuclear pleomorphism, and anaplasia. Representative examples of benign neoplasms include papillomas, cystadenomas, and lipomas; malignant neoplasms include carcinomas, sarcomas, lymphomas, and leukemias.: No Value Exists: One type of white blood cell that attacks virus-infected cells, foreign cells, and cancer cells.  T cells also produce a number of substances that regulate the immune response.',3431467,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cancer Stem Cell (CSC)','Cancer Stem Cell','A malignant cell which may derive from mutations in normal stem cells. Cancer stem cells proliferate and give rise to other malignant cells. They may be present in very small numbers in the tumor and may not be present in all tumors. Many investigators believe that cancer stem cells cause relapse of the tumor and that novel cancer therapies should specifically target those cells.',3431469,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HERV-K (Human endogenous retrovirus K)','Human endogenous retrovirus K','No Value Exists',3431471,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ketone','Ketone','Organic compounds with a carbonyl group (C=O) bonded to two other carbon atoms as the skeleton structure. Acetone is the simplest ketone compound.',3431473,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PAI-1 (plasminogen activator inhibitor)','Plasminogen Activator Inhibitor','A member of the serpin family of serine protease inhibitor proteins that inhibits plasminogen activator type proteases.',3431474,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cutaneous Lymphocyte Antigen (CLA)','Cutaneous Lymphocyte Antigen','Having to do with the skin.: (LIM-fo-site) A type of white blood cell. Lymphocytes have a number of roles in the immune system, including the production of antibodies and other substances that fight infection and diseases.: Any substance that appears foreign or potentially adverse to the body and elicits immune response.',3431475,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Type I C-terminal collagen propeptide (CICP)','Procollagen type I C-terminal propeptide','No Value Exists',3431477,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DTH (Delay-type Hypersensitivity)','Delayed-Type Hypersensitivity','Delayed hypersensitivity reaction (DTH) - type IV reaction, an inflammatory response that develops 24 to 72 hours after exposure to an antigen that the immune system recognizes as foreign. DTH is mediated by T cells rather than by antibodies. Th1 cells produce interferon gamma, interleukin (IL)-2, and tumor necrosis factor-beta and promote a cell-mediated immune response.',3431478,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CNA (Copy Number Alteration)','Copy Number Alteration','A change resulting in something that is different from the original.: The number of molecules of a particular type on or in a cell or part of a cell. Usually applied to specific genes or to plasmids within a bacterium.',3431778,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HMGB1 (high mobility group box 1, high mobility group protein 1, DKFZp686A04236, Amphoterin, HMG1, HMG3, SBP-1)','high mobility group box 1','Interacting selectively and non-covalently with high mobility group box 1 (HMBGB1). [GOC:add, PMID:18431461]',3432457,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Transcriptome Profile','Human Transcriptome Profile','No Value Exists: An analysis (often in graphical form) representing the extent to which something exhibits various characteristics.',3432459,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('95-HER2','p95-HER2, mouse','No Value Exists',3432737,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KIR2DL2 (killer cell immunoglobulin-like receptor, two domains, long cytoplasmic tail, 2, CD158B1, CD158k, cl-43, nkat6)','Receptors, KIR2DL2','A KIR receptor that has specificity for HLA-C ANTIGENS. It is an inhibitory receptor that contains D1 and D2 extracellular immunoglobulin-like domains and a long cytoplasmic tail. It is similar in structure and function to the KIR2DL1 RECEPTORS and the KIR2DL3 RECEPTORS.',3432739,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KIR2DL3 (killer cell immunoglobulin-like receptor, two domains, long cytoplasmic tail, 3, CD158B2m cl-6, nkat2, nkat2a, nkat2b, p58)','Receptors, KIR2DL3','A KIR receptor that has specificity for HLA-C ANTIGEN. It is an inhibitory receptor that contains D1 and D2 extracellular immunoglobulin-like domains and a long cytoplasmic tail. It is similar in structure and function to the KIR2DL2 RECEPTORS and the KIR2DL3 RECEPTORS.',3432741,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KIR2DL1 (killer cell immunoglobulin-like receptor, two domains, long cytoplasmic tail, 1, nkat1, cl-42, CD158A, p58.1)','Receptors, KIR2DL1','A KIR receptor that has specificity for HLA-C ANTIGENS. It is an inhibitory receptor that contains D1 and D2 extracellular immunoglobulin-like domains and a long cytoplasmic tail. It is similar in structure and function to the KIR2DL2 RECEPTOR and the KIR2DL3 RECEPTORS.',3432743,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MOK (renal tumor antigen, MOK protein kinase, RAGE, RAGE1)','Renal Tumor Antigen','Expressed in heart, brain, lung, kidney, pancreas, placenta, liver, and skeletal muscle by human RAGE Gene (MAPK Family), 419-aa cytoplasmic Renal Tumor Antigen is 84% identical overall to the mouse protein (96% identical in the kinase domain) and structurally similar to other MAPKs, including a TEY motif in the activation loop that probably requires autophosphorylation and is required for kinase activity. MOK phosphorylates myelin basic protein. (NCI)',3432745,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FN1 (fibronectin 1, MSF, LETS, GFND2, FINC, CIG, migration-stimulating factor)','Fibronectin','Encoded as alternative isoforms by human FN1 Gene, 2386-aa 262.6-kD Fibronectin precursor is a sulfated disulfide bound glycoprotein with multiple type I, II, and III fibronectin domains. MSF FN70 is an isoform. Plasma (hepatocytes) and cellular (fibroblasts and epithelia) FN differ in activity. Cell surface cellular FN (di/multimeric) is deposited in the ECM. FN is involved in embryogenesis, cell adhesion, migration, and motility, opsonization, wound healing, coagulation, host defense, cell shape, and metastasis. It stimulates endocytosis and may promote clearance of C1q-coated immune complexes. FN binds cell surface integrin, C1q, collagen, fibrin, hyaluronic acid, heparin, FBLN1, and actin. Most cells depend on FN to bind collagen. Talin-1 may link FN/Integrin with the actin cytoskeleton. FN may promote contact inhibition. (from LocusLink, Swiss-Prot, OMIM, and NCI)',3436558,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Aromatase','Aromatase','A p450-like enzyme, Aromatase catalyzes, with an NADPH-linked reductase, the oxidative aromatization of androgens to estrogens. Expressed in gonads, palcenta and brain, Aromatase and NADPH-cytochrome P450 reductase (reductase) are both highly conserved, essential components of the enzyme complex and essential for reproductive development and fertility.',3436560,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SQSTM1 (sequestosome 1, PDB3, p62B, p62, p60, OSIL, A170)','SQSTM1 protein, human','No Value Exists',3436907,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Myeloid-derived Suppressor Cells (MDSCs)','Myeloid-derived Suppressor Cells','Myeloid-derived Suppressor Cells',3436908,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ACP5 (tartrate-resistant acid phosphatase 5, TRAP5, TRAP, TRAcP)','Tartrate-Resistant Acid Phosphatase Type 5','Tartrate-resistant acid phosphatase type 5 (325 aa, ~37 kDa) is encoded by the human ACP5 gene. This protein plays a role in the mediation of phosphate group removal from sialoproteins. Tartrate-resistant acid phosphatase type 5a is predominantly secreted by macrophages and dendritic cells.',3437295,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('T-Cell Receptor (TCR), zeta chain','T-Cell Receptor T3 Zeta Chain','Encoded as alternative isoforms by T-cell specific human CD3Z Gene (CD3Z/FCER1G Family), conserved nonglycosylated T-Cell Receptor-T3 Zeta Chain is a cell surface type I membrane protein containing 3 ITAM domains and a subunit of the CD3 complex (CD3D, CD3E, CD3G, CD3Zeta/Eta) noncovalently associated with disulfide bound alpha/beta and gamma/delta TCR. CD3-zeta forms disulfide-linked homodimers or heterodimers with CD3-eta, couples antigen recognition to signal transduction pathways, and may be associated with the cytoskeleton. CD3Z interacts with SLA, SLA2, and DOCK2. Enhancing T-cell antigen sensitivity, accessory protein CD4 binds to MHC II molecules and to LCK, which phosphorylates CD3Z. CD3 plays a role in the transition of immature thymocytes to mature CD4+ or CD8+ T cells. Following TCR engagement, CD3 activity leads to T-cell activation. (NCI)',3437518,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TRAcP-5a (tartrate-resistant acid phosphatase isoform 5a, TRAP-5a)','tartrate-resistant acid phosphatase isoform 5a', 'TRAP-5a,tartrate-resistant acid phosphatase isoform 5a',3437519,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SNP Profile (Single Nucleotide Polymorphism Profile)','Single Nucleotide Polymorphism Profile','A variation of a single nucleotide at a specific location of the genome due to base substitution, present at an appreciable frequency between individuals of a single interbreeding population.: An analysis (often in graphical form) representing the extent to which something exhibits various characteristics.',3437523,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FGD4 (FYVE, RhoGEF and PH domain containing 4, CMT4H, frabin, FRABP, ZFYVE6)','FGD4 protein, human','No Value Exists',3437525,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FZD3 (frizzled family receptor 3, frizzled 3, frizzled homolog 3)','Frizzled 3','Frizzled 3 protein (666 aa, 76 kD) is a cell division process protein that is encoded by the human FZD3 gene and has roles in cell proliferation and signal transduction.',3437527,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EPHA5 (EPH receptor A5, EphA5, CEK7, EHK1, Hek7, TYRO4)','Receptor, EphA5','An eph family receptor found primarily in differentiated neuronal tissues. Several isoforms of EphA5 receptor occur due to multiple alternative RNA splicing. The protein is prominently expressed in the NEURONS of the LIMBIC SYSTEM during development and throughout adult life, suggesting its role in the plasticity of limbic structure and function.',3437529,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Beta-tubulin','beta-Tubulin','No Value Exists',3437531,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PRKCI (protein kinase C, iota; PKCI, DXS1179E)','protein kinase C, iota, human','No Value Exists',3437533,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cathepsin D','Cathepsin D','Cathepsin D, encoded by the CTSD Gene, is a lysosomal aspartyl protease composed of a dimer of disulfide-linked heavy and light chains, both produced from a single protein precursor. It has a specificity similar to but narrower than that of pepsin A, decomposing cytoplasmic proteins, cell organelles, collagen, elastase and proteoglycans. Cathepsin D takes part in angiogenesis and activates osteoclasts, and plays a major role in the destruction of bone tissue by cholesteatoma. Transcription of the CTSD gene is initiated from several sites, including one which is a start site for an estrogen-regulated transcript. Mutations in this gene are involved in the pathogenesis of several diseases, including breast and ovarian cancer, and possibly Alzheimer disease. (From LocusLink, PMID 12185597 and NCI)',3437535,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TCRV (Tacaribe Complex Viruses)','Tacaribe Complex Viruses','one of two groups of viruses in the Arenavirus genus, causing human hemorrhagic fevers mostly in Central and South America.',3440023,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Tumor Necrosis Factor Receptor Superfamily Member 11B)','Tumor Necrosis Factor Receptor Superfamily Member 11B','Widely expressed by estrogen- and glucocorticoid-regulated human TNFRSF11B Gene (TNFR Family), 401-aa 46-kDa (precursor) N-glycosylated homodimeric secreted Tumor Necrosis Factor Receptor Superfamily Member 11B contains a blocked N-terminus, 4 TNFR-Cys repeats, 2 death domains, and sialic acid residues. TNFRSF11B acts as a regulator of bone homeostasis and osteoclast development. A decoy receptor for RANKL (TNFSF11/OPGL), TNFRSF11B inhibits activation of osteoclasts (osteoclastogenesis) and promotes osteoclast apoptosis. TNFRSF11B may also act as decoy receptor for TRAIL, protecting against apoptosis and inhibition of osteoclastogenesis. (NCI)',3440025,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TNFRSF11A (Tumor Necrosis Factor Receptor Superfamily Member 11A )','Tumor Necrosis Factor Receptor Superfamily Member 11A','Tumor necrosis factor receptor superfamily member 11A (616 aa, ~66 kDa) is encoded by the human TNFRSF11A gene. This protein plays a role in the regulation of bone density and calcium metabolism.',3440027,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SV40 (Simian Virus 40)','SV40','A virus that infects some types of monkeys. It may also infect humans, and was found in some polio vaccines tested in the early 1960s. Although the virus has been shown to cause cancer in laboratory animals, there is no evidence that it causes cancer in people.',3440029,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BCCIP (BCCIPalpha, TOK-1, BRCA2 and CDKN1A interacting protein)','BCCIPalpha protein human','No Value Exists',3440031,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CSF1 (colony stimulating factor 1 (macrophage), M-CSF, M-CSF, MGC31930)','Colony Stimulating Factor 1','Synthesized by mesenchymal cells, Macrophage Colony-Stimulating Factor is a 70 kD disulfide-bonded homodimeric glycoprotein cytokine that binds to FMS (a specific high affinity receptor) and stimulates survival, proliferation, and differentiation of committed hematopoietic cells of the related granulocyte and monocyte-macrophage lineages.  Three isoforms of M-CSF result from alternative splicing.  The active forms may be produced by proteolytic cleavage; precursors may exist as integral membrane proteins.  Isoform 1 may undergo rapid proteolytic cleavage to yield an extracellular growth factor.  Isoform 3 may exist as an integral membrane protein that undergoes slow proteolysis at the cell surface to yield a soluble growth factor.  (from OMIM 120420, SWISS-PROT P09603, and NCI)',3440033,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL16 (interleukin 16, prIL-16, LCF, IL-16, HsT19289, FLJ42735, FLJ16806, prointerleukin 16)','Interleukin-16','Interleukin-16, encoded by the IL16 gene, is a pleiotropic cytokine that functions as a chemoattractant, a modulator of T cell activation, and an inhibitor of HIV replication. As a ligand for CD4, the signaling process of this cytokine is mediated by CD4. It stimulates a migratory response in CD4+ lymphocytes, monocytes, and eosinophils as well as induces T-lymphocyte expression of interleukin 2 receptor. The product of this gene undergoes proteolytic processing, which yields two functional proteins. The cytokine function is exclusively attributed to the secreted C-terminal peptide, while the N-terminal product may play a role in cell cycle control. Caspase 3 is involved in the proteolytic processing of this protein. Two alternatively spliced transcript variants encoding distinct isoforms have been reported. (From LocusLink, Swiss-Prot and NCI)',3440035,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TGFB2 (transforming growth factor, beta 2)','Transforming Growth Factor Beta-2','Transforming growth factor beta-2 (414 aa, ~48 kDa) is encoded by the human TGFB2 gene. This protein plays a role in cell proliferation, cell death and a large number of signal transduction pathways.',3442076,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('XRCC6 (X-ray repair complementing defective repair in Chinese hamster cells 6, ML8, KU70, G22P1, D22S731, D22S671, Ku autoantigen)','X-ray repair complementing defective repair in Chinese hamster cells 6','X-ray repair complementing defective repair in Chinese hamster cells 6',3442077,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RAD50 (RAD50 homolog (S. cerevisiae); RAD50-2, hRad50, RAD50 (S. cerevisiae) homolog)','RAD50 protein,S cerevisiae','No Value Exists',3442079,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('XRCC2 (    X-ray repair complementing defective repair in Chinese hamster cells 2, RAD51-like)','X-ray repair complementing defective repair in Chinese hamster cells 2','X-ray repair complementing defective repair in Chinese hamster cells 2',3442080,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Interleukin-2 receptor, alpha (IL2RA)','Interleukin-2 Receptor Alpha Chain','Interleukin-2 receptor alpha chain (272 aa, 31 kD) is a cell fate protein that is encoded by the human IL2RA gene and has roles in immune response, cell proliferation, apoptosis and signal transduction.',3442082,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Delta-Tocopherol','Delta-Tocopherol','Tocopherol with a single methyl group on the bottom (R3 position) of its chromanol ring.',3442101,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Gamma-Tocopherol','Gamma-Tocopherol','Tocopherol with two methyl groups on the same side (R2 and R3 position) of its chromanol ring.',3442103,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Alpha-Tocopherol','Alpha-Tocopherol','A naturally-occurring form of vitamin E, a fat-soluble vitamin with potent antioxidant properties.  Considered essential for the stabilization of biological membranes (especially those with high amounts of polyunsaturated fatty acids), d-alpha-Tocopherol is a potent peroxyl radical scavenger and inhibits noncompetitively cyclooxygenase activity in many tissues, resulting in a decrease in prostaglandin production.  Vitamin E also inhibits angiogenesis and tumor dormancy through suppressing vascular endothelial growth factor (VEGF) gene transcription. (NCI04)',3442105,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('3-nitrotyrosine','3-nitrotyrosine','No Value Exists',3442108,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ARv567es (androgen receptor splice variant 5,6,7es, AResdel567)','androgen receptor splice variant 5,6,7es,androgen receptor splice variant 5,6,7es',null,3442109,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AR3 (androgen receptor splice variant 3, AR-V7, Arv7)','androgen receptor splice variant 3','androgen receptor splice variant 3',3442110,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome 3','Chromosome 3','The designation for each member of the third largest human autosomal chromosome pair. Chromosome 3 spans almost 200 million base pairs and represents about 6.5% of the total DNA in normal diploid cells.',3442196,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome 17','Chromosome 17','The designation for each member of the seventeenth largest human autosomal chromosome pair. Chromosome 17 spans more than 81 million base pairs and represents between 2.5 and 3% of the total DNA in normal diploid cells.',3442197,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TC22','Tropomyosin 5 Isoform Variant','A protein found in the thin filaments of muscle fibers. It inhibits contraction of the muscle unless its position is modified by TROPONIN.: A number with no fractional part, including the negative and positive numbers as well as zero.::5: An alteration or difference from a norm or standard.: Refers to variants of the same protein which can be separated on special conducting media using electrophoresis. The differences may arise from genetically determined differences in primary structure or by modification of the same primary sequence.',3443054,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Tropomyosin isoform 5 (hTM5)','Tropomyosin isoform 5','Tropomyosin isoform 5',3443055,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GRM1 (glutamate receptor, metabotropic 1, MGLUR1, mGlu1, GPRC1A)','Glutamate Receptor, Metabotropic 1','Glutamate receptor, metabotropic 1 protein (1,194 aa, 132 kD) is a cell communication process protein that is encoded by the human GRM1 gene and has a role in G protein-coupled signal transduction and synaptic transmission.',3443057,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RXR (Retinoid X Receptor)','Retinoid X Receptors','Human nuclear Retinoid X Receptors RXRA, RXRB, and RXRG (NR2/RXR Family) are transcriptional regulators composed of N-terminal modulating domain, DNA-binding domain (AGGTCA response elements), and C-terminal 9-cis RA-binding domain. RXR homodimers and RXR/RAR heterodimers mediate distinct retinoic acid response pathways. RXRs also interact with TH- and vitamin D receptors, and with NCOA3, NCOA6, PML, and PPARG coactivators; and mediate RA biological effects by binding to specific target gene promoters and inducing target gene transcription. RXRs/LXRs and RXRs/FXR may mediate cholesterol homeostasis, by governing cholesterol transport from peripheral cells, inhibiting cholesterol absorption in the small intestine, and repressing bile acid synthesis through upregulation of ABC1 and repression of CYP7A1 expression. (NCI)',3443058,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PDGF-B (platelet derived growth factor B)','Platelet Derived Growth Factor Beta Chain','Expressed as 2 alternative isoforms in platelets by human PDGFB Gene (PDGF/VEGF Family), 241-aa 27-kDa (precursor) Platelet-Derived Growth Factor-Beta Chain is a potent mitogenic factor for mesenchymal cells characterized by a motif of eight cysteines and released by platelets upon wounding to stimulate adjacent cell growth. PDGFB can exist as either antiparallel disulfide-linked homodimers or heterodimers with Platelet-Derived Growth Factor Alpha. A-A, B-B, and A-B, dimers can bind to PDGF receptor and elicit a variety of cellular responses. A and B homodimers are implicated in transformation processes. PDGFB mutations are associated with meningioma. Reciprocal t(17;22)(q22;q13) translocations with COL1A1 result in unregulated growth factor expression and are associated with DFSP. (NCI)',3443060,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SHH (sonic hedgehog (Drosophila) homolog, HHG1, HLP3, HPE3, MCOPCB5, SMMCI, sonic hedgehog, TPT, TPTPS)','Sonic Hedgehog Homolog','Expressed only during embryogenesis by human SHH Gene (Hedgehog Family), 462-aa 50-kDa (precursor) Sonic Hedgehog Homolog is the notochord inductive signal in ventral neural tube and somite patterning and the polarizing signal for anterior-posterior limb axis patterning. The C-terminal domain displays precursor processing autoproteolytic activity that generates the soluble signaling N-portion. With transferase activity, the C-portion covalently attaches cholesterol to the new N-product C-terminus, restricting it to the cell surface and regulating distribution of protein activity throughout the embryo. SHH binds to PTC receptor, releasing constitutive SMO repression and activating target gene transcription. Defects in SHH cause HPE3. (NCI)',3443063,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('5-HIAA (5-Hydroxyindoleacetic Acid)','5-Hydroxyindoleacetic Acid','A breakdown product of serotonin that is excreted in the urine. Serotonin is a hormone found at high levels in many body tissues. Serotonin and 5HIAA are produced in excess amounts by carcinoid tumors, and levels of these substances may be measured in the urine to test for carcinoid tumors.',3443064,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CDA (cytidine deaminase, CDD)','Cytidine Deaminase','Cytidine deaminase (146 aa, ~16 kDa) is encoded by the human CDA gene. This protein is involved in the deamination of cytidine and deoxycytidine to uridine and deoxyuridine, respectively.',3443066,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DRD2 (Dopamine Receptor D2 ) - 957T ins/del mutation','DRD2 (Dopamine Receptor D2 ) - 957T ins/del mutation','DRD2 (Dopamine Receptor D2 ) - 957T ins/del mutation',3443880,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DRD2 (Dopamine Receptor D2 ) - 141C ins/del mutation','DRD2 (Dopamine Receptor D2 ) - 141C ins/del mutation','DRD2 (Dopamine Receptor D2 ) - 141C ins/del mutation',3443881,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TMPRSS2-ERG fusion mutation','Transmembrane Protease Serine 2 ERG Fusion Mutation','Expressed in small intestine, prostate, colon, stomach, and salivary gland by human TMPRSS2 Gene (Peptidase S1 Family), 492-aa 54-kDa (precursor) Transmembrane Protease Serine 2 contains a type II transmembrane domain, an LDL-receptor class A domain, a scavenger receptor cysteine-rich (SRCR) domain, and a protease domain. The protease domain is thought to be cleaved, activated, and secreted after autocleavage. (NCI): This gene plays a regulatory role in transcription, cellular maintenance and hematopoiesis.: A protein in which the coding region of two genes have become in-frame and co-continuous.  Fusion proteins can be formed by chromosomal breakage and/or recombination and also can be experimentally created using recombinant DNA techniques.: change occurring in one gene.',3443913,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SCGB3A1 (secretoglobin, family 3A, member 1; UGRP2, PnSP-2, LU105, HIN1, HIN-1)','SCGB3A1 protein, human','No Value Exists',3443915,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TWIST1 (twist homolog 1 (Drosophila), TWIST, SCS, H-twist, BPES3, BPES2, bHLHa38, ACS3)','Twist-Related Protein 1','Twist-related protein 1 (202 aa, ~21 kDa) is encoded by the human TWIST1 gene. This protein plays a role in the negative regulation of both transcription and myogenesis.',3443917,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ABCC1 (ATP-binding cassette, sub-family C (CFTR/MRP), member 1; MRP1, MRP, GS-X)','ATP-Binding Cassette, Sub-Family C, Member 1','The MRP1 Protein constitutes a multidrug resistance-associated plasma membrane drug-efflux pump, detectable in lung, testis, and peripheral blood mononuclear cells.  This transporter protein is similar to ABC superfamily of transport systems and is over expressed in a multidrug-resistant SCLC cell line.  (from OMIM 158343 and NCI)',3443919,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ICAM2 (Intercellular Adhesion Molecule 2, CD102)','Intercellular Adhesion Molecule 2','ICAM2, the second LFA-1 ligand, is an integral membrane protein with two Ig-like domains.  It mediates adhesive interactions important for antigen-specific immune response, NK-cell mediated clearance, lymphocyte recirculation, and other cellular interactions important for immune response and surveillance.  (from OMIM 146630, Swiss-Prot P13598, and NCI)',3443921,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Catecholamine metabolites','Catecholamine Metabolite','A group of sympathetic amines containing a catechol group derived from the amino acid tyrosine.  Catecholamines are neuromodulators and hormones synthesized in the chromaffin cells of the adrenal grands and the postganglionic fibers of the sympathetic nervous system in response to stress.  Examples of catecholamines are epinephrine (adrenaline), norepinephrine (noradrenaline) and dopamine, all of which participate in wide variety of functions throughout the body.: Any substance involved in metabolism, either as a product of metabolism or as necessary for metabolism. ',3444807,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ABCC4 (ATP-binding cassette, sub-family C (CFTR/MRP), member 4, EST170205, MOAT-B, MOATB, sub-family C (CFTR/MRP), MRP4)','ABCC4 protein, human','No Value Exists',3444833,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MP-TF (microparticle tissue factor)','Tissue Factor','An anatomical structure consisting of similarly specialized cells and intercellular matrix, aggregated according to genetically determined spatial relationships, performing a specific function.: Factor; anything that contributes causally to a result.',3444834,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('F12 (coagulation factor XII (Hageman factor)','Coagulation factor XII activity','No Value Exists',3444836,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Prothrombin Fragment 1+2 (PF1+2)','Prothrombin fragment 1+2 Ag','No Value Exists',3444838,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MICA (MHC class I polypeptide-related sequence A, PERB11.1)','MHC class I polypeptide-related sequence A','MHC class I polypeptide-related sequence A',3444839,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('anti-KLM antibodies (liver-kidney-microsomal antibodies, anti-LKM antibodies)','Anti-KLM (Liver Kidney Microsomal) Antibody','The determination of the amount of liver kidney microsomal type 1 antibody present in a sample.',3447111,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Antineutrophil cytoplasmic antibodies (ANCA)','Antineutrophil Cytoplasmic Antibodies','Autoantibodies directed against cytoplasmic constituents of POLYMORPHONUCLEAR LEUKOCYTES and/or MONOCYTES. They are used as specific markers for WEGENER GRANULOMATOSIS and other diseases, though their pathophysiological role is not clear. ANCA are routinely detected by indirect immunofluorescence with three different patterns: c-ANCA (cytoplasmic), p-ANCA (perinuclear), and atypical ANCA.',3447113,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MDC1 (mediator of DNA-damage checkpoint 1, KIAA0170, NFBD1, MDCI)','MDC1 protein, human','No Value Exists',3447115,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KAT5 (K(lysine) acetyltransferase 5, TIP60, PLIP, HTATIP1, HTATIP, ESA1, cPLA2, 60kDa)','TIP60','TIP60 interacts with the activation domain of Tat, an activator of HIV gene expression.  The yeast SAS2 transcriptional silencing protein, important for exit from the cell cycle, is closely related to TIP60.  The widely expressed cell surface amyloid-beta precursor protein is cleaved by gamma-secretase and its cytoplasmic tail forms a multimeric complex with the nuclear adaptor protein FE65 and the histone acetyltransferase TIP60.  This complex potently stimulates transcription.  (from OMIM 601409 and NCI)',3447283,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NMDAR (NMDA receptor, NR1/2)','NMDA (N-methyl-D-aspartate) receptor','NMDA (N-methyl-D-aspartate) receptor',3447284,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FGFR2 (fibroblast growth factor receptor 2, TK25, TK14, KGFR, K-SAM, JWS, ECT1, CFD1, CEK3, CD332, BEK)','fibroblast growth factor receptor 2','fibroblast growth factor receptor 2',3447285,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KRT8 (keratin 8, KO, K8, K2C8, CYK8, CK8, CARD2)','keratin 8','keratin 8',3447286,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Anti-La Antibodies (Anti-SS-B Antibody, Anti-La/SSB)','Anti-La Antibodies (Anti-SS-B Antibody, Anti-La/SSB)','Anti-La Antibodies (Anti-SS-B Antibody, Anti-La/SSB)',3447287,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Anti-Ro (Anti-SSA autoantibodies, anti Ro/SSA)','Anti-SSA autoantibodies, anti Ro/SSA','Anti-SSA autoantibodies, anti Ro/SSA',3447288,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Antiphospholipid Antibodies','Antiphospholipid Antibodies','Autoantibodies directed against phospholipids. These antibodies are characteristically found in patients with systemic lupus erythematosus (LUPUS ERYTHEMATOSUS, SYSTEMIC;), ANTIPHOSPHOLIPID SYNDROME; related autoimmune diseases, some non-autoimmune diseases, and also in healthy individuals.',3447290,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PRKDC (protein kinase, DNA-activated catalytic polypeptide, XRCC7, p350, HYRC1, HYRC, DNPK1, DNAPK, DNA-PKcs)','PRKDC protein, human','No Value Exists',3447301,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('XRCC5 (X-ray repair complementing defective repair in Chinese hamster cells 5 (double-strand-break rejoining), KUB2, KU86, KU80, KARP-1)','Ku80 Protein','KU80 protein is the 80 kD subunit of the KU autoantigen, a heterodimeric DNA repair complex that binds DNA double-strand breaks, is the DNA-binding component of the DNA-dependent protein kinase, and facilitates repair by nonhomologous end-joining.  KU70 and KU80 form a dyad-symmetrical molecule with a preformed ring that encircles duplex DNA.  KU protein is also involved in V(D)J recombination.  KU is identical to DNA helicase II, an ATP-dependent DNA unwinding enzyme.  (from OMIM 194364 and NCI)',3447303,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NCRs (Natural Killer cell triggering receptors, natural cytotoxicity receptors)','Natural Killer Cell Triggering mode Receptor','White blood cells that attack tumor cells and body cells that have been invaded by foreign substances.: No Value Exists: A receptor is a protein located on the cell surface, or in the cytoplasm, that binds to a specific signaling factor, such as a hormone, antigen, or neurotransmitter, causing a conformational and functional change in the receptor molecule.  The ligand-bound receptor then alters its interaction with target molecules, which leads to changes in cellular physiology through modification of the activity of one or more signal transduction pathways.',3448532,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KIRs (Killer cell immunoglobulin-like receptors)','Receptors,KIR','A family of receptors found on NK CELLS that have specificity for a variety of HLA ANTIGENS. KIR receptors contain up to three different extracellular immunoglobulin-like domains referred to as D0, D1, and D2 and play an important role in blocking NK cell activation against cells expressing the appropriate HLA antigens thus preventing cell lysis. Although they are often referred to as being inhibitory receptors, a subset of KIR receptors may also play an activating role in NK cells.',3448534,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SLC29A1 (solute carrier family 29 (nucleoside transporters), member , ENT1)','SLC29A1 protein, human','No Value Exists',3448536,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FLT3-ITD Mutation (FLT3/ITD, internal tandem duplications of FLT3)','Fms-Related Tyrosine Kinase 3 Mutation','Fms-related receptor tyrosine kinase; growth factor receptor for hematopoietic stem and progenitor cells. (LocusLink): Any detectable and heritable change in the genetic material that causes a change in the GENOTYPE and which is transmitted to daughter cells and to succeeding generations.',3448539,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('G6PD (glucose-6-phosphate dehydrogenase, G6PD1)','Glucose-6-Phosphate Dehydrogenase','Encoded as 2 alternative isoforms by human housekeeping G6PD Gene (G6PD Family), 514-/560-aa 59-kDa homodimeric or homotetrameric cytosolic Glucose-6-Phosphate Dehydrogenase mainly produces NADPH, an electron donor to oxidizing agents and in biosynthetic reactions. G6PD deficiency may cause jaundice, hemolysis, or non-spherocytic hemolytic anemia. (NCI)',3448541,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MLL-AF4 fusion mutation','MLL-AF4 Fusion Mutation','Expression of a fusion protein that results from the insertion mutation ins(5;11)(q31;q13q23), which involves the human genes MLL and AFF1 and is associated with acute lymphoblastic leukemia.,Any detectable and heritable change in the genetic material that causes a change in the GENOTYPE and which is transmitted to daughter cells and to succeeding generations.',3449217,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NUP98-NSD1 fusion mutation','NUP98/NSD1 fusion mutation','A fusion gene that results from a chromosomal translocation t(5;11)(q35;p15.5) which fuses the first half of the NUP98 gene to the 3 portion of the NSD1 gene. This fusion is associated with myelodysplastic syndrome.',3449219,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('OTT-MAL fusion mutation','OTT-MAL fusion protein, human','No Value Exists',3449221,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NT5C2 (5-nucleotidase, cytosolic II; PNT5, NT5B, GMP, cN-II)','NT5C2 protein, human','No Value Exists',3449223,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RRM2 (ribonucleotide reductase M2)','ribonucleotide reductase M2 polypeptide, human','No Value Exists',3449225,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MLL-AF6 fusion mutation','MLL Gene AF-6 Fusion Mutation','This gene is involved in transcriptional regulation and alterations in the gene are associated with acute lymphoblastic leukemia.: Expressed in a variety of cell types by human MLLT4 Gene, 1816-aa 206-kDa AF-6 Protein is a possible signal transduction protein controlled by Ras signaling pathways that is strongly similar to afadin (rat) and contains short stretches rich in proline, charged amino acids, serines, or glutamines, 1 dilute domain, 1 FHA domain, 1 PDZ/DHR domain, and 2 RAS-associating domains. Shared with several vertebrate and invertebrate proteins, the MLLT4 GLGF motif may be involved in signal transduction at special cell-cell junctions. MLLT4 binds directly to ZO-1 and occludin. MLLT4 may bind to actin filaments, linking the actin cytoskeleton to the plasma membrane at cell-to-cell adherens junctions. A common acute leukemia chromosomal translocation t(6;11)(q27;q23) involves fusion of MLLT4 and MLL/HRX that results in production of a rogue activator protein.: A protein in which the coding region of two genes have become in-frame and co-continuous.  Fusion proteins can be formed by chromosomal breakage and/or recombination and also can be experimentally created using recombinant DNA techniques.: Any detectable and heritable change in the genetic material that causes a change in the GENOTYPE and which is transmitted to daughter cells and to succeeding generations.',3449227,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MLL-AF10 fusion mutation','MLL Gene MLL-AF10 fusion mutation','This gene is involved in transcriptional regulation and alterations in the gene are associated with acute lymphoblastic leukemia.: No Value Exists: Any detectable and heritable change in the genetic material that causes a change in the GENOTYPE and which is transmitted to daughter cells and to succeeding generations.',3449229,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MLL-ELL fusion mutation','MLL/ELL fusion mutation','A fusion protein encoded by the MLL/ELL gene. This protein is comprised of the N-terminal AT hook and DNA methyltransferase domains of histone-lysine N-methyltransferase MLL fused to all but the first 46 amino acids of the RNA polymerase II elongation factor ELL.: A general term referring to single or multiple alterations in the genetic material of an organism that ranges from a single base change in a gene to the loss or addition of complete chromosomes. A mutation abnormality may be heritable or occur somatically.',3453282,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MLL-ENL fusion mutation','MLL/ELL fusion mutation','No Value Exists: A general term referring to single or multiple alterations in the genetic material of an organism that ranges from a single base change in a gene to the loss or addition of complete chromosomes. A mutation abnormality may be heritable or occur somatically.',3453284,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cytotoxic T cells','Cytotoxic T-Lymphocyte','Immunized T-lymphocytes which can directly destroy appropriate target cells. These cytotoxic lymphocytes may be generated in vitro in mixed lymphocyte cultures (MLC), in vivo during a graft-versus-host (GVH) reaction, or after immunization with an allograft, tumor cell or virally transformed or chemically modified target cell. These cells are distinct from natural killer cells and from killer cells mediating antibody-dependent cell cytotoxicity.',3453291,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Regulatory T-cells (Tregs)','Regulatory T-Lymphocyte','Any DNA sequence involved in the regulation of genetic processes such as transcription and replication.: One type of white blood cell that attacks virus-infected cells, foreign cells, and cancer cells.  T cells also produce a number of substances that regulate the immune response.',3453292,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MYH11-CBFbeta fusion mutation','CBFbeta-MYH11 fusion protein Mutation Abnormality','No Value Exists: A general term referring to single or multiple alterations in the genetic material of an organism that ranges from a single base change in a gene to the loss or addition of complete chromosomes. A mutation abnormality may be heritable or occur somatically.',3453294,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('THBS2 (thrombospondin 2, TSP2)','Thrombospondin-2','Thrombospondin-2 (1172 aa, ~130 kDa) is encoded by the human THBS2 gene. This protein plays a role in both cell-cell and cell-matrix interactions.',3453351,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GSTT1 (glutathione S-transferase theta 1)','Glutathione S-Transferase Theta 1','Glutathione S-transferase theta 1 is a member of a superfamily of proteins that catalyze the conjugation of reduced glutathione to a variety of electrophilic and hydrophobic compounds. The theta class includes GSTT1 and GSTT2. In humans, the GSTT1 enzyme is found in the erythrocyte and this may act as a detoxification sink. (LocusLink and OMIM)',3453353,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RRM2B (ribonucleotide reductase M2 B (TP53 inducible), p53R2)','RRM2B protein, human','No Value Exists',3453355,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MAP4 (microtubule-associated protein 4)','MAP4','No Value Exists',3453357,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Helper T cells','Helper-Inducer T-Lymphocyte','A subpopulation of CD4+ lymphocytes that cooperate with other lymphocytes (either T or B) to initiate a variety of immune functions. (MeSH)',3453358,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Glycinamide Ribonucleotide Formyltransferase (GARFT)','Glycinamide Ribonucleotide Formyltransferase','Any substance that inhibits glycinamide ribonucleotide formyltransferase, the first folate dependent enzyme in de novo purine synthesis. Inhibition of glycinamide ribonucleotide formyltransferase causes purine depletion and results in inhibition of DNA synthesis and cell cycle arrest.',3459502,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chimerism','Chimerism','The occurrence in an individual of two or more cell populations of different chromosomal constitutions, derived from different individuals. This contrasts with mosaicism in which the different cell populations are derived from a single individual.',3461477,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NME1 (non-metastatic cells 1, protein (NM23A) expressed in; NM23, NM23-H1)','NME1 protein, human','No Value Exists',3461479,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PDGFA (platelet-derived growth factor alpha polypeptide, PDGF1, PDGF-A)','Platelet-Derived Growth Factor Alpha','Expressed in platelets as 2 alternative isoforms by human PDGFA Gene (PDGF/VEGF Family), Platelet-Derived Growth Factor Alpha is a mitogenic factor for mesenchymal cells characterized by a motif of eight cysteines and released by platelets upon wounding to stimulate adjacent cell growth. PDGFA can exist as either antiparallel disulfide-linked homodimers or heterodimers with Platelet-Derived Growth Factor Beta. A long PDGFA isoform contains a basic insert that acts as a cell retention signal. A-A, B-B, and A-B, dimers can bind to PDGF receptor and elicit a variety of cellular responses. A and B homodimers are implicated in transformation processes. (NCI)',3461481,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HACA (human anti-chimeric antibody)','Human antichimeric antibody test','No Value Exists',3461498,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SERPINF1 (serpin peptidase inhibitor, clade F (alpha-2 antiplasmin, pigment epithelium derived factor), member 1; EPC-1, PEDF, PIG35)','SERPINF1 gene','No Value Exists',3461500,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TGFBR3 (transforming growth factor, beta receptor III; betaglycan, BGCAN)','TGFBR3 Gene','This gene plays a role in the TGF-beta signaling pathway.',3461502,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FIG1-ROS1 translocation mutation','FIG1-ROS1 Translocation Mutation','A malignant form of astrocytoma histologically characterized by pleomorphism of cells, nuclear atypia, microhemorrhage, and necrosis. They may arise in any region of the central nervous system, with a predilection for the cerebral hemispheres, basal ganglia, and commissural pathways. Clinical presentation most frequently occurs in the fifth or sixth decade of life with focal neurologic signs or seizures.: This gene plays a role in receptor tyrosine phosphorylation signal transduction, and is thought to play a role in cellular growth or differentiation, but an exact function has not been substantiated.: Movement from one place to another.: Any detectable and heritable change in the genetic material that causes a change in the GENOTYPE and which is transmitted to daughter cells and to succeeding generations.',3461518,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('VIP (vasoactive intestinal peptide)','Vasoactive Intestinal Peptide','Encoded by human oncogene VIP Gene (Glucagon-Secretin Family), VIP is a 170-amino acid 19 kD (precursor) octacosameric gastrointestinal peptide and a neuroendocrine mediator in CNS cholinergic neurons and PNS peptidergic neurons. VIP also affects B- and T cells directly. Prepro-VIP contains VIP and 27-amino acid PHM27. A neuropeptide in the lymphoid microenvironment, VIP has anti-inflammatory action, modulates innate and adaptive immunity, causes vasodilation, lowers arterial blood pressure, stimulates myocardial contractility, increases glycogenolysis, and relaxes the smooth muscle of trachea, stomach and gall bladder. VIP promotes TH2 differentiation and inhibits TH1 responses by regulating macrophage co-stimulatory signals.  (OMIM, Swiss-Prot, LocusLink, and NCI)',3461520,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PPY (pancreatic polypeptide, PNP)','Pancreatic Polypeptide','A 36-amino acid polypeptide with physiological regulatory functions. It is secreted by pancreatic tissue. Plasma pancreatic polypeptide increases after ingestion of food, with age, and in disease states. A lack of pancreatic polypeptide in the islets of Langerhans has been associated with the obese syndrome in rats and mice.',3461522,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FOXO1 (forkhead box O1, FOXO1A, FKHR, FKH1)','Forkhead Box Protein O1','Forkhead box protein O1 (655 aa, ~70 kDa) is encoded by the human FOXO1 gene. This protein plays a role in the regulation of embryonic development, transcription and apoptosis.',3461538,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CP (ceruloplasmin, ferroxidase)','Ceruloplasmin','No Value Exists',3461680,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BNIP3 (BCL2/adenovirus E1B 19kDa interacting protein 3, Nip3)','BCL2/Adenovirus E1B 19 kDa Protein-Interacting Protein 3-Like','BCL2/adenovirus E1B 19 kDa protein-interacting protein 3-like (219 aa, ~24 kDa) is encoded by the human BNIP3L gene. This protein is involved in the induction of apoptosis.',3461682,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TSC2 (tuberous sclerosis 2, tuberin, TSC4, LAM)','Tuberous Sclerosis 2','Tuberous sclerosis mapped to chromosome 16p13.3 (TSC2 gene).',3461684,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TSC1 (tuberous sclerosis 1, TSC, LAM, KIAA0243, hamartin)','Tuberous Sclerosis 1','Tuberous sclerosis mapped to chromosome 9q34 (TSC1 gene).',3461686,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ANGPTL4 (angiopoietin-like 4, pp1158, PGAR, NL2, HFARP, FIAF, ARP4)','Angiopoietin-Related Protein 4','Angiopoietin-related protein 4 (406 aa, ~45 kDa) is encoded by the human ANGPTL4 gene. This protein plays a role in the modulation of signaling during hypoxic stress and angiogenesis.',3461688,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Phosphofructokinases','Phosophofructokinase','Allosteric enzymes that regulate glycolysis and gluconeogenesis. These enzymes catalyze phosphorylation of fructose-6-phosphate to either fructose-1,6-bisphosphate (PHOSPHOFRUCTOKINASE-1 reaction), or to fructose-2,6-bisphosphate (PHOSPHOFRUCTOKINASE-2 reaction).',3462170,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Hexokinases','Hexokinase','An enzyme that catalyzes the conversion of ATP and a D-hexose to ADP and a D-hexose 6-phosphate. D-Glucose, D-mannose, D-fructose, sorbitol, and D-glucosamine can act as acceptors; ITP and dATP can act as donors. The liver isoenzyme has sometimes been called glucokinase. (From Enzyme Nomenclature, 1992) EC 2.7.1.1.',3462172,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TPI1 (triosephosphate isomerase 1)','TPI1 gene','No Value Exists',3462174,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ENO1 (enolase 1, (alpha); ENO1L1, MBP-1, MBP1, PPH)','ENO1 protein, human','No Value Exists',3462176,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Phosphoglucomutases','PHOSPHOGLUCOMUTASE','An enzyme that catalyzes the conversion of alpha D-glucose 1-phosphate to alpha D-glucose 6-phosphate. EC 5.4.2.2.',3462181,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Pyruvate Kinase','Pyruvate Kinase','ATP:pyruvate 2-O-phosphotransferase. A phosphotransferase that catalyzes reversibly the phosphorylation of pyruvate to phosphoenolpyruvate in the presence of ATP. It has four isozymes (L, R, M1, and M2). Deficiency of the enzyme results in hemolytic anemia. EC 2.7.1.40.',3462183,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Phosphoglycerate kinases','PHOSPHOGLYCERATE KINASE','An enzyme catalyzing the transfer of a phosphate group from 3-phospho-D-glycerate in the presence of ATP to yield 3-phospho-D-glyceroyl phosphate and ADP. EC 2.7.2.3.',3462185,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SREBF1 (sterol regulatory element binding transcription factor 1, SREBP1, SREBP-1c, bHLHd1)','SREBF1 protein, human','No Value Exists',3462730,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EBNA-3 (Epstein-Barr nuclear antigen 3)','Epstein Barr Nuclear Antigen 3','Viral nuclear antigen expressed in latency',3462733,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HSPA5 (heat shock 70kDa protein 5 (glucose-regulated protein, 78kDa); GRP78, BiP)','78 kDa Glucose-Regulated Protein','78 kDa glucose-regulated protein (654 aa, ~72kDa) is encoded by HSPA5 gene. The protein is intracellularly localized in the endoplasmic reticulum lumen, and plays a role in the assembly of multimeric protein complexes inside the organelle. In addition, the protein is thought to function as a pro-survival protein, or an inhibitor of apoptosis.',3462735,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DNMT3A (DNA (cytosine-5-)-methyltransferase 3 alpha)','DNA (Cytosine-5)-Methyltransferase 3A','DNA (cytosine-5)-methyltransferase 3A protein (909 aa, ~102 kD) is encoded by the human DNMT3A gene. This soluble, nuclear protein is involved in epigenetic modification of chromatin, catalyzing the methylation of C5 in CpG dinucleotides within DNA.',3462737,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HDAC (Histone Deacetylase) Activity','Histone Deacetylase','Histone acetylation and deacetylation alternately exposes and occludes DNA to transcription factors. Histone deacetylation is catalyzed by the histone deacetylases.  There are at least 2 classes of HDACs, class I consisting of proteins homologous to yeast Rpd3 (e.g., HDAC1, HDAC2, and HDAC3) and class II consisting of proteins homologous to yeast Hda1 (e.g., HDAC4 and HDAC6). (from OMIM)',3462753,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Catechins','Catechin','A flavonol with a hydroxyl group at C-5, -7, -3, and -4. The (+) enantiomer has the R and S configuration at C-2, and C-3, respectively.',3462754,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Red Cell Fatty Acids','Erythrocyte Fatty Acid','Red blood cells. Mature erythrocytes are non-nucleated, biconcave disks containing hemoglobin whose function is to transport oxygen.: Monobasic, aliphatic acids with varying chain lengths between 6 and 30.  Fatty acids are a major constituent in all fats and can be either saturated, monounsaturated, or polyunsaturated.  Saturated and monounsaturated fatty acids are synthesized by the body, whereas polyunsaturated fatty acids are not and must be obtained in the diet. (NCI)',3462756,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AFP-L3 (Alpha Fetoprotein L3 isoform)','Alpha Fetoprotein L3 Isoform','A measurement of the alpha fetoprotein L3 in a biological specimen.',3462850,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MMP9 (matrix metallopeptidase 9 (gelatinase B, 92kDa gelatinase, 92kDa type IV collagenase); CLG4B)','Matrix Metalloproteinase-9','Matrix metalloproteinase-9 (707 aa, ~78 kDa) is encoded by the human MMP9 gene. This protein plays a role in collagen degradation, macrophage differentiation and cell migration.',3462857,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KITLG (KIT ligand, SF, SCF, MGF, KL-1, Kitl, FPH2)','Kit Ligand','Stem Cell Factor is a hematopoietic growth factor, a key signal in mast cell differentiation and function, and a ligand for the KIT tyrosine kinase receptor CD117.  In the mouse, this growth factor is encoded by Sl (steel), a gene critical to the development of several cell lineages as well as to hematopoiesis in the adult.  SCF augments proliferation of myeloid and lymphoid progenitors.  (from OMIM 184745 and NCI)',3462858,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Mesothelin Antibodies','Mesothelin Antibody','Mesothelin (630 aa, ~69 kDa) is encoded by the human MSLN gene. This protein may play a role in cellular adhesion.: (AN-tih-BOD-ee) A type of protein made by certain white blood cells in response to a foreign substance (antigen). Each antibody can bind to only a specific antigen. The purpose of this binding is to help destroy the antigen. Antibodies can work in several ways, depending on the nature of the antigen. Some antibodies destroy antigens directly. Others make it easier for white blood cells to destroy the antigen.',3462859,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DCP (Des-gamma carboxyprothrombin, PIVKA-II)','Des-gamma carboxyprothrombin','Des-gamma carboxyprothrombin',3462860,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HLA-DR13','HLA-DR13','No Value Exists',3463052,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HLA-DP4','HLA-DP4','No Value Exists',3463054,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Promoter-specific Methylation Profile','Promoter Specific Methylation Profile','A DNA sequence at which RNA polymerase binds and initiates transcription.: Specified; clearly and explicitly stated.: The attachment of a methyl group to a molecule. Usually refers to DNA methylation. The expression level of a gene is often regulated by its methylation state; expressed genes are usually hypomethylated. C0025723: Methylation : An analysis (often in graphical form) representing the extent to which something exhibits various characteristics.',3463239,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Global DNA Methylation','Global DNA Methylation','Covering or affecting the whole of a system.: The process by which methyl groups are added to nucleotides in genomic DNA.',3463242,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Whole Genome Sequencing','Whole Genome Sequencing','A procedure that can determine the DNA sequence for nearly the entire genome of an individual.',3463244,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NY-ESO-1 Antibodies (CTAG1B antibodies, Cancer/Testis Antigen Antibodies)','Cancer/Testis Antigen 1 Antibody','Cancer/testis antigen 1 (180 aa, ~18 kDa) is encoded by both the human CTAG1A gene and the human CTAG1B gene. This protein may be involved in both testis development and spermatogenesis.: (AN-tih-BOD-ee) A type of protein made by certain white blood cells in response to a foreign substance (antigen). Each antibody can bind to only a specific antigen. The purpose of this binding is to help destroy the antigen. Antibodies can work in several ways, depending on the nature of the antigen. Some antibodies destroy antigens directly. Others make it easier for white blood cells to destroy the antigen.',3463245,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Total RNA Expression','Total RNA Expression','Pertaining to an entirety or whole, also constituting the full quantity or extent; complete.: A genetic process in which single-stranded RNA with base sequence complementary to a region of plus strand DNA is synthesized by DNA-dependent RNA polymerases. Following the binding of RNA polymerase on the DNA promoter regions, the RNA product is synthesized in a 5 to 3 direction, elongating the DNA strand as the polymerase proceeds down the unwinding and rewinding of the DNA helix.',3463850,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Androstenedione','Androstenedione','A steroid hormone synthesized by the adrenal glands and the gonads from either 17-alpha-hydroxyprogesterone or dehydroepiandrosterone and is a precursor of testosterone.',3466658,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RNA Sequencing','RNA Sequence','The sequence of nucleotide residures along an RNA chain.',3466659,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RAD51 (RAD51 homolog (S. cerevisiae); RECA, RAD51A, HsT16930, HsRad51, BRCC5)','RAD51 gene','No Value Exists',3466678,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FANCL (Fanconi anemia, complementation group L; Pog, PHF9, FLJ10335, FAAP43)','E3 Ubiquitin-Protein Ligase FANCL','E3 ubiquitin-protein ligase FANCL (375 aa, ~43 kDa) is encoded by the human FANCL gene. This protein is involved in the regulation of both protein ubiquitination and DNA repair.',3466680,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FANCG (Fanconi anemia, complementation group G; XRCC9, FAG)','Fanconi Anemia Group G Protein','Fanconi anemia group G protein (622 aa, ~69 kDa) is encoded by the human FANCG gene. This protein may be involved in DNA damage repair and cell cycle checkpoint regulation.',3466681,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FANCF (Fanconi anemia, complementation group F; FAF)','Fanconi Anemia Group F Protein','Fanconi anemia group F protein (374 aa, ~42 kDa) is encoded by the human FANCF gene. This protein may play a role in both cell cycle checkpoint regulation and DNA damage repair.',3466682,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FANCE (Fanconi anemia, complementation group E; FAE, FACE)','Fanconi Anemia Group E Protein','Fanconi anemia group E protein (536 aa, ~59 kDa) is encoded by the human FANCE gene. This protein is involved in the localization of the Fanconi anemia complementation group protein complex.',3466683,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FANCD2 (Fanconi anemia, complementation group D2; FANCD, FAD, FACD, FA-D2)','Fanconi Anemia Group D2 Protein','Fanconi anemia group D2 protein (1471 aa, ~166 kDa) is encoded by the human FANCD2 gene. This protein plays a role in chromosome pairing during meiosis, repair of DNA double-strand breaks and cell cycle checkpoint regulation.',3466684,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FANCC (Fanconi anemia, complementation group C; FACC, FAC, FA3)','Fanconi Anemia Group C Protein','Fanconi anemia group C protein (558 aa, ~63 kDa) is encoded by the human FANCC gene. This protein may be involved in DNA cross-link repair and cell cycle checkpoint regulation.',3466685,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FANCA (Fanconi anemia, complementation group A; FANCH, FAH, FACA, FAA, FA-H)','Fanconi Anemia Group A Protein','Fanconi anemia group A protein (1455 aa, ~163 kDa) is encoded by the human FANCA gene. This protein may be involved in both DNA damage repair and cell cycle checkpoint regulation.',3466686,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SLC7A11 (solute carrier family 7 (anionic amino acid transporter light chain, xc- system), member 11; xCT)','SLC7A11 Gene','This gene plays a role in amino acid transport.',3467370,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('gamma-Glutamylcysteine synthase','gamma-Glutamylcysteine synthetase measurement','No Value Exists',3467388,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SLC1A4 (solute carrier family 1 (glutamate/neutral amino acid transporter), member 4; ASCT1, SATT)','SLC1A4 gene','No Value Exists',3467390,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('gamma-GT (Gamma-Glutamyl Transpeptidase)','Gamma-Glutamyl Transpeptidase','GGT participates in the transfer of amino acids across the cellular membrane and in glutathione metabolism. High concentrations are found in the liver, bile ducts, and the kidney.  A test that measures the amount of GGT in the blood is used to detect diseases of the liver, bile ducts, and kidney; and to differentiate liver or bile duct (hepatobiliary) disorders from bone disease. (from http://health.allrefer.com)',3467391,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ribonucleotide Reductase (RR)','Ribonucleotide Reductase','Ribonucleotide Reductase is a heterodimeric cytoplasmic enzyme essential in dividing cells that reduces ribonucleotides to deoxyribonucleotide precursors for DNA synthesis in S phase. It consists of two subunits, M1 Chain and M2 Chain. Complex allosteric control, mediated by deoxynucleoside triphosphates, and by ATP bound to the M1 subunit prevents DNA replication and cell proliferation. A substrate specificity site and a catalytic activity site regulate enzyme activity. A substrate-binding catalytic site on M1 is only formed in the presence of M2. Enzyme activity closely correlates with the cellular rate of growth and appears to vary with the cell cycle. (NCI)',3467393,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HSP90 (Heat Shock Protein 90)','Heat Shock Protein 90','A family of structurally related proteins that play a role in cell signalling, protein folding and cellular stress responses. The members of this family are approximately 90 kDa.',3467395,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HSP70 (Heat Shock Protein 70)','Heat Shock Protein 70','A family of structurally related proteins that are involved in both protein folding and cellular stress responses. The members of this family are approximately 70 kDa.',3467397,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ETS1 (v-ets erythroblastosis virus E26 oncogene homolog 1 (avian), FLJ10768, EWSR2, ETS-1)','ETS1 Gene','This gene is involved in transcriptional activation and may play a role in the suppression of tumorigenicity.',3474992,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CHEK1 (checkpoint kinase 1, CHK1)','Checkpoint kinase 1','No Value Exists',3474994,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SETMAR (SET domain and mariner transposase fusion gene, metnase)','SETMAR gene','No Value Exists',3474996,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Plasmin Antiplasmin Complexes','Plasmin Antiplasmin Complex','serine endopeptidase occurring in plasma as plasminogen, activated via cleavage by plasminogen activators solubilizes fibrin clots and also degrades various proteins including fibrinogen and coagulation factors V and VII.: A member of the serpin superfamily found in plasma that inhibits the lysis of fibrin clots which are induced by plasminogen activator. It is a glycoprotein, molecular weight approximately 70,000 that migrates in the alpha 2 region in immunoelectrophoresis. It is the principal plasmin inactivator in blood, rapidly forming a very stable complex with plasmin.: A molecular entity formed by loose association involving two or more component molecular entities. The bonding between the components is normally weaker than in a covalent bond.',3474999,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('XPA (xeroderma pigmentosum, complementation group A; XP1, XPAC)','Xeroderma Pigmentosum Complementation Group A Protein','DNA-Repair Protein Complementing XP-A Cells (XPA), the nuclear protein encoded by the XPA gene, has a zinc finger domain and is involved in the DNA excision repair pathway. XPA initiates repair by binding to damaged sites with various affinities, depending on the photoproduct and the transcriptional state of the region. XPA complements the defect in xeroderma pigmentosum (XP) group A (XP-A), an autosomal recessive disease characterized by hypersensitivity of the skin to sunlight followed by high incidence of skin cancer and frequent neurologic abnormalities. Group A patients show the most severe skin symptoms and progressive neurological disorders.',3475001,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RPTOR (regulatory associated protein of MTOR, complex 1; raptor, Mip1, KOG1, KIAA1303)','RPTOR protein, human','No Value Exists',3475065,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RICTOR (RPTOR independent companion of MTOR, complex 2; PIA, MBC39830, KIAA1999, AVO3)','RICTOR protein, human','No Value Exists',3475067,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FKBP8 (FK506 binding protein 8, 38kDa; FKBP38, FKBPr38)','FKBP8 protein, human','No Value Exists',3475069,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('5HT (5-hydroxytryptamine)','Serotonin','A biochemical messenger and regulator, synthesized from the essential amino acid L-TRYPTOPHAN. In humans it is found primarily in the central nervous system, gastrointestinal tract, and blood platelets. Serotonin mediates several important physiological functions including neurotransmission, gastrointestinal motility, hemostasis, and cardiovascular integrity. Multiple receptor families (RECEPTORS, SEROTONIN) explain the broad physiological actions and distribution of this biochemical mediator.',3475071,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('F2R (coagulation factor II (thrombin) receptor, TR, PAR1, PAR-1, CF2R)','F2R Gene','This gene is involved in coagulation and proteolytic cleavage regulation.',3475073,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ubiquitin','Ubiquitin','Conserved nuclear and cytoplasmic Ubiquitins are synthesized as either a polyubiquitin precursor with head to tail repeats or as a single ubiquitin fused to an unrelated tail protein and are typically involved in selective ATP-dependent nonlysosomal degradation of cellular proteins, histone modification, maintenance of chromatin structure, regulation of gene expression, stress response, and ribosome biogenesis. Ubiquitins often appear to be covalently bound to proteins as a marker for degradation. Ubiquitin-dependent proteolysis by the 26S proteasome plays a pivotal role in cell cycle progression. (NCI)',3475373,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GNA11 (guanine nucleotide binding protein (G protein), alpha 11 (Gq class)','guanine nucleotide binding protein','family of GTP-, GDP-, and GMP-binding proteins; do not confuse with G PROTEINs, which are a subset of the family.',3475377,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EBNA-1 (Epstein-Barr nuclear antigen 1)','Epstein Barr Nuclear Antigen 1','Epstein Barr Nuclear Antigen 1',3475378,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SAAG (Serum-Ascites Albumin Gradient)','Serum Ascites Albumin Gradient','The clear liquid part of the blood that remains after blood cells and clotting proteins have been removed.: Accumulation of fluid in the peritoneal cavity.  The fluid may be serous, hemorrhagic, or the result of tumor metastasis to the peritoneum. -- 2004: family of globular proteins found in many plant and animal tissues that tend to bind a wide variety of ligands.: A graded change in the magnitude of some physical quantity or dimension.',3475409,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GLI3 (GLI family zinc finger 3, PPDIV, PHS, PAPB, PAPA1, PAP-A, GCPS, ACLS)','Zinc Finger Protein GLI3','Zinc finger protein GLI3 (1580 aa, ~170 kDa) is encoded by the human GLI3 gene. This protein is involved in transcriptional regulation, limb development and signal transduction.',3475431,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('5q del (5q deletion)','Loss of Chromosome 5q','A cytogenetic abnormality that refers to deletion of part of the long arm of chromosome 5. It is associated with the development of myelodysplastic syndrome with isolated deletion (5q), acute myeloid leukemia with multilineage dysplasia, and acute myeloid leukemia with myelodysplasia-related changes.',3475432,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NOTCH4 (notch 4, INT3)','Notch4 Protein','NOTCH4 Protein is a Drosophila Notch receptor homologue with 29 extracellular EGF-like repeats, three Notch/lin-12 repeats, a transmembrane region, six intracellular cdc10/ankyrin repeats, a polyglutamine domain, and a C-terminal PEST region.  A component of an evolutionarily conserved intercellular signaling mechanism, NOTCH4 is expressed in a variety of tissues and appears to regulate cell fate decisions during embryonic vascular morphogenesis and remodeling.  NOTCH4 and NOTCH1 appear to have partially overlapping roles during embryogenesis in mice.  MMTV INT3 interruption of NOTCH4 produces a gain-of-function truncated product, containing only the transmembrane and intracellular domains, that has profound consequences for mammary gland development and tumorigenesis.  (from OMIM 164951 and NCI)',3475434,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PRKCA (protein kinase C, alpha; PRKCA)','Protein Kinase C-Alpha','Encoded by human PRKCA Gene (PKC Family), 672-aa 77-kDa Protein Kinase C-alpha is a calcium-activated (likely by the C2 domain), DAG-activated, phospholipid-dependent serine/threonine kinase containing 2 zinc-dependent phorbol-ester/DAG binding domains and a C2 domain that phosphorylates a range of cellular proteins. DAG markedly increases PKC sensitivity to calcium and phospholipids. PKC activation appears to be central in the induction of cellular responses to many ligand-receptor systems and to external stimuli. After GPCR stimulation, and triggered by PKC-dependent serine phosphorylation, RKIP dissociates from RAF1 to associate with and block GRK2 activity. By activating PKC, the receptor signal may be enhanced by removing a RAF1 inhibitor and blocking receptor internalization. A receptor for phorbol ester tumor promoters, PKC may interact with PRKCABP. (NCI)',3475436,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NRP1 (neuropilin 1, NRP, VEGF165R, CD304)','Neuropilin 1','Encoded by human NRP1 Gene (Neuropilin Family), Neuropilin 1 contains 1 MAM, 2 F5/8 type C, and 2 CUB domains. Found in embryonic nervous system, and adult heart, placenta lung, liver, skeletal muscle, kidney, and pancreas, type I membrane-bound 923-aa 103-kDa (precursor) isoform 1, expressed by blood vessels, acts as a receptor in cardiovascular development, angiogenesis, formation of neuronal circuits, and organogenesis. Binding to semaphorin 3A, PLGF-2, VEGF-165, and VEGF-B, Isoform 1 appears to mediate chemorepulsion by semaphorins, to increase VEGF-165 binding to KDR, and to regulate VEGF-induced angiogenesis. Expressed in hepatocytes and kidney distal/proximal tubules, secreted 644-aa isoform 2 may bind semaphorins and induce apoptosis by sequestering VEGF-165; it has an adverse effect on blood vessel integrity. Expression of isoforms 1 and 2 does not seem to overlap. (NCI)',3475438,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ERCC2 (excision repair cross-complementing rodent repair deficiency, complementation group 2; XPD, MGC126219, MGC126218, MGC102762, MAG, EM9, complementation group 2 protein)','ERCC2 protein, human','No Value Exists',3475572,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SCN1A (sodium channel, voltage-gated, type I, alpha subunit; SMEl, SCN1, Nav1.1, NAC1, HBSCl, GEFSP2, FEB3)','sodium channel, voltage-gated, type I, alpha protein','No Value Exists',3475574,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCR3 (chemokine (C-C motif) receptor 3, CMKBR3, CKR3, CD193, CC-CKR-3)','CCR3 chemokine receptor binding','Interacting selectively and non-covalently with a CCR3 chemokine receptor. [GOC:mah, GOC:nln]',3481653,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCR5 (chemokine (C-C motif) receptor 5 (gene/pseudogene), IDDM22, CMKBR5, CKR5, CKR-5, CD195, CC-CKR-5)','C-C Chemokine Receptor Type 5','C-C chemokine receptor type 5 (352 aa, 41 kD) is a cell motility protein that is encoded by the human CCR5 gene and has roles in cell motility, inflammatory response and cell signaling.',3481655,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PSENEN (presenilin enhancer 2 homolog (C. elegans), PEN2)','PSENEN protein, human','No Value Exists',3481657,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RGS5 (regulator of G-protein signaling 5)','Regulator of G-Protein Signaling 5','Regulator of G-protein signaling 5 (5181 aa, ~21 kDa) is encoded by the human RGS5 gene. This protein plays a role in the signaling of heterotrimeric G-proteins.',3481659,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RPA1 (replication protein A1, 70kDa; RPA70, RP-A, RF-A, REPA1, HSSB)','RPA1 protein, human','No Value Exists',3481661,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CALR (Calreticulin, SSA, RO, FLJ26680, CRT, cC1qR)','Calreticulin','Calreticulin (417 aa, ~48 kDa) is encoded by the human CALR gene. This protein plays a role in protein folding.',3481663,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TET2 (tet methylcytosine dioxygenase 2, KIAA1546, FLJ20032)','Methylcytosine Dioxygenase TET2','Methylcytosine dioxygenase TET2 (2002 aa, ~224 kDa) is encoded by the human TET2 gene. This protein is involved in methylcytosine oxidation.',3481664,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HOXB6 (homeobox B6, HOX2, HOX2B)','HOXB6 protein, human','No Value Exists',3483458,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HOXA3 (homeobox A3, HOX1, HOX1E)','HOXA3 protein, human','No Value Exists',3483460,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TLR9 (toll-like receptor 9, CD289)','Toll-Like Receptor 9','Toll-like receptor 9 (1032 aa, ~116 kDa) is encoded by the human TLR9 gene. This protein plays a role in the mediation of inflammatory signaling.',3483462,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TLR2 (toll-like receptor 2, TIL4, CD282)','Toll-Like Receptor 2','Highly expressed in monocytes, bone marrow, lymph node, and spleen by human TLR2 Gene (TLR Family), 784-aa 90-kDa (precursor) type I transmembrane Toll-Like Receptor 2 contains a TIR domain and 14 LRR repeats and has a fundamental role in pathogen recognition and activation of innate immunity. Sharing structural and functional similarities, TLRs recognize pathogen-associated molecular patterns expressed on infectious agents and mediate cytokine production for effective immunity. With LY96, TLR2 mediates response to microbial lipoproteins and cell wall components. Binding LY96 and TLR6 via the extracellular domains, TLR2 recognizes MALP-2, STF, PSM, and OspA-L with TLR6. TLR2 acts via MyD88 (via their TIR domains) and TRAF6, activating NF-Kappa-B, cytokine secretion, and inflammatory response. TLR2 may promote apoptosis in response to lipoproteins. (NCI)',3483464,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TLR1 (toll-like receptor 1, rsc786, KIAA0012, CD281)','Toll-Like Receptor 1','Ubiquitously expressed (highest in spleen, ovary, leukocytes, thymus, and small intestine) by human TLR1 Gene (TLR family), 786-aa 90-kDa (precursor) type I transmembrane Toll-Like Receptor 1 contains a TIR domain and 8 LRR repeats and has a fundamental role in pathogen recognition and activation of innate immunity to microbial agents. Sharing structural and functional similarities, highly conserved TLRs recognize pathogen-associated molecular patterns expressed on infectious agents and mediate cytokine production necessary for effective immunity. TLR1 binds to the TLR2 extracellular domain and cooperates with TLR2. TLR1 appears to bind MyD88 via their TIR domains, and to TRAF6, leading to NF-Kappa-B activation, cytokine secretion, and inflammatory response. (NCI)',3483466,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IRF1 (interferon regulatory factor 1, MAR)','Interferon Regulatory Factor 1','Interferon regulatory factor 1 (325 aa, ~37 kDa) is encoded by the human 325 gene. This protein plays a role in the regulation of interferon gene expression.',3483468,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ECFCs (Endothelial Colony Forming Units, CFU-ECs, colony forming unit-endothelial cells)','Endothelium Colony Forming Unit','The layer of cells that lines the cavities of the heart and of the blood vessels (Endothelium, Vascular) and lymph vessels (Endothelium, Lymphatic), and the serous cavities of the body, originating from the mesoderm.: A unit of measurement of viable bacterial numbers. Colony forming unit (CFU) is the minimum number of separable cells, which is able to produce a visible colony of progeny. The examples of CFU usage include but not limited to the measurement of the number of bacteria present in the environment, and the ability of stem cells to produce cells of single or multiple lineages.',3490675,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KL (klotho)','Klotho','Klotho (1012 aa, ~116 kDa) is encoded by the human KL gene. This protein is involved in signal transduction.',3490677,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KRT1 (keratin 1, KRT1A, EHK1)','Keratin I','A keratin subtype that includes keratins that are generally smaller and more acidic that TYPE II KERATINS. Type I keratins combine with type II keratins to form keratin filaments.',3490679,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIR203 (microRNA 203, MIRN203, hsa-mir-203)','MIR203 Gene','This gene is involved in the regulation of gene expression and plays a role in the development of acute lymphoblastic leukemia and chronic myeloid leukemia.',3490681,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SFN (stratifin, YWHAS)','Stratifin','Stratifin was first identified as an epithelial cell antigen (HME-1) exclusively expressed in epithelia.  The protein is a putative cytoplasmic, p53-regulated homodimeric inhibitor of G2/M progression that is over expressed in squamous cell carcinoma of the head and neck.  The gene is a member of a large 14-3-3 gene family.',3490683,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Delta Np63 alpha','Delta Np63 alpha','Delta Np63 alpha',3490684,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PBXIP1 (pre-B-cell leukemia homeobox interacting protein 1, HPIP)','PBXIP1 protein, human','No Value Exists',3490686,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EBV VCA-IgG (Epstein Barr Virus Antibody to Viral Capsid Antigen IgG)','Epstein Barr Virus Antibody to Viral Capsid Antigen IgG','An immunoglobulin isotype (subclass) that characterizes secondary immune responses.  This isotype is further broken down into several smaller subclasses (IgG1, IgG2a, IgG2b, IgG3 in the mouse; IgG1-4 in the human), and each subclass is differentially synthesized and secreted into the serum upon differential immune stimuli.: Epstein-Barr virus serological reagents are devices that consist of antigens and antisera used in serological tests to identify antibodies to Epstein-Barr virus in serum. The identification aids in the diagnosis of Epstein-Barr virus infections and provides epidemiological information on diseases caused by these viruses. Epstein-Barr viruses are thought to cause infectious mononucleosis and have been associated with Burkitts lymphoma (a tumor of the jaw in African children and young adults) and postnasal carcinoma (cancer).',3499520,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GDF15 (growth differentiation factor 15, PTGFB, PLAB, PDF, NAG-1, MIC1, MIC-1)','GDF15 protein, human','No Value Exists',3499522,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EWS translocation mutation (Ewings Sarcoma Gene translocation mutation)','Ewings Sarcoma Gene translocation mutation','Movement from one place to another.: A general term referring to single or multiple alterations in the genetic material of an organism that ranges from a single base change in a gene to the loss or addition of complete chromosomes. A mutation abnormality may be heritable or occur somatically.: This gene may play a role in post-transcriptional regulation; however the function remains to be elucidated. Mutations in the gene result in Ewing sarcoma and other tumors.',3499524,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HSF1 (heat shock transcription factor 1, HSTF1)','Heat Shock Factor Protein 1','Heat shock factor protein 1 (529 aa, ~57 kDa) is encoded by the human HSF1 gene. This protein plays a role in activating the transcription of heat shock protein genes.',3499541,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Fibrinogen','Fibrinogen','Fibrinogen; a fibrillar protein present in blood plasma; it converts to fibrin when blood clots.',3515448,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MUC4 (mucin 4, cell surface associated)','Mucin-4','A transmembrane mucin that is found in a broad variety of epithelial tissue. Mucin-4 may play a role in regulating cellular adhesion and in cell surface signaling from the ERBB-2 RECEPTOR PROTEIN-TYROSINE KINASE. Mucin-4 is a heterodimer of alpha and beta chains. The alpha and beta chains result from the proteolytic cleavage of a precursor protein.',3515450,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TNFd3 allele','TNF wt Allele','Human TNF wild-type allele is located in the vicinity of 6p21.3 and is approximately 3 kb in length. This allele, which encodes tumor necrosis factor protein, is involved in a wide spectrum of biological processes including cell proliferation, differentiation, apoptosis, lipid metabolism, and coagulation. Aberrant alleles have been associated with a variety of diseases, including autoimmune diseases, insulin resistance, and cancer.',3515467,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TNF allele','Tumor Necrosis Factor Measurement Allele','A measurement of the total tumor necrosis factor (cachexin) cytokine in a biological specimen.: one of a series of possible alternative forms of a given gene, differing in DNA sequence, and affecting the functioning of a single product.',3515469,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EIF4A1 (eukaryotic translation initiation factor 4A1, EIF4A, EIF-4A, DDX2A)','EIF4A1 gene','No Value Exists',3519785,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DDIT3 (DNA-damage-inducible transcript 3, GADD153, CHOP10, CHOP)','DNA Damage-Inducible Transcript 3 Protein','DNA damage-inducible transcript 3 protein (169 aa, ~19 kDa) is encoded by the human DDIT3 gene. This protein plays a role in the sequestration of transcription factors.',3519787,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SEL1L (sel-1 suppressor of lin-12-like (C. elegans), IBD2, SEL1L1)','SEL1L protein, human','No Value Exists',3519789,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CXCR3 (chemokine (C-X-C motif) receptor 3, MigR, IP10-R, GPR9, CMKAR3, CKR-L2, CD183)','Chemokine (C-X-C Motif) Receptor 3','CD183 is a G protein-coupled receptor with selectivity for three chemokines, termed IP10 (interferon-g-inducible 10 kDa protein), Mig (monokine induced by interferon-g) and I-TAC (interferon-inducible T cell a-chemoattractant). Binding of chemokines to CD183 induces cellular responses that are involved in leukocyte traffic, most notably integrin activation, cytoskeletal changes and chemotactic migration. Inhibition by Bordetella pertussis toxin suggests that heterotrimeric G protein of the Gi-subclass couple to CD183. A hallmark of CD183 is its prominent expression in in vitro cultured effector/memory T cells, and in T cells present in many types of inflamed tissues. In addition, IP10, Mig and I-TAC are commonly produced by local cells in inflammatory lesion, suggesting that CD183 and its chemokines participate in the recruitment of inflammatory cells. (from LocusLink)',3519791,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TNFSF11 (tumor necrosis factor (ligand) superfamily member 11, TRANCE, RANKL, OPGL, ODF, CD254)','Tumor Necrosis Factor Ligand Superfamily Member 11','Most highly expressed in lymph nodes and upregulated by TCR stimulation, human TNFSF11 Gene (TNF Family) encodes alternative isoforms of 35-kDa (precursor) homotrimeric cytokine Tumor Necrosis Factor Ligand Superfamily Member 11, which binds as an osteoclast activation and differentiation ligand to TNFRSF11B/OPG and to TNFRSF11A/RANK. Isoforms 1 and 3 are type II membrane proteins; isoform 2 is secreted. A soluble form of isoform 1 likely derives from proteolytic processing by ADAM17. TNFSF11 activates antiapoptotic kinase AKT/PKB through a SRC kinase/TRAF6 signaling complex and augments or regulates dendritic cell stimulation of naive T-cell proliferation. (NCI)',3519793,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RNASEL (ribonuclease L (2,5-oligoisoadenylate synthetase-dependent), RNS4, PRCA1)','2-5A-Dependent Ribonuclease','2-5A-dependent ribonuclease (741 aa, ~84 kDa) is encoded by the human RNASEL gene. This protein plays a role in both RNA processing and the antiviral response.',3519795,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SH2D1A (SH2 domain containing 1A, XLPD, XLP, SAP, MTCP1, LYP, IMD5, EBVS, DSHP)','SH2 Domain-Containing Protein 1A','SH2 domain-containing protein 1A (128 aa, ~14 kDa) is a cell division protein that is encoded by the human SH2D1A gene and has roles in activation, proliferation, differentiation and function of T- and B-cells.',3519887,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BBC3 (BCL2 binding component 3, JFY1, PUMA)','BBC3 protein,human','No Value Exists',3519889,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IRF9 (interferon regulatory factor 9, ISGF3G)','IRF9 protein, human','No Value Exists',3519891,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HSPD1 (heat shock 60kDa protein 1 (chaperonin), SPG13, HSP60, GROEL)','HSPD1 protein, human','No Value Exists',3519893,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IRF7 (interferon regulatory factor 7)','Interferon Regulatory Factor-7','An interferon regulatory factor that is induced by INTERFERONS as well as LMP-1 protein from EPSTEIN-BARR VIRUS. IRF-7 undergoes PHOSPHORYLATION prior to nuclear translocation and it activates GENETIC TRANSCRIPTION of multiple interferon GENES.',3519895,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PTH (Parathyroid Hormone, PTH1)','Parathyroid Hormone','A substance made by the parathyroid gland that helps the body store and use calcium. A higher-than-normal amount of parathormone causes high levels of calcium in the blood and may be a sign of disease.',3521271,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PCADM-1 (Prostate Cancer-associated Diagnostic Marker-1)','Prostate Cancer-associated Diagnostic Marker 1','A novel gene/protein associated with prostate cancer.',3523001,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ABCA5 (ATP-binding cassette, sub-family A (ABC1), member 5; EST90625)','ABCA5 protein, human','No Value Exists',3523003,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ITGAL (integrin, alpha L (antigen CD11A (p180), lymphocyte function-associated antigen 1; alpha polypeptide); LFA-1)','Integrin Alpha-L','Integrin alpha-L (1170 aa, 129 kD) is a cell motility process protein that is encoded by the human ITGAL gene and has a role in cell motility.',3523005,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ULBP1 (UL16 binding protein 1, RAET1I)','ULBP1 protein, human','No Value Exists',3523192,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MICB (MHC class I polypeptide-related sequence B, PERB11.2)','MHC class I polypeptide-related sequence B protein, human','No Value Exists',3523194,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KLRC1 (killer cell lectin-like receptor subfamily C, member 1, NKG2-B, NKG2-A, NKG2, CD159a)','KLRC1 protein, human','No Value Exists',3528011,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NCR3 (natural cytotoxicity triggering receptor 3, NKp30, LY117, CD337, 1C7)','NCR3 protein, human','No Value Exists',3528013,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ULBP3 (UL16 binding protein 3, RAET1N)','ULBP3 protein, human','No Value Exists',3528015,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ULBP2 (UL16 binding protein 2, RAET1H)','ULBP2 protein, human','No Value Exists',3528017,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('killer cell lectin-like receptor subfamily K, member 1 (KLRK1, NKG2D)','KLRK1 protein, human','No Value Exists',3528019,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CYP2C19 var','Genetic Variation Cytochrome P450,Family 2, Subfamily C, Polypeptide 19','The phenotypic differences among individuals in a population: This protein is a member of the cytochrome P450 superfamily of enzymes. The cytochrome P450 proteins are monooxygenases which catalyze many reactions involved in drug metabolism and synthesis of cholesterol, steroids and other lipids. This protein localizes to the endoplasmic reticulum and is known to metabolize many xenobiotics, including the anticonvulsive drug mephenytoin, omeprazole, diazepam and some barbiturates. Polymorphism within this gene is associated with variable ability to metabolize mephenytoin, known as the poor metabolizer and extensive metabolizer phenotypes. (from LocusLink)',3534005,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CYP3A4 var','Genetic Variation Cytochrome P450 3A4','The phenotypic differences among individuals in a population: Induced primarily in liver by glucocorticoids, drugs, pesticides, and carcinogens and encoded by human CYP3A4 Gene (Cytochrome P450 IIIA Subfamily), Cytochrome P450 3A4 is a 502-amino acid 57.3-kD membrane-bound ER heme-thiolate monooxygenase. CYP3A4 is involved in an NADPH-dependent electron transport pathway and phase I oxidative metabolism of carcinogens, steroids, fatty acids, and xenobiotics, as well as bioactivation of aflatoxin B(1) to a genotoxic derivative. Activity seems a key predictor of drug responsiveness and toxicity. (from LocusLink, Swiss-Prot, OMIM, and NCI)',3534006,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('T-cell Receptor (TCR) Repertoire','T-cell Receptor (TCR) Repertoire','T-cell Receptor (TCR) Repertoire',3534028,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NR1/2 var','Genetic Variation NR1I2 gene','The phenotypic differences among individuals in a population: No Value Exists',3534030,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('VEGFA var','Genetic Variation Vascular Endothelial Growth Factor','The phenotypic differences among individuals in a population: A substance made by cells that stimulates new blood vessel formation.',3534031,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL8 var','Genetic Variation Interleukin-8','The phenotypic differences among individuals in a population: A member of the CXC chemokine family. This chemokine is one of the major mediators of the inflammatory response. This chemokine is secreted by several cell types including monocytes, macrophages, T-lymphocytes, fibroblasts, endothelial cells, and keratinocytes. It functions as a chemoattractant, and is also a potent angiogenic factor. (from LocusLink)',3534032,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Proteomics Profile','Proteomics Profile','The global analysis of cellular proteins has recently been termed proteomics and is a key area of research that is developing in the post-genome era. Proteomics uses a combination of sophisticated techniques including two-dimensional (2D) gel electrophoresis, image analysis, mass spectrometry, amino acid sequencing, and bio-informatics to resolve comprehensively, to quantify, and to characterize proteins. The application of proteomics provides major opportunities to elucidate disease mechanisms and to identify new diagnostic markers and therapeutic targets. (J Pathol 2000;192:280-288 ): An analysis (often in graphical form) representing the extent to which something exhibits various characteristics.',3534033,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('eNOS Intron 4VNTR','Intron Nitric Oxide Synthase 3','Non-coding, intervening sequences of DNA that are transcribed, but are removed from within the primary gene transcript and rapidly degraded during maturation of messenger RNA.: Expressed in platelets and endothelia by human NOS3 Gene (NOS Family), conserved constitutive 1202-aa 133-kDa Nitric Oxide Synthase 3 is a calcium/calmodulin stimulated homodimer stabilized by BH4 that contains a flavodoxin-like domain, binds FAD and FMN cofactors, and synthesizes NO from L-arginine. Endothelial NO appears to exert EDRF activity that inhibits vascular smooth muscle contraction through a cGMP pathway. NOS3 activity also inhibits platelet aggregation and mediates VEGF-induced angiogenesis. Vascular shear stress activates endothelial PI3K and AKT, which directly phosphorylates (Ser1177) and enhances NOS3 activity and calcium sensitivity. Potentially influencing the control of energy balance, NO also triggers cGMP-dependent mitochondrial biogenesis mediated by induction of the master regulator PPARGC1. (NCI)',3534034,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('VEGFR2 Intron 2VNTR','Intron Vascular Endothelial Growth Factor Receptor 2','Non-coding, intervening sequences of DNA that are transcribed, but are removed from within the primary gene transcript and rapidly degraded during maturation of messenger RNA.: Receptor for vegf or vegf-c. Has a tyrosine-protein kinase activity. The VEGF-kinase ligand/receptor signaling system plays a key role in vascular development and regulation of vascular permeability. (from SwissProt)',3534035,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('VEGFR2 var','Genetic Variation Vascular Endothelial Growth Factor Receptor 2','The phenotypic differences among individuals in a population: Receptor for vegf or vegf-c. Has a tyrosine-protein kinase activity. The VEGF-kinase ligand/receptor signaling system plays a key role in vascular development and regulation of vascular permeability. (from SwissProt)',3534036,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('VEGF var','Genetic Variation Vascular Endothelial Growth Factor','The phenotypic differences among individuals in a population: A substance made by cells that stimulates new blood vessel formation.',3534037,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCL19 (chemokine (C-C motif) ligand 19, SCYA19, MIP-3b, exodus-3, ELC, CKb11, CCL19)','Small Inducible Cytokine A19','Expressed in lymph nodes, thymus, appendix, colon, trachea, spleen, small intestine, lung, kidney, and stomach by human CCL19 Gene (Intercrine Beta Family), secreted immunoregulatory 98-aa 11-kD (precursor) Small Inducible Cytokine A19 is involved in inflammatory and immunological responses, binds to CCR7 receptor, and plays a role in thymic T cell trafficking and T and B cell migration. (NCI)',3534175,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('6q deletion','6q Chromosomal Deletion','Distal (long) arm of chromosome 6: Loss of a portion of a chromosome arm.',3534176,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TILs (Tumor Infiltrating Lymphocytes)','Tumor Infiltrating Lymphocyte','Lymphocytes that show specificity for autologous tumor cells. Ex vivo isolation and culturing of TIL with interleukin-2, followed by reinfusion into the patient, is one form of adoptive immunotherapy of cancer.',3534177,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AKT3 (v-akt murine thymoma viral oncogene homolog 3 (protein kinase B, gamma); RAC-gamma, PRKBG, PKBG)','AKT3 Gene','This gene is involved in signal transduction and the inhibition of apoptosis.',3534179,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RAD54L (RAD54-like (S. cerevisiae), RAD54A, hRAD54, hHR54)','RAD54L Gene','This gene plays a role in the homologous recombination of double-strand DNA breaks.',3534181,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RECQL (RecQ protein-like (DNA helicase Q1-like); RecQL1, RecQ1)','RecQL Helicase','RecQL protein is a 13,3 kD peptide (1208 aa), belongs to the RecQ subfamily of helicases and contains from aa 476 to 824 an helicase domain with a potential ATP binding site from aa 502 to 509, and the DEAH box from aa 605 to 608.  The expression of RecQ4 gene is partially upregulated in the G1/S phase of cell cycle. It suppresses promiscuous genetic recombination and ensures accurate chromosome segregation.',3534183,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Telomere Length','Length Telomere','Length; the linear extent in space from one end to the other.: The terminal end of a chromosome arm which has a specialized structure and which is involved in chromosomal replication and stability. Its length is believed to be a few hundred base pairs. Telomeres undergo dramatic changes during the progression of cancer.',3534185,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PML-RARalpha mutation','PML Gene RARA Gene Chromosomal mutation','This gene plays a role in tumor suppression and is involved in the regulation of p53 in response to oncogenic signal transduction.: This gene plays a role in transcription and retinoic acid receptor signal transduction.: No Value Exists',3534188,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Total Phosphotyrosine','Total Phosphotyrosine','Pertaining to an entirety or whole, also constituting the full quantity or extent; complete.: An amino acid that occurs in endogenous proteins. Tyrosine phosphorylation and dephosphorylation plays a role in cellular signal transduction and possibly in cell growth control and carcinogenesis.',3534190,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ephrin (EPH) Receptor Kinase','Ephrin Receptor Kinase','Eph receptor tyrosine kinases and their ligands, the ephrins, appear to lie functionally at the interface between pattern formation and morphogenesis.  They play a major role in axonal pathfinding and target recognition during central nervous system (CNS) development.  (from Development 1999;126:2033-2044 and Exp Neurol 1999;156:218-22): Encoded by Kinase Family Genes, Kinase enzymes covalently transfer the terminal, gamma phosphate group from ATP to a variety of substrates and typically play key regulatory roles in diverse cellular functions. (NCI)',3534203,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TNF beta (Tumor Necrosis Factor beta)','Tumor Necrosis Factor-Beta','Human tumor necrosis factor-beta protein (205 aa, 22 kDa precursor) is encoded by the human lymphotoxin alpha (LTA) gene. This soluble glycoprotein is released by antigen- or mitogen-activated lymphocytes and is a cytotoxic to other cells. It is involved in allergies and chronic inflammatory diseases.',3534205,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CXCL16 (chemokine (C-X-C motif) ligand 16, CXCKG16, SR-PSOX, SRPSOX)','CXCL16 gene','No Value Exists',3534207,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CXCL11 (chemokine (C-X-C motif) ligand 11, SCYB9B, IP-9, I-TAC, H174, b-R1)','CXCL11 Gene','This gene is involvd in the regulation of immune responses and cellular responses.',3534209,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCL21 (chemokine (C-C motif) ligand 21,TCA4m SLC, SCYA21, exodus-2, ECL, CKb9, 6Ckine)','CCL21 Gene','This gene is involved in the regulation of leukocyte migration.',3534211,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('JAG1 (jagged 1, JAGL1, HJ1, CD339, AWS, AHD, AGS)','jagged-1','No Value Exists',3534432,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Wnt','Wnt gene/protein','Wnt proteins form a family of highly conserved secreted signaling molecules that regulate cell-to-cell interactions during embryogenesis; Wnt genes and Wnt signaling are also implicated in cancer; as currently understood, Wnt proteins bind to receptors of the Frizzled family on the cell surface; through several cytoplasmic relay components, the signal is transduced to beta-catenin, which then enters the nucleus and forms a complex with TCF to activate transcription of Wnt target genes.',3534434,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NES (nestin, FLJ21841)','nestin protein','No Value Exists',3534436,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TRP (L-tryptophan)','Tryptophan','The least plentiful of all 22 amino acids and an essential amino acid in humans (provided by food), Tryptophan is found in most proteins and a precursor of serotonin. Tryptophan is converted to 5-hydroxy-tryptophan (5-HTP), converted in turn to serotonin, a neurotransmitter essential in regulating appetite, sleep, mood, and pain. Tryptophan is a natural sedative and present in dairy products, meats, brown rice, fish, and soybeans. (NCI04)',3535206,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AP-1 Transcription Factor (Activator Protein 1 transcription factor)','AP-1 Transcription Factor','A dimeric complex of related bZIP JUN, FOS, MAF and ATF transcription factors that must dimerize in order to bind to AP1 recognition sites (TPA-Responsive Element, TRE) or cAMP response elements in DNA, AP-1 controls basal and inducible transcription of several genes.: Transcription factors are a diverse group of proteins that bind to DNA at specific promoter or enhancer regions. They also bind to DNA-associated proteins to initiate, stimulate, inhibit or terminate transcription. The proteins are often physically associated in a preinitiation complex and contain structural motifs.',3535208,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Glucocorticoid sensitivity','Glucocorticoid Sensitivity','A group of corticosteroids that affect carbohydrate metabolism (gluconeogenesis, liver glycogen deposition, elevation of blood sugar), inhibit corticotropin secretion, and possess pronounced anti-inflammatory activity. They also play a role in fat and protein metabolism, maintenance of arterial blood pressure, alteration of the connective tissue response to injury, reduction in the number of circulating lymphocytes, and functioning of the central nervous system. (MSH2002_06_01): Sensitivity; the ability to respond to physical stimuli or to register small physical amounts or differences.',3535210,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ASCL1 (achaete-scute complex homolog 1 (Drosophila), ASH1, bHLHa46, HASH1)','Achaete-Scute Homolog 1','Achaete-scute homolog 1 (236 aa, ~25 kDa) is encoded by the human ASCL1 gene. This protein plays a role in both transcriptional regulation and signal transduction.',3535212,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HES1 (hairy and enhancer of split 1, (Drosophila), HES-1, Hes1, HRY, FLJ20408, bHLHb39)','HES1 Gene','This gene is involved in the modulation of transcription.',3535214,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Telomere content','Telomere','The terminal end of a chromosome arm which has a specialized structure and which is involved in chromosomal replication and stability. Its length is believed to be a few hundred base pairs. Telomeres undergo dramatic changes during the progression of cancer.',3535368,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NQO1 (NAD(P)H dehydrogenase, quinone 1; NMOR1, QR1, DTD, DIA4, DHQU)','NQO1 Gene','This gene is involved in drug/xenobiotic metabolism, biosynthetic processes and the prevention of cellular oxidative stress.',3535370,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('alpha-Tocopheryl-hydroquinone','Alpha Tocopherol Hydroquinone','Indicates the probability of rejecting the statistical hypothesis tested when in fact, that hypothesis is true.: Class of compounds having one to three methyl groups on a chromanol ring with a long saturated 12-carbon side chain with three methyl groups along the chain and two methyl groups at the end; may contribute to vitamin E activity.: Produced as an inhibitor, an antioxidant, and an intermediate in the synthesis of dyes, motor fuels, and oils; in photographic processing; and naturally in certain plant species, Hydroquinone is a phenol derivative with antioxidant properties that can cause toxicity in several organs, notably the kidney. Used as a topical treatment for skin hyperpigmentation and in various cosmetic products, it is metabolized mainly to glutathione conjugates and forms mutagenic DNA adducts in in-vitro systems. (NCI04)',3535373,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Vitamin E','Vitamin E Measurement','The determination of the amount of Vitamin E present in a sample.',3535375,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Alpha-tocopherylquinone','tocopherylquinone','No Value Exists',3535377,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIA (melanoma inhibitory activity, CD-RAP)','Melanoma-Derived Growth Regulatory Protein','Melanoma-derived growth regulatory protein (131 aa, ~15 kDa) is encoded by the human MIA gene. This protein plays a role in the repression of melanoma cell proliferation.',3535379,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KYN (Kynurenine)','Kynurenine','aromatic aminoacid formed as an intermediate in the metabolism of tryptophan.',3535381,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NFAT (Nuclear Factor of Activated T cells)','Nuclear Factor of Activated T cells','Nuclear Factor of Activated T cells',3535382,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CXCL12 (chemokine (C-X-C motif) ligand 12, TPAR1, TLSF-b, TLSF-a, SDF1B, SDF1A, SDF1, SDF-1b, SDF-1a, SCYB12, PBSF)','Stromal Cell-Derived Factor 1','Encoded by human CXCL12 Gene (Intercrine Alpha/Chemokine CXC Family), alternative alpha and beta isoforms of secreted 93-aa 11-kD (precursor) Stromal Cell-Derived Factor 1 are chemoattractant ligands for CXCR4 on T-lymphocytes and monocytes. The beta form contains additional C-terminal sequence. SDF1 is cleaved of an N-terminal tetrapeptide by MMP2 and loses CXCR4 affinity. Human and mouse protein sequences are nearly 92% identical. SDF1 induces intracellular actin polymerization in lymphocytes and may regulate immune surveillance and extravasation of lymphocytes and monocytes rather than in inflammation. With CD4, SDF1 is a coreceptor on CD4+ lymphocytes for HIV-1. (NCI)',3535387,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TNFalphaR2 (Tumor Necrosis Factor alpha, Receptor type 2)','Receptors, Tumor Necrosis Factor, Type II','A tumor necrosis factor receptor subtype that is expressed primarily in IMMUNE SYSTEM cells. It has specificity for membrane-bound form of TUMOR NECROSIS FACTORS and mediates intracellular-signaling through TNF RECEPTOR ASSOCIATED FACTORS.',3536295,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NOX4 (NADPH oxidase 4, KOX-1, KOX)','NOX4 protein, human','No Value Exists',3536297,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NNMT (nicotinamide N-methyltransferase)','NNMT protein, human','No Value Exists',3536299,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ferritin','Ferritin','An iron protein complex, containing up to 23% iron, formed by the union of ferric iron with apoferritin; it is found in the intestinal mucosa, spleen, bone marrow, reticulocytes, and liver, and regulates iron storage and transport from the intestinal lumen to plasma.',3536300,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Pro-BNP (Gamma-Brain Natriuretic Peptide; Natriuretic Peptides B; Natriuretic Peptide Precursor B; NPPB; pro-BNP)','Natriuretic Peptides B','Natriuretic peptides B (134 aa, ~15 kDa) is encoded by the human NPPB gene. This protein is involved in the maintenance of cardiac homeostasis.',3536302,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BRAF V600K Mutation','BRAF NP_004324.2:p.V600K Chromosomal mutation','A change in the amino acid residue at position 600 in the serine/threonine protein kinase B-raf protein where valine has been replaced by lysine.: No Value Exists',3536304,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CRBN (cereblon, MRT2A)','CRBN gene','No Value Exists',3536306,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BRAF V600E Mutation','BRAF NP_004324.2:p.V600E','A change in the amino acid residue at position 600 in the serine/threonine protein kinase B-raf protein where valine has been replaced by glutamic acid.',3536308,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FMOD (fibromodulin, SLRR2E)','fibromodulin,human','No Value Exists',3536310,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Effector T cells','Effector Cell T-Lymphocyte','A cell that performs a specific function in response to a stimulus; usually used to describe cells in the immune system.: One type of white blood cell that attacks virus-infected cells, foreign cells, and cancer cells.  T cells also produce a number of substances that regulate the immune response.',3536311,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PLCG1 (phospholipase C, gamma 1; PLCgamma1, PLC148, PLC1, PLC-II, NCKAP3)','PLCG1 protein, human','No Value Exists',3536313,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GAA (Glioma associated antigens)','Antigen Malignant Glioma','Any substance that appears foreign or potentially adverse to the body and elicits immune response.: A malignant neuroglial neoplasm. The term can apply to several primary neoplasm of the brain and spinal cord, including astrocytoma and oligodendroglioma in addition to others.',3536315,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LIF (leukemia inhibitory factor, HILDA, DIA, CDF)','Leukemia Inhibitory Factor','Leukemia Inhibitory Factor (LIF) affects many systems, including hematopoietic, embryonic, bone, hepatic, neuronal, and fat tissues. LIF induces MHC class I HLA-G expression by cytotrophoblasts, which is essential in implantation and may facilitate immune tolerance of the conceptus at the maternal-fetal interface. LIF, secreted by ureteric bud cells, converts kidney mesenchyme to epithelia, which then forms nephrons. LIF and BMP2 cytokines signal through different receptors and transcription factors (STATs and SMADs) and act in synergy on neural progenitors to induce astrocytes. Transcriptional co-activator p300 interacts with STAT3 in a cytokine-independent manner and with SMAD1 in a cytokine-dependent manner. Formation of a STAT3/SMAD1 complex, bridged by p300, mediates cooperative signaling of LIF and BMP2 and induction of astrocytes from neuronal progenitors. (from OMIM and NCI)',3536656,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL20 (interleukin 20, ZCYTO10, IL10D, IL-20)','IL20 gene','No Value Exists',3536658,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCL1 (chemokine (C-C motif) ligand 1, TCA3, SISe, SCYA1, P500, I-309)','Chemokine CCL1','A CC-type chemokine secreted by activated MONOCYTES and T-LYMPHOCYTES. It has specificity for CCR8 RECEPTORS.',3536660,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCL27 (chemokine (C-C motif) ligand 27, skinkine, SCYA27, PESKY, ILC, ESkine, CTAK, CTACK, ALP)','Small Inducible Cytokine A27','Expressed in testis, thymus, placenta, ovary, and skin by human CCL27 Gene (Intercrine Beta Family), immunoregulatory 112-aa 12.6-kD (precursor) Small Inducible Cytokine A27 is a chemotactic factor that binds to CCR10 and mediates homing of memory T lymphocytes to cutaneous sites in inflammatory processes. (NCI)',3536662,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CXCL13 (chemokine (C-X-C motif) ligand 13, SCYB13, BLR1L, BLC, BCA-1, ANGIE2, ANGIE)','Small Inducible Cytokine B13','Expressed in liver, spleen, lymph node, Peyers patches, appendix, stomach, salivary gland, mammary gland, and fetal spleen by human CXCL13 Gene (Intercrine Alpha/Chemokine CXC Family), secreted 109-aa 13-kD (precursor) Small Inducible Cytokine B13 binds to BLR1/CXCR5 and promotes migration and chemotaxis of B lymphocytes expressing BLR-1. It may function in B lymphocyte homing to follicles. (NCI)',3536664,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL33 (interleukin 33, member 11,NF-HEV, IL1F11, DVS27, DKFZp586H0523, C9orf26)','IL33 gene','No Value Exists',3536744,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL29 (interleukin 29 (interferon, lambda 1), IL-29, IFNL1)','IL29 gene','No Value Exists',3536746,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCL13 (chemokine (C-C motif) ligand 13, SCYL1, SCYA13, NCC-1, MGC17134, MCP-4, CKb10)','Small Inducible Cytokine A13','Induced by IL-1 and TNF-alpha, widely expressed, and encoded by human CCL13 Gene (Intercrine Beta Family), 98-aa 11-kD (precursor) Small Inducible Cytokine A13 is a secreted chemotactic factor for monocytes, lymphocytes, basophils, and eosinophils that signals through CCR2B and CCR3 receptors and is involved in immunoregulatory and inflammatory processes. The protein can bind heparin and isoforms MCP-4, (LA)MCP-4, and (FNPQGLA)MCP-4 exist. CCL13 may be involved in atherosclerosis. (NCI)',3537138,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TPO (XCL1 (thyroid peroxidase, TPX)','Thyroid Peroxidase','Human thyroid peroxidase protein (933 aa, ~103 kDa isoform) is encoded by the human thyroid peroxidase (TPO) gene. This protein is the primary enzyme involved in thyroid hormone synthesis.',3537139,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('XCL1 (chemokine (C motif) ligand 1, SCYC1, SCM-1, SCM-1a, lymphoactin, LTN, LPTN, ATAC)','XCL1 Gene','This gene is involved in cellular migration and inflammatory processes.',3537141,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CX3CL1 (chemokine (C-X3-C motif) ligand 1, small inducible cytokine subfamily D (Cys-X3-Cys), member 1 (fractalkine, neurotactin); SCYD1, NTN, neurotactin, fractalkine, CXC3C, CXC3, C3Xkine, ABCD-3)','Small Inducible Cytokine D1','Fractalkine, encoded by the cytokine D1 gene, is the first member of a fourth branch of the chemokine superfamily. Unlike other known chemokines, fractalkine is a type 1 membrane protein with a signal peptide, a chemokine domain, a stalk region containing 17 degenerate mucin-like repeats, a transmembrane segment and a cytoplasmic domain. The extracellular domain of fractalkine is released into the supernatants of transfected cells as a 95 kDa glycoprotein, possibly by proteolysis at the dibasic cleavage site proximal to the membrane, to generate soluble fractalkine. mRNA expression is most abundant in the brain and heart, but is also present at lower levels in other tissues tested except peripheral blood where most chemokines are highly expressed. The expression of fractalkine in microglia, endothelial and fibroblastic cells is upregulated by inflammatory signals.',3537323,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL4R (interleukin 4 receptor, CD124)','Interleukin 4 Receptor','IL4R when complexed with the common gamma chain (IL2RG) serves as the high-affinity interleukin 4 (IL4) receptor. It plays a major role in immunoglobulin E (IgE) production.',3537325,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCL7 (small inducible cytokine A7 (monocyte chemotactic protein 3), SCYA7, SCYA6, NC28, monocyte chemotactic protein 3, monocyte chemoattractant protein 3, MCP3, MCP-3, MARC, FIC, chemokine (C-C motif) ligand 7)','Small Inducible Cytokine A7','Small Inducible Cytokine A7, encoded by the CCL7 gene, is a secreted chemokine which attracts macrophages during inflammation and metastasis. It is a member of the C-C subfamily of chemokines which are characterized by having two adjacent cysteine residues. The protein is an in vivo substrate of matrix metalloproteinase 2, an enzyme which degrades components of the extracellular matrix. (from LocusLink)',3537327,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RPS6KB2 (ribosomal protein S6 kinase, 70kD, polypeptide 2; RPS6KB2, STK14B,  ribosomal protein S6 kinase, 70kD, polypeptide 2; p70S6Kb, P70-BETA, KLS)','Ribosomal Protein S6 Kinase Beta-2','Ribosomal protein S6 kinase beta-2 (482 aa, ~53 kDa) is encoded by the human RPS6KB2 gene. This protein is involved in serine/threonine protein phosphorylation.',3538751,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CXCL6 (small inducible cytokine subfamily B (Cys-X-Cys), member 6 (granulocyte chemotactic protein 2); SCYB6, GCP-2, CXCL6, CKA-3, chemokine (C-X-C motif) ligand 6 (granulocyte chemotactic protein 2)','Small Inducible Cytokine B6','Encoded by human CXCL6 Gene (Intercrine Alpha/Chemokine CXC Family), secreted 114-aa 12-kD (precursor) Small Inducible Cytokine B6 is a potent inflammatory mediator and chemotactic factor for neutrophilic granulocytes that regulates leukocyte trafficking through interactions with a subset of 7-transmembrane, G protein-coupled receptors CXCR1 and CXCR2 and activates gelatinase B (MMP9) release from granulocytes. Human and bovine GCP2 are 67% identical at the amino acid level. (NCI)',3538753,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCL20 (small inducible cytokine subfamily A (Cys-Cys), member 20; ST38, SCYA20, MIP-3a, LARC, exodus-1, CKb4, chemokine (C-C motif) ligand 20)','Small Inducible Cytokine A20','Repressed by IL-10 and induced by LPS, PMA, TNF, and INF Gamma in liver, lymph nodes, appendix, PBL, thymus, prostate, testis, small intestine, colon, and fetal lung, the human CCL20 Gene product (Intercrine Beta Family), Small Inducible Cytokine A20, is a secreted chemotactic factor for lymphocytes, neutrophils, and dendritic cells that binds CCR6 and may inhibit proliferation of myeloid progenitors. (NCI)',3538755,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Neurokinin-1 (NK-1) Receptor','Tachykinin Receptor 1','Encoded by human TACR1 Gene (GPCR1 Family), 407-aa 46-kDa Tachykinin Receptor 1 is a receptor for the tachykinin neuropeptide substance P and an integral membrane protein with 7 hydrophobic transmembrane regions that probably associates with G proteins that activate a phosphatidylinositol-calcium second messenger system. TACR1 is also involved in mediation of phosphatidylinositol metabolism of substance P. Receptor affinity for tachykinins is: substance P, substance K, neuromedin K. (NCI)',3539518,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('5-HT-3 (5-hydroxytryptamine-3) receptor','Serotonin 5-HT-3 Receptor','Serotonin 5-HT-3 Receptor, encoded by the human HTR3 gene, is one of the several different receptors for serotonin (5-hydroxytryptamine, 5-HT), a biogenic hormone that functions as a neurotransmitter, a hormone, and a mitogen. Whereas all other known serotonin receptor subtypes are G protein-coupled receptors, this receptor is a ligand-gated ion channel, which when activated causes fast, depolarizing responses in neurons. It is a cation-specific, but otherwise relatively nonselective, ion channel. Two isoforms, 1/5-HT3R-AS and 2/5-HT3R-AL, are produced by alternative splicing. (From OMIM, Swiss-Prot and NCI)',3539520,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Serum Free Light Chain (sFCL)','Serum Free Immunoglobulin Light Chain','Human immunoglobulin kappa and/or lambda light chains detected in their free form in serum as a result of overproduction by plasma cells in excess over heavy chains due to neoplastic plasma cell proliferations.',3539521,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AMP Kinase','5-AMP-Activated Protein Kinase','5-AMP-activated protein kinase is a protein complex that is a heterotrimer of an alpha, a beta and a gamma subunit. This complex is involved in the regulation of glucose uptake, the oxidation of fatty acids and mitochondria biogenesis.',3539522,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MRE11A (MRE11 meiotic recombination 11 homolog A (S. cerevisiae), MRE11, meiotic recombination (S. cerevisiae) 11 homolog A, ATLD, AT-like disease)','MRE11A Gene','This gene plays a role in DNA recombination and repair.',3539524,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Alpha-v beta-6 receptor','Alpha-v beta-6 receptor','Alpha-v beta-6 receptor',3539835,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Alpha-v beta-3 integrin (vitronectin receptor; aVBeta3; aVBeta3 Integrin; Integrin Alpha-V/Beta-3; Integrin AlphaV/Beta3; Integrin aVBeta3, Alpha-V/Beta-3 Integrin)','Integrin aVBeta3','Involved in cell adhesion and signaling, human Integrin-aVBeta3 is composed of type I membrane protein chains Integrin Alpha V (disulfide-linked heavy and light chains) and Integrin Beta 3 that recognize RGD sequences. Multiple heterodimeric alpha/beta combinations result in different integrins. aV/beta-3 is a receptor for cytotactin, fibronectin, laminin, MMP-2, osteopontin, osteomodulin, prothrombin, thrombospondin, vitronectin, and von Willebrand factor. (NCI)',3539836,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Transcobalamin (Vitamin B binding capacity)','Transcobalamin','A group of carrier proteins which bind with VITAMIN B12 in the BLOOD and aid in its transport. Transcobalamin I migrates electrophoretically as a beta-globulin, while transcobalamins II and III migrate as alpha-globulins.',3540094,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NTS (neurotensin, neuromedin N)','Neurotensin','A biologically active tridecapeptide isolated from the hypothalamus. It has been shown to induce hypotension in the rat, to stimulate contraction of guinea pig ileum and rat uterus, and to cause relaxation of rat duodenum. There is also evidence that it acts as both a peripheral and a central nervous system neurotransmitter.',3540096,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RUNX3 (runt-related transcription factor 3, PEBP2A3, CBFA3, AML2)','Runt-Related Transcription Factor 3','Runt-related transcription factor 3 (415 aa, ~44 kDa) is encoded by the human RUNX3 gene. This protein is involved in the modulation of transcription.',3540098,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MEF2C (myocyte enhancer factor 2C)','MEF2C Gene','This gene plays a role in muscular and vascular development.',3540100,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ATF1 (activating transcription factor 1, TREB36)','ATF1 Gene','This gene is involved in the modulation of transcription.',3540102,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PDPN (lung type I cell membrane associated glycoprotein, PA2.26, podoplanin, T1A-2, GP40, Gp38, aggrus)','PDPN protein, human','No Value Exists',3540104,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cytomegalovirus (CMV) DNA','Cytomegalovirus DNA','A genus of the family herpesviridae, subfamily betaherpesvirinae, infecting the salivary glands, liver, spleen, lungs, eyes, and other organs, in which they produce characteristically enlarged cells with intranuclear inclusions.: A long linear double-stranded polymer formed from nucleotides attached to a deoxyribose backbone and found in the nucleus of a cell; associated with the transmission of genetic information. ',3540172,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BRAF V600D Mutation','BRAF NP_004324.2:p.V600D','A change in the amino acid residue at position 600 in the serine/threonine protein kinase B-raf protein where valine has been replaced by aspartic acid.',3540174,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GMC (Gut Microbial Community) profile','Gut Microbial Community profile','Gut Microbial Community profile',3540217,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ABCB5 (ATP-binding cassette, sub-family B (MDR/TAP), member 5; ATP-binding cassette protein, EST422562, P-glycoprotein ABCB5, ABCB5beta, ABCB5alpha)','ABCB5 Gene','This gene plays a role in both membrane transport and drug resistance.',3540219,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Clostridium Cluster XIV','Clostridium Cluster XIV','A genus of gram-positive, obligate anaerobic bacteria in the Firmicutes phylum capable of producing endospores.: A number with no fractional part, including the negative and positive numbers as well as zero.::14: A grouping of a number of similar things.',3540694,'ACTIVE');
