INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Atopobium','Atopobium','A genus of anaerobic, Gram positive, cocci shaped bacterium in the phylum Actinobacteria and the family Coriobacteriaceae.',3540697,'ACTIVE');
