INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Clostridium Cluster XVI','Clostridium Cluster XVI','A genus of gram-positive, obligate anaerobic bacteria in the Firmicutes phylum capable of producing endospores.: A number with no fractional part, including the negative and positive numbers as well as zero.::16: A grouping of a number of similar things.',3541523,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Desulfovibrio','Desulfovibrio','Any bacteria that is not assigned to the species level but can be assigned to the Desulfovibrio genus level.',3541525,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Prevotella','Prevotella','A genus of anaerobic, Gram negative, rod shaped bacterium assigned to the phylum Bacteroidetes and the family Prevotellaceae.',3541527,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('STAT6 (signal transducer and activator of transcription 6, interleukin-4 induced, IL-4-STAT, D12S1644)','Signal Transducer and Activator of Transcription 6','Signal transducer and activator of transcription 6 (847 aa, ~94 kDa) is encoded by the human STAT6 gene. This protein is involved in the modulation of both gene expression and signal transduction.',3541550,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCL17 (small inducible cytokine subfamily A (Cys-Cys), member 17, TARC, SCYA17, chemokine (C-C motif) ligand 17, ABCD-2)','Small Inducible Cytokine A17','Expressed by human CCL17 Gene (Intercrine Beta Family) in thymus, lung, colon, and small intestine and induced by PHA in mononuclear cells and by cytokines in monocytes, secreted 94-aa 10-kD (precursor) Small Inducible Cytokine A17 is an immunoregulatory chemotactic factor for T lymphocytes that binds to CCR4 and CCR8 receptors and is important in inflammatory processes, in thymic T cell development, and in trafficking and activation of mature T cells. (NCI)',3541552,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CYP2D6 (cytochrome P450, family 2, subfamily D, polypeptide 6, CYP2DL1, CYP2D8P2, CYP2D7P2, CYP2DBP, CYP2D7AP, CYP2D, CPD6, P450-DB1, P450C2D)','CYP2D6 Gene','This gene plays a role in the metabolism of numerous clinically-relevant drugs. It is also involved in the oxidation of xenobiotics.',3541554,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ICOS (activation-inducible lymphocyte immunomediatory molecule, AILIM, CD278, inducible T-cell co-stimulator)','ICOS Gene','This gene is involved in the immune response.',3541556,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Lignans','Lignan','Two (hydr)oxylated phenyl-propane (C6C3) monomers connected by the beta carbons of the C3 chains to form a) diarylbutanes, and sometimes by additional other bonds to form b) dihydronaphtalenes, c) tetrahydrofuranes, d) dioxabicyclooctanes. The building blocks for lignin. (Boker, et al)',3541558,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Eubacteria','Eubacteriaceae','A taxonomic family of bacterium in the phylum Firmicutes that includes the genera Acetobacterium, Eubacterium and Garciella among others.',3541560,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Veillonella','Veillonella','A genus of anaerobic, Gram negative, cocci shaped bacterium assigned to the phylum Firmicutes and the family Veillonellaceae.',3541562,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LIPC (lipase, hepatic)','Lipase','Lipase; an enzyme secreted in the digestive tract that catalyzes the breakdown of fats into individual fatty acids that can be absorbed into the bloodstream.',3553430,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD36 (CD36 antigen (collagen type I receptor, thrombospondin receptor); CD36 molecule (thrombospondin receptor), FAT, GP3B, GP4, GPIV, SCARB3)','CD36 protein (93-110)','No Value Exists',3553432,'ACTIVE');
