INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Fructosamine','Fructosamine Measurement','The determination of the amount of fructosamine present in a sample.',3553470,'ACTIVE');
