INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GH1 (pituitary growth hormone, hGH-N, growth hormone 1, GHN, GH1, GH-N, GH)','Growth Hormone','A peptide hormone secreted by the anterior lobe of the pituitary gland and regulates several physiologic processes, including growth and metabolism.',3553473,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FOSL1 (FOS-like antigen 1, fra-1)','FOSL1 Protein','FOSL1 protein is a possible heterodimeric nuclear protein that lacks transactivation domains and belongs to the bZIP family.  Transcription of FOSL1 is induced in osteoclast differentiation by RANKL, in a FOS-dependent manner.  (from SWISS-PROT P15407, OMIM 136515, and NCI)',3553475,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ZEB2 (zinc finger homeobox 1b, zinc finger E-box binding homeobox 2, ZFHX1B, SMAD interacting protein 1, SIP1, SIP-1, KIAA0569)','ZEB2 Gene','This gene is involved in regulation of transcription.',3553722,'ACTIVE');
