INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PDE2A (phosphodiesterase 2A, cGMP-stimulated)','PDE2A protein, human','No Value Exists',3553728,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('11q23 translocation','Translocation 11q23','Movement from one place to another.: A chromosome band present on 11q',3554905,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Trisomy 8 (Trisomy of Chromosome 8)','Trisomy Chromosome 8','A chromosomal abnormality consisting of the presence of one chromosome in addition to the normal diploid number.: The designation for each member of the eighth largest human autosomal chromosome pair. Chromosome 8 spans about 145 million base pairs and represents between 4.5 and 5.0% of the total DNA in normal diploid cells.',3554906,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Androgen','Androgen','A type of hormone that promotes the development and maintenance of male sex characteristics.',3554908,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MSH6 (mutS homolog 6 (E. coli), mutS (E. coli) homolog 6, GTBP)','MSH6 Gene','This gene is involved in mismatch repair and plays a role in several cancers.',3554910,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PEA15 (phosphoprotein enriched in astrocytes 15, PED, PEA-15, MAT1H, MAT1, HUMMAT1H, homolog of mouse MAT-1 oncogene, HIMAT1, 15kD)','PEA15 Gene','This gene may play a role in signal transduction, sugar transport and protein localization.',3554912,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Adenovirus E1A','E1A Protein','Proteins transcribed from the E1A region of adenovirus which are involved in positive regulation of transcription of the early genes. (MSH2001)',3554914,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCL15 (small inducible cytokine subfamily A (Cys-Cys), member 15; SCYL3, SCYA15, NCC-5, MIP-5, MIP-1 delta, MIP-1d, macrophage inflammatory protein 5, Lkn-1, leukotactin 1, HMRP-2B, HCC-2, chemokine CC-2, chemokine (C-C motif) ligand 15, CC chemokine 3)','Small Inducible Cytokine A15','Widely expressed by human CCL15 Gene (Intercrine Beta Family), secreted 113-aa 12-kDa (precursor) Small Inducible Cytokine A15 is a chemotactic factor for T cells and monocytes that acts mainly via CCR1, induces intracellular calcium changes in monocytes, and induces N-acetyl-beta-D-glucosaminidase release in monocytes. CCL15 also binds to CCR3. (NCI)',3554916,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCL8 (A (Cys-Cys), member 8 (monocyte chemotactic protein 2) ; SCYA8, MCP-2, HC14, chemokine (C-C motif) ligand 8)','CCL8 protein, human','No Value Exists',3554918,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD1D (CD1d molecule; CD1D antigen, d polypeptide, CD1d antigen)','Antigens, CD1d','A major histocompatibily complex class I-like protein that plays a unique role in the presentation of lipid ANTIGENS to NATURAL KILLER T-CELLS.',3554920,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ICAM1 var','Genetic Variation Intercellular Adhesion Molecule 1','The phenotypic differences among individuals in a population: LFA-1 is a receptor for ICAM1, a surface molecule constitutively expressed on some tissues and induced on others in inflammation.  The interaction of LFA-1 with ICAM provides essential accessory adhesion signals in many immune interactions, including those between T- and B-lymphocytes and cytotoxic T-cells and their targets.',3559678,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FGFR4 var','Genetic Variation Fibroblast Growth Factor Receptor 4','The phenotypic differences among individuals in a population: Fibroblast growth factor receptor 4 (802 aa, 88 kD) is a cell communication process protein that is encoded by the human FGFR4 gene and has a role in the fibroblast growth factor receptor signaling pathway.',3559680,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ANG2 var','Genetic Variation Angiopoietin-2','The phenotypic differences among individuals in a population: Encoded by Human ANGPT2 Gene, Angiopoietin 2 is a 496-amino acid 57 kD (precursor) homodimeric secreted protein that contains a fibrinogen-like C-terminus.  ANG2 is nearly 60% identical to ANG1.  A 61 kD homodimeric alternative ANG2(443) product lacks 53 amino acids found in ANG2 encoded by exon B and part of the N-terminal coiled-coil domain.  Like ANG2 and ANG1, secreted ANG2(443) binds endothelial TIE2 receptor tyrosine kinase, but not TIE1.  ANG2(443) partially inhibits ANG2 and ANG1 binding to TIE2.  As an ANG1 and TIE2 antagonist, ANG2 may counteract blood vessel maturation or stability by loosening cell-matrix contacts and inducing endothelial apoptosis.  With VEGF, ANG2 may facilitate endothelial cell migration and proliferation.  In adults, ANGPT2 is only expressed at the sites of vascular remodeling.  (OMIM, Swiss-Prot, and NCI)',3559682,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('7q del (Deletion of Chromosome 7q)','Loss of Chromosome 7q','A cytogenetic abnormality that refers to deletion of part of the long arm of chromosome 7. It is associated with the development of chronic myelomonocytic leukemia with eosinophilia, refractory anemia with excess blasts, refractory anemia with multilineage dysplasia, and refractory anemia with multilineage dysplasia and ringed sideroblasts.',3559683,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD74 (MHC HLA-DR gamma chain, Ia-associated invariant chain, HLA-DR-gamma, gamma chain of class II antigens, DHLAG, CD74 molecule, major histocompatibility complex, class II invariant chain; CD74 antigen (invariant polypeptide of major histocompatibility)','HLA Class II Histocompatibility Antigen Gamma Chain','HLA class II histocompatibility antigen gamma chain (296 aa, ~34 kDa) is encoded by the human CD74 gene. This protein plays a role in MHC class II-dependent immunity.',3562946,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL-12p70','P70 protein, Xenopus Interleukin-12','No Value Exists: Exhibiting a broad range of biological activities on T and natural killer cells, Interleukin-12 is a disulfide-bonded heterodimeric cytokine composed of a 35-kD IL12A subunit (IL-6 Superfamily) and a 40-kDa IL12B subunit (Type I Cytokine Receptor 3 Family). IL12 stimulates T-cell-independent production of IFN-gamma by PBMCs, enhances NK cell lytic activity, acts as a growth factor for T- and NK-cells, and is important for Th1 and Th2 cell differentiation. Lymphocyte responses to IL12 require NOS2A and are mediated by STAT4 activator of transcription. (NCI)',3562948,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TEK (Tie2) var','Genetic Variation TEK gene','The phenotypic differences among individuals in a population: This gene plays a role in vascular development and angiogenesis.',3562949,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ang1 var','Genetic Variation Angiopoietin-1','The phenotypic differences among individuals in a population: Angiopoietin-1 (498 aa, ~58 kDa) is encoded by the human ANGPT1 gene. This protein is involved in both signal transduction and angiogenesis.',3562951,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('VCAM1 var','Genetic Variation Vascular Cell Adhesion Molecule 1 Measurement','The phenotypic differences among individuals in a population: The determination of the amount of vascular cell adhesion molecule 1 present in a sample.',3562953,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FGFR4 (fibroblast growth factor receptor 4, JTK2, CD334)','Fibroblast Growth Factor Receptor 4','Fibroblast growth factor receptor 4 (802 aa, 88 kD) is a cell communication process protein that is encoded by the human FGFR4 gene and has a role in the fibroblast growth factor receptor signaling pathway.',3562954,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Histone H1','Histone H1','Linker Histone H1 interacts with DNA between nucleosome units in mediating chromatin compaction into higher order structures. Histones are basic nuclear proteins responsible for the nucleosome structure of eukaryotic chromatin. Repeating nucleosome units contain two molecules each of core Histones H2A, H2B, H3, and H4 that form an octamer complex around which approximately 146 base pairs of DNA is wrapped. (NCI)',3564197,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SHBP (Sex Hormone Binding Protein)','Sex Hormone Binding Protein Measurement','The determination of the amount of sex hormone binding protein present in a sample.',3564199,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PRL (Prolactin)','Prolactin','Human prolactin (227 aa, 26 kDa precursor) is encoded by the human prolactin (PIT1) gene. This secreted lactogenic glycoprotein is expressed in both anterior pituitary lactotropes and the decidual endometrium. It acts primarily on the mammary gland and, in synergy with estrogen, induces progesterone release by corpus luteum cells to render the uterine mucosa suitable for implantation.',3564200,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Plasma/Lipid antioxidant status','Plasma Lipid Antioxidant','Plasma is the fluid (noncellular) portion of the circulating blood, as distinguished from the serum that is the fluid portion of the blood obtained by removal of the fibrin clot and blood cells after coagulation.: Lipids are fatty acid esters, an oily organic compound insoluble in water but soluble in organic solvents.: A group of organic or inorganic substances capable of preventing the genotoxic and carcinogenic effects of free-radical compounds.  Antioxidants bind to and neutralize (scavenge) free radicals, thereby transforming them into non-toxic compounds and blocking their genotoxic and carcinogenic effects.  This class of agents includes the vitamins C and E, the carotenoids, and selenium.  Organic antioxidants are found in high concentrations in fruits, seeds and vegetables. (NCI04)',3564201,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LDL/VLDL-C Oxidation','Low Density Lipoprotein Serum VLDL Cholesterol Measurement Oxidation','Low-density lipoprotein (LDL) is a lipoprotein that carries cholesterol around the body, for use by various cells.  LDL transports cholesterol to the arteries and increased levels are associated with atherosclerosis, and thus myocardial infarctions and strokes. This is why cholesterol inside LDL lipoproteins is called bad cholesterol. (from Wikipedia): A measurement of the very low density lipoprotein cholesterol in a biological specimen.: A chemical reaction that takes place when a substance comes into contact with oxygen or another oxidizing substance. Examples of oxidation are rust and the brown color on a cut apple.',3564204,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Alpha Tubulin','alpha Tubulin','No Value Exists',3564206,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FCGR3A var','Genetic Variation FCGR3A gene','The phenotypic differences among individuals in a population: This gene plays a role in the mediation of antibody-dependent cytotoxicity and phagocytosis.',3564207,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FCGR2A var','Genetic Variation IgG Fc Receptor IIA','The phenotypic differences among individuals in a population: Expressed in monocytes, macrophages, neutrophils, eosinophils, platelets, NK cells, and T- and B-lymphocytes by human FCGR2A Gene, 281-aa (mature) IgG Fc Receptor IIA is a type I cell surface membrane protein with 2 extracellular IgC2 domains and a low affinity receptor for aggregated IgG Fc region. FCGR2A binding to IgG initiates essential effector and regulatory cellular responses against foreign pathogens and soluble antigens that induce phagocytosis of antigen-antibody complexes, removing them from circulation, and modulate B-cell antibody production. An Arg167His polymorphism affects efficiency of IgG2 recognition. (NCI)',3564208,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cytochrome C','Cytochrome','Hemeproteins whose characteristic mode of action involves transfer of reducing equivalents associated with a reversible change in oxidation state of the prosthetic group. Formally, this redox change involves a single-electron, reversible equilibrium between the Fe(II) and Fe(III) states of the central iron atom. (From Enzyme Nomenclature, 1992, p539)',3564209,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cytochrome p450 var','Genetic Variation Cytochrome P450','The phenotypic differences among individuals in a population: Cytochrome P450. Isozymes which are key components of the mixed-function oxidase system responsible for the biotransformation of many foreign compounds to mutagens and carcinogens. Most mammals have several distantly related phenobarbital-inducible gene subfamilies. EC 1.13.-. (from MSH98)',3564211,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ROS1 (v-ros avian UR2 sarcoma virus oncogene homolog 1, v-ros UR2 sarcoma virus oncogene homolog 1 (avian); ROS, MCF3; c-ros oncogene 1 , receptor tyrosine kinase; c-ros-1)','c-Ros Tyrosine Kinase','A type I membrane protein, c-ROS tyrosine kinase is probably a cell growth- or differentiation factor receptor that belongs to the insulin receptor family, sevenless subfamily.  (from Swiss-Prot P08922 and NCI)',3564213,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('C1Q var (Complement C1q variant)','Genetic Variation Complement C1q','The phenotypic differences among individuals in a population: A subcomponent of complement C1, composed of six copies of three polypeptide chains (A, B, and C), each encoded by a separate gene (C1QA; C1QB; C1QC). This complex is arranged in nine subunits (six disulfide-linked dimers of A and B, and three disulfide-linked homodimers of C). C1q has binding sites for antibodies (the heavy chain of IMMUNOGLOBULIN G or IMMUNOGLOBULIN M). The interaction of C1q and immunoglobulin activates the two proenzymes COMPLEMENT C1R and COMPLEMENT C1S, thus initiating the cascade of COMPLEMENT ACTIVATION via the CLASSICAL COMPLEMENT PATHWAY.',3566844,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CR3 var (Complement component 3 Receptor variant)','Receptor Genetic Variation Complement Component 3','A receptor is a protein located on the cell surface, or in the cytoplasm, that binds to a specific signaling factor, such as a hormone, antigen, or neurotransmitter, causing a conformational and functional change in the receptor molecule.  The ligand-bound receptor then alters its interaction with target molecules, which leads to changes in cellular physiology through modification of the activity of one or more signal transduction pathways.: The phenotypic differences among individuals in a population: Complement Component 3, encoded by the C3 gene plays a central role in the activation of complement system. Its activation is required for both classical and alternative complement activation pathways. People with C3 deficiency are susceptible to bacteria infection. (From LocusLink)',3566845,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ab3 induction','Antibody Integer::3 Induction','(AN-tih-BOD-ee) A type of protein made by certain white blood cells in response to a foreign substance (antigen). Each antibody can bind to only a specific antigen. The purpose of this binding is to help destroy the antigen. Antibodies can work in several ways, depending on the nature of the antigen. Some antibodies destroy antigens directly. Others make it easier for white blood cells to destroy the antigen.: A number with no fractional part, including the negative and positive numbers as well as zero.::3: The act of bringing about something.',3566846,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ab3- induction','Antibody Integer::3 Oligonucleotide Primer Induction','(AN-tih-BOD-ee) A type of protein made by certain white blood cells in response to a foreign substance (antigen). Each antibody can bind to only a specific antigen. The purpose of this binding is to help destroy the antigen. Antibodies can work in several ways, depending on the nature of the antigen. Some antibodies destroy antigens directly. Others make it easier for white blood cells to destroy the antigen.: A number with no fractional part, including the negative and positive numbers as well as zero.::3: Short DNA oligonucleotide chains used to prime DNA (and in some cases RNA) synthesis.: The act of bringing about something.',3566847,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FGF9 (fibroblast growth factor 9 (glia-activating factor))','Fibroblast Growth Factor 9','Expressed in glia and neurons by human FGF9 Gene (FGF family), 208-aa 23-kDa (precursor) N-glycosylated monomeric secreted Fibroblast Growth Factor 9 has glial growth-stimulating effects and is likely involved in glial cell growth and differentiation, gliosis, and differentiation or survival of neuronal cells. Three molecular species of 30-kDa, 29-kDa and 25-kDa, cleaved at Leu-4, Val-13 and Ser-34 respectively, are found. Expression may be dependent on Sonic hedgehog signaling. (NCI)',3566849,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ODC1 (ornithine decarboxylase 1, ODC)','Ornithine Decarboxylase 1','Expressed most at G1/S and G2/M by human ODC1 Gene (Orn/Lys/Arg Decarboxylase Class-II Family), 461-aa 51-kDa Ornithine Decarboxylase 1 is a homodimeric rate-limiting enzyme with high turnover rate and pyridoxal phosphate cofactor that catalyzes conversion of ornithine to putrescine in the first step of the polyamine biosynthesis pathway. ODC promoter activity is influenced by cooperative E-box interactions, a cap-independent IRES in the mRNA functions at G2/M to ensure adequate polyamine levels, and enzyme activity fluctuates in response to growth-promoting stimuli. (NCI)',3566851,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('M6PR (mannose-6-phosphate receptor (cation dependent)','Insulin-Like Growth Factor 2 Receptor','IGF2R is a 250kDa transmembrane protein. It was originally identified as a receptor for IGFII and M6P-containing proteins (e.g. lysosomal hydrolases). Lysosomal enzymes are sorted to lysosomes via IGF2R either from the Golgi, where the enzymes acquire M6P, or from the extracellular space. The majority of IGF2R molecules are located intracellularly, only 5-10% is present on the cell membrane. IGF2R is also a receptor for TGFbeta latency associated peptide (LAP), proliferin and may bind several molecules independently of M6P, including plasminogen, CD87 or retinoic acid. It is involved in activation of latent TGFbeta.  It is a putative hepatocellular tumor suppressor. (from LocusLink)',3566852,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCL26 (small inducible cytokine subfamily A (Cys-Cys), member 26; TSC-1, thymic stroma chemokine-1, small inducible cytokine A26, SCYA26, MIP-4alpha, MIP-4a, IMAC, eotaxin-3, chemokine N1, chemokine (C-C motif) ligand 26)','Small Inducible Cytokine A26','Ubiquitously expressed by human CCL26 Gene (Intercrine Beta Family), secreted monomeric immunoregulatory 94-aa 11-kD (precursor) Small Inducible Cytokine A26 is an activator of receptor CCR3 and chemotactic for eosinophils and basophils in inflammatory processes. CCL26 may contribute to eosinophil accumulation in atopic diseases. (NCI)',3566908,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CCL24 (small inducible cytokine subfamily A (Cys-Cys), member 24; SCYA24, myeloid progenitor inhibitory factor 2, MPIF2, MPIF-2, eotaxin-2, Ckb-6, CK-beta-6, chemokine (C-C motif) ligand 24)','Small Inducible Cytokine A24','Expressed in activated monocytes and activated T lymphocytes by human CCL24 Gene (Intercrine Beta Family), N-glycosylated secreted immunoregulatory Small Inducible Cytokine A24 binds to CCR3, exerts chemotactic activity on resting T lymphocytes, neutrophils, and eosinophils in inflammatory processes, and exhibits strong suppression of hematopoietic progenitor colony formation. (NCI)',3566910,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('T3 (Triiodothyronine)','Triiodothyronine','A thyroid hormone containing 3 iodine atoms generally synthesized from levothyroxine, and has greater biological activity.',3574913,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TNF-gamma (Tumor Necrosis Factor-gamma)','Gamma Recombinant Tumor Necrosis Factor Family Protein','A unit of magnetic flux density equal to 10(E-9) tesla (one nanotesla) or 10(E-5) oersted, traditionally used in geophysics for measurement of changes in the Earths magnetic field.: A recombinant therapeutic agent which is chemically identical to or similar to one of a number of endogenous tumor necrosis factor (TNF) proteins. TNF family cytokines bind to and activate specific cell-surface receptors, thereby mediating inflammatory processes, cell proliferation, immunity, angiogenesis, and tumor cell cytotoxicity. One primary antitumor effect of TNFs involves stimulation of T cell-mediated antitumor cytotoxicity.',3574915,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Isoflavones','Isoflavone','A class of polyphenolic compounds derived from the Fabaceae family with potential phytoestrogenic, cholesterol-reducing, chemotherapeutic and antioxidant activity. In isoflavones the phenyl group on the benzopyran ring is in position 3 relative to the oxygen of the ring. Most isoflavones for human consumption and that are currently studied are derived from soy beans.',3574917,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EIF2S1 (eukaryotic translation initiation factor 2, subunit 1 alpha, 35kDa; EIF2A, EIF2, EIF-2alpha)','EIF2S1 gene','No Value Exists',3574919,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PKCA var','Genetic Variation Protein Kinase C-Alpha','The phenotypic differences among individuals in a population: Encoded by human PRKCA Gene (PKC Family), 672-aa 77-kDa Protein Kinase C-alpha is a calcium-activated (likely by the C2 domain), DAG-activated, phospholipid-dependent serine/threonine kinase containing 2 zinc-dependent phorbol-ester/DAG binding domains and a C2 domain that phosphorylates a range of cellular proteins. DAG markedly increases PKC sensitivity to calcium and phospholipids. PKC activation appears to be central in the induction of cellular responses to many ligand-receptor systems and to external stimuli. After GPCR stimulation, and triggered by PKC-dependent serine phosphorylation, RKIP dissociates from RAF1 to associate with and block GRK2 activity. By activating PKC, the receptor signal may be enhanced by removing a RAF1 inhibitor and blocking receptor internalization. A receptor for phorbol ester tumor promoters, PKC may interact with PRKCABP. (NCI)',3574920,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SRC var','Genetic Variation SRC Gene','The phenotypic differences among individuals in a population: This gene is involved in apoptosis, hormonogenesis, focal adhesion and the formation of intercellular junctions.',3574921,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('P53 var','Genetic Variation Tumor Protein p53','The phenotypic differences among individuals in a population: A homo-tetrameric, DNA-binding, trans-activator of genes involved in cell division. p53 induces growth arrest or apoptosis and is mutated or inactivated in about 60% of cancers. JNK-p53 and mdm2-p53 complexes regulate ubiquitination and degradation of p53. (from SWISS-PROT P04637, OMIM 191170, and NCI)',3574923,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KRAS2 var','Genetic Variation Oncogene K-Ras','The phenotypic differences among individuals in a population: Human Oncogene K-Ras is a mutated variant of KRAS2 Gene, which encodes two alternative isoforms of monomeric p21 K-RAS protein, a monomeric GTPase involved in transmembrane signal transduction that alternates between inactive GDP-bound and active GTP-bound forms. K-Ras is activated by a guanine nucleotide-exchange factor and inactivated by a GTPase-activating protein. Mitogen-stimulated RAS stabilizes MYC protein and enhances MYC accumulation by the RAS/RAF/MAPK pathway, which appears to inhibit the proteasome-dependent degradation of MYC. Implicated in a variety of human tumors, mutations of specific amino acids activate RAS to transform cells. KRAS is involved in malignancy much more often than is HRAS. Oncogene K-Ras disrupts normal cell function.',3574924,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CHK2 var','Genetic Variation CHEK2 Gene','The phenotypic differences among individuals in a population: This gene plays a role in cell survival and the negative regulation of cell growth.',3574926,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FCR3a','IgG Fc Receptor IIIA','Expressed on natural killer cells, macrophages, T cells, immature thymocytes, and trophoblasts by human FCGR3A Gene, 254-aa 29-kDa (precursor) glycosylated IgG Fc Receptor IIIA is a putative type I membrane protein containing 2 IgC2 domains and a receptor for the Fc region of monomeric or aggregated IgG that mediates antibody-dependent responses, such as phagocytosis and antibody-dependent cellular cytotoxicity. FCGR3B exists in a hetero-oligomeric complex with the Fc epsilon receptor I gamma subunit and/or the CD3 zeta subunit, as a soluble receptor produced by proteolytic cleavage. Amino acid conservation between CD16, other Fc receptors, and related Ig suggest similar structures and modes of association. (NCI)',3574927,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Protein Kinase A (PKA)','Protein Kinase A','Most cellular effects of cAMP are mediated through PKA by serine or threonine phosphorylation of target proteins. Human Protein Kinase A (cAMP Ser/Thr Protein Kinase Family) is an inactive tetrameric cytoplasmic holoenzyme composed of homo- or heterodimeric regulatory subunits associated with two catalytic subunits. cAMP causes dissociation of inactive holoenzyme into a cAMP-bound dimer of regulatory subunits and two free monomeric catalytic subunits that phosphorylate many cytoplasmic and nuclear substrates. In human, regulatory PRKAR1A, PRKAR1B, PRKAR2A, and PRKAR2B subunits and catalytic PRKACA, PRKACB, and PRKACG subunits have been identified. (NCI)',3574929,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NPM/ALK fusion t(2;5)','NPM1/ALK Fusion Protein','A fusion protein (680 aa, ~75 kDa) that is encoded by the NPM1/ALK fusion gene. This protein contains the N-terminal domain from the nucleophosmin protein and the cytoplasmic domain of the ALK tyrosine kinase receptor protein.',3574931,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Lymphokine-Activated Killer (LAK) cell functionality','Lymphokine-Activated Killer Cells Function','Killer cell lymphocytes activated in the presence of interleukin-2 (IL-2).  Lymphokine-activated killer cells (LAKs) are cytotoxic effector cells with an exceptionally wide target cell spectrum including normal and malignant cells of different origins.  LAK cells exhibit a profound heterogeneity with regard to phenotype surface marker expression; it remains to be determined if they represent a unique cell lineage.: Function; what something is used for.',3574932,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Fit-3L','Recombinant Flt3 Ligand','A recombinant therapeutic agent which is chemically identical to or similar to the endogenous cytokine Flt3. Flt3 ligand binds to the Flt3 tyrosine kinase receptor and, synergistically with other growth factors, stimulates the proliferation and mobilization of bone marrow precursor cells, including CD34+ cells, and dendritic cells. When proteolytically cleaved, the transmembrane isoform of Flt3 ligand generates the soluble form soluble Flt3 ligand, which is also biologically active.',3574934,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CEP55 (centrosomal protein 55kDa, CT111, FLJ10540, C10orf3)','Cep55 protein, human','No Value Exists',3578430,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CDC20 (cell division cycle 20 homolog (S. cerevisiae), p55CDC, CDC20A)','CDC20 protein, human','No Value Exists',3578432,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('UBE2E','UBE2E Family','UBE2E Family',3578433,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CENPF (centromere protein F, 350/400kDa (mitosin); hcp-1)','Centromere Protein F','Centromere protein F (3210 aa, ~368 kDa) is encoded by the human CENPF gene. This protein plays a role in cell cycle progression and is required for both kinetochore formation and chromosome segregation during mitosis.',3578435,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MYBL2 (v-myb myeloblastosis viral oncogene homolog (avian)-like 2, BMYB, B-MYB)','MYBL2 Gene','This gene plays a regulatory role in cell cycle progression.',3578437,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ANLN (anillin, actin binding protein; ANILLIN, scra, Scraps)','ANLN gene','No Value Exists',3578439,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KIF2C (kinesin family member 2C, KNSL6, MCAK)','KIF2C protein, human','No Value Exists',3578441,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Choline','Choline','Water-soluble vitamin that is a precursor for acetylcholine, phospholipids, and the methyl donor betaine. (DRI)',3585952,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PFKM (phosphofructokinase, muscle; PFKX, PFK-1)','PFKM protein, human','No Value Exists',3585954,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TDP1 (tyrosyl-DNA phosphodiesterase 1, SCAN1, FLJ11090)','TDP1 protein, human','No Value Exists',3585956,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IGFBP5 (insulin-like growth factor binding protein 5)','IGFBP5 gene','This gene plays a role in the intracellular transport of insulin-like growth factor moieties.',3585957,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HSPB1 (heat shock 27kDa protein 1, Hs.76067, Hsp25, HSP27, HSP28)','Heat Shock 27 kD Protein 1','Heat-shock proteins belong to a large group stress proteins, induced in response to environmental challenges and developmental transitions.  Involved in stress resistance and actin organization, synthesis of HSP27 is correlated with the acquisition of thermotolerance.  HSP27 belongs to the HSP20 family and shows sequence similarity to alpha-crystallins.  Cytoplasmic HSP27 associates with alpha- and beta-tubulin, and with interphase and mitotic microtubules.  HSP27 translocates to the nucleus during heat shock and is phosphorylated on exposure to PKC activators and heat shock.  (from OMIM 602195, Swiss-Prot P04792, and NCI)',3586750,'ACTIVE');
