INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HPRT1 (hypoxanthine phosphoribosyltransferase 1, HPRT, HGPRT)','Hypoxanthine Phosphoribosyltransferase 1','Encoded by human HPRT1 Gene (Purine/Pyrimidine Phosphoribosyltransferase Family), 217-aa 24-kDa homotetrameric cytoplasmic Hypoxanthine Phosphoribosyltransferase 1 is involved in purine salvage. HPRT1 defects cause Lesch-Nyhan syndrome or gout. (NCI)',3589747,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Methylcytosine','5-Methylcytosine','A methylated nucleotide base found in eukaryotic DNA. In ANIMALS, the DNA METHYLATION of CYTOSINE to form 5-methylcytosine is found primarily in the palindromic sequence CpG. In PLANTS, the methylated sequence is CpNpGp, where N can be any base.',3589749,'ACTIVE');
