INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SMC1A (structural maintenance of chromosomes 1A, Smcb, SMC1L1, SB1.8, KIAA0178, DXS423E)','Structural Maintenance of Chromosomes Protein 1A','Structural maintenance of chromosomes protein 1A (1233 aa, ~143 kDa) is a cell cycle protein that is encoded by the human SMC1A gene and plays a role in mitotic chromatid cohesion.',3589757,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RUNX1 (runt-related transcription factor 1, PEBP2A2, CBFA2, AMLCR1, AML1)','Runt-Related Transcription Factor 1','Runt-related transcription factor 1 (453 aa, ~49 kDa) is encoded by the human RUNX1 gene. This protein is involved in the promotion of gene transcription and hematopoiesis.',3589759,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HPV E6 Antibody (Human Papillomavirus Protein E6 Antibody)','Protein E6, Human Papillomavirus Type 16 Antibody','Protein E6 (158 aa, ~19 kDa) is encoded by the human papillomavirus type 16 E6 gene. This protein is involved in both transcriptional activation and degradation of cellular tumor antigen p53.: (AN-tih-BOD-ee) A type of protein made by certain white blood cells in response to a foreign substance (antigen). Each antibody can bind to only a specific antigen. The purpose of this binding is to help destroy the antigen. Antibodies can work in several ways, depending on the nature of the antigen. Some antibodies destroy antigens directly. Others make it easier for white blood cells to destroy the antigen.',3589769,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HPV E7 Antibody (Human Papillomavirus Protein E7 Antibody)','Protein E7, Human Papillomavirus Type 16 Antibody','Protein E7 (98 aa, ~11 kDa) is encoded by the human papillomavirus type 16 E7 gene. This protein is involved in the modulation of the activity of both retinoblastoma protein and histone deacetylases in the infected host cell, which is associated with viral genome replication and host cell transformation.: (AN-tih-BOD-ee) A type of protein made by certain white blood cells in response to a foreign substance (antigen). Each antibody can bind to only a specific antigen. The purpose of this binding is to help destroy the antigen. Antibodies can work in several ways, depending on the nature of the antigen. Some antibodies destroy antigens directly. Others make it easier for white blood cells to destroy the antigen.',3589771,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BRAF V600G Mutation (BRAF NP_004324.2:p.V600G)','BRAF NP_004324.2:p.V600G','A change in the amino acid residue at position 600 in the serine/threonine protein kinase B-raf protein where valine has been replaced by glycine.',3589868,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BRAF V600R Mutation (BRAF NP_004324.2:p.V600R)','BRAF NP_004324.2:p.V600R','A change in the amino acid residue at position 600 in the serine/threonine protein kinase B-raf protein where valine has been replaced by arginine.',3589870,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HPV E7 (Human papillomavirus E7 protein)','Protein E7, Human Papillomavirus Type 16','Protein E7 (98 aa, ~11 kDa) is encoded by the human papillomavirus type 16 E7 gene. This protein is involved in the modulation of the activity of both retinoblastoma protein and histone deacetylases in the infected host cell, which is associated with viral genome replication and host cell transformation.',3589871,'ACTIVE');
