INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CAM 5.2','Cytokeratin 8 Antibody','A type II keratin found associated with KERATIN-18 in simple, or predominately single layered, internal epithelia.: (AN-tih-BOD-ee) A type of protein made by certain white blood cells in response to a foreign substance (antigen). Each antibody can bind to only a specific antigen. The purpose of this binding is to help destroy the antigen. Antibodies can work in several ways, depending on the nature of the antigen. Some antibodies destroy antigens directly. Others make it easier for white blood cells to destroy the antigen.',3604241,'ACTIVE');
