INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GP1BA (glycoprotein Ib (platelet), alpha polypeptide; CD42b, GP1B)','GP1BA gene','No Value Exists',3606587,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PF4 (platelet factor 4, SCYB4, CXCL4)','Platelet Factor 4','Platelet factor-4 is a 70-amino acid CXC chemokine. It is released from the alpha-granules of activated platelets and binds with high affinity to heparin. Its major physiologic role appears to be neutralization of heparin-like molecules on the endothelial surface of blood vessels, thereby inhibiting local antithrombin III activity and promoting coagulation. As a strong chemoattractant for neutrophils and fibroblasts, PF4 probably has a role in inflammation and wound repair. (from OMIM)',3606589,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CTSB (Cathepsin B)','Cathepsin B','Cathepsin B (339 aa, ~38 kDa) is encoded by the human CTSB gene. This protein plays a role in proteolysis, immunity and the regulation of apoptosis.',3606591,'ACTIVE');
