INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FIP1L1/PDGFRA Fusion','FIP1L1/PDGFRA Fusion Gene','A fusion gene (~2.6 kb) that results from a chromosomal deletion del(4)(q12q12) which fuses the 5 half of the FIP1L1 gene to the 3 part of the PDGFRA gene. This rearrangement is associated with myeloproliferative disorders.',3606698,'ACTIVE');
