INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PAX8/PPAR gamma fusion mutation','PAX8/PPARG Fusion Gene Mutation Abnormality','A fusion gene that results from a chromosomal translocation t(2;3)(q13;p25) which fuses exon 7, 8 or 9 of the PAX8 gene with exons 1-6 of the PPARG gene. This rearrangement is associated with both thyroid follicular adenoma and thyroid follicular carcinoma.: A general term referring to single or multiple alterations in the genetic material of an organism that ranges from a single base change in a gene to the loss or addition of complete chromosomes. A mutation abnormality may be heritable or occur somatically.',3606702,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Anti-Asparaginase Antibody','Asparaginase Antibody','An enzyme isolated from the bacterium Escherichia coli or the bacterium Erwinia carotovora with antileukemic activity. Asparaginase hydrolyzes L-asparagine to L-aspartic acid and ammonia in leukemic cells, resulting in the depletion of asparagine, inhibition of protein synthesis, cell cycle arrest in the G1 phase, and apoptosis in susceptible leukemic cell populations. Asparagine is critical to protein synthesis in leukemic cells; some leukemic cells cannot synthesize this amino acid de novo due to the absent or deficient expression of the enzyme asparagine synthase. The E. carotovora-derived form of asparaginase is typically reserved for cases of asparaginase hypersensitivity.: (AN-tih-BOD-ee) A type of protein made by certain white blood cells in response to a foreign substance (antigen). Each antibody can bind to only a specific antigen. The purpose of this binding is to help destroy the antigen. Antibodies can work in several ways, depending on the nature of the antigen. Some antibodies destroy antigens directly. Others make it easier for white blood cells to destroy the antigen.',3606703,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Asparaginase Activity','Asparaginase Activity','An enzyme isolated from the bacterium Escherichia coli or the bacterium Erwinia carotovora with antileukemic activity. Asparaginase hydrolyzes L-asparagine to L-aspartic acid and ammonia in leukemic cells, resulting in the depletion of asparagine, inhibition of protein synthesis, cell cycle arrest in the G1 phase, and apoptosis in susceptible leukemic cell populations. Asparagine is critical to protein synthesis in leukemic cells; some leukemic cells cannot synthesize this amino acid de novo due to the absent or deficient expression of the enzyme asparagine synthase. The E. carotovora-derived form of asparaginase is typically reserved for cases of asparaginase hypersensitivity.: An active process; excludes processes and mechanisms which fulfill biological functions.',3606704,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Hypermethylation Status','Hypermethylation Status','Hypermethylation appears to be a controlled, epigenetic, heritable, and aberrant DNA methylation reaction on gene promoter regions and CpG islands associated with loss of (e.g., tumor-suppressor) gene function in diverse cellular pathways through transcriptional silencing by the formation of transcriptionally repressive chromatin.: A condition or state at a particular time.',3606706,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MLL-AF9 fusion mutation','MLL-AF9 Fusion Protein Expression Mutation Abnormality','Expression of a fusion protein that results from a t(9;11)(p22;q23) translocation, which involves the human genes MLL and MLLT3 and is associated with many leukemias.,A general term referring to single or multiple alterations in the genetic material of an organism that ranges from a single base change in a gene to the loss or addition of complete chromosomes. A mutation abnormality may be heritable or occur somatically.','3606707','ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EGFR var','Genetic Variation Epidermal Growth Factor Receptor','The phenotypic differences among individuals in a population: Epidermal growth factor receptor. The protein found on the surface of some cells and to which epidermal growth factor binds, causing the cells to divide. It is found at abnormally high levels on the surface of many types of cancer cells, so these cells may divide excessively in the presence of epidermal growth factor.',3606708,'ACTIVE');
