INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DDC (dopa decarboxylase (aromatic L-amino acid decarboxylase, AADC)','DOPA decarboxylase','One of the AROMATIC-L-AMINO-ACID DECARBOXYLASES, this enzyme is responsible for the conversion of dopa to dopamine. It is of clinical importance in the treatment of Parkinsons disease. EC 4.1.1.28.',3613650,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BCR/ABL fusion mutation','Mutation Abnormality BCR/ABL1 Fusion Gene','A general term referring to single or multiple alterations in the genetic material of an organism that ranges from a single base change in a gene to the loss or addition of complete chromosomes. A mutation abnormality may be heritable or occur somatically.: A fusion gene that results from a translocation t(9;22)(q34;q11) that fuses the 5part of the BCR gene to the 5side of exon 2 of the ABL1 gene. There are 3 potential products that are formed depending on which BCR exon has the breakpoint. All of the protein products have constitutively active tyrosine kinase activity. This fusion is associated with both chronic myeloid leukemia and acute lymphoblastic leukemia.',3613652,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NK cell functionality','Natural Killer Cell Function','White blood cells that attack tumor cells and body cells that have been invaded by foreign substances.: Function; what something is used for.',3613653,'ACTIVE');
