INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Langerhans Cells','Langerhans Cell','Dendritic clear cells in the epidermis, containing distinctive granules that appear rod- or racket-shaped in section, but lacking tonofilaments, melanosomes, and desmosomes; they carry surface receptors for immunoglobulin (Fc) and complement (C3), and are believed to be antigen fixing and processing cells of monocytic origin; active participants in cutaneous delayed hypersensitivity.',3613657,'ACTIVE');
