INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Anti-pp65 Antibody','Cytomegalovirus pp65-Specific Cytotoxic T Lymphocytes Antibody','Cytotoxic T lymphocytes (CTLs) specifically reactive to the cytomegalovirus (CMV) phosphoprotein pp65 with potential antiviral activity. To prepare CMV pp65-specific cytotoxic T lymphocytes in vitro, dendritic cells (DCs) are pulsed with CMV pp65 epitopes and then used to stimulate and propagate CMV pp65-specific cytotoxic T lymphocytes from peripheral blood mononuclear cells (PBMNCs); the CMV pp65-specific cytotoxic T lymphocyte population is then expanded so as to be sufficient for use in adoptive T lymphocyte therapy. When administered into a patient post-allogeneic hematopoietic stem cell transplantation, this agent may elicit a specific CTL response against CMV-infected host cells, which may result in the resolution of CMV infection. The CMV pp65 protein (65 kDa lower matrix phosphoprotein), the primary component of the enveloped subviral particle, is an immunodominant target for helper and cytotoxic T lymphocyte responses to CMV.: (AN-tih-BOD-ee) A type of protein made by certain white blood cells in response to a foreign substance (antigen). Each antibody can bind to only a specific antigen. The purpose of this binding is to help destroy the antigen. Antibodies can work in several ways, depending on the nature of the antigen. Some antibodies destroy antigens directly. Others make it easier for white blood cells to destroy the antigen.',3622854,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('C1S2 (Chromosome 1 Satellite 2)','Chromosome 1 Satellite 2','Chromosome 1 Satellite 2',3622855,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LINE (Long Interspersed Nucleotide Elements)','Long Interspersed Nucleotide Elements','Highly repeated sequences, 6K-8K base pairs in length, which contain RNA polymerase II promoters. They also have an open reading frame that is related to the reverse transcriptase of retroviruses but they do not contain LTRs (long terminal repeats). Copies of the LINE 1 (L1) family form about 15% of the human genome. The jockey elements of Drosophila are LINEs.',3622857,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Alu Elements','Alu Elements','The Alu sequence family (named for the restriction endonuclease cleavage enzyme Alu I) is the most highly repeated interspersed repeat element in humans (over a million copies). It is derived from the 7SL RNA component of the SIGNAL RECOGNITION PARTICLE and contains an RNA polymerase III promoter. Transposition of this element into coding and regulatory regions of genes is responsible for many heritable diseases.',3622859,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CHI3L1 (chitinase 3-like 1 (cartilage glycoprotein-39), GP39, YKL40)','CHI3L1 protein, human','No Value Exists',3622861,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL2RG (interleukin 2 receptor, gamma; SCIDX1, IMD4, CIDX, CD132)','Interleukin 2 Receptor Gamma','The interleukin 2 (IL2) receptor gamma chain (IL2RG) is an important signalling component of many interleukin receptors (e.g., IL2,IL4,IL7,IL9, and IL15) and is thus referred to as the common gamma chain. It is necessary for normal growth and differentiation of T cells, B cells, natural killer cells, glioma cells, and cells of the monocyte lineage.  Mutations in this X-chromosome-linked gene cause X-linked severe combined immunodeficiency (XSCID). (from LocusLink and OMIM)',3622863,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Uric Acid','Uric Acid','A white tasteless odorless crystalline product of protein metabolism, found in the blood and urine, as well as trace amounts found in the various organs of the body. It can build up and form stones or crystals in various disease states',3622864,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Aldosterone','Aldosterone','A hormone secreted by the adrenal cortex that regulates electrolyte and water balance by increasing the renal retention of sodium and the excretion of potassium. (MeSH)',3622866,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Corticosterone','Corticosterone','An adrenocortical steroid that has modest but significant activities as a mineralocorticoid and a glucocorticoid. (From Goodman and Gilmans The Pharmacological Basis of Therapeutics, 8th ed, p1437)',3622868,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CDKN2B (cyclin-dependent kinase inhibitor 2B (p15, inhibits CDK4), CDK4I, INK4B, MTS2, P15, p15INK4b, TP15)','CDKN2B protein, human','No Value Exists',3624080,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HIP1 (huntingtin interacting protein 1, ILWEQ)','Huntingtin-Interacting Protein 1','Huntingtin-interacting protein 1 (1037 aa, ~116 kDa) is encoded by the human HIP1 gene. This protein plays a role in both clathrin-coat assembly and endocytosis.',3624082,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MBL2 (mannose-binding lectin (protein C) 2, soluble; MBL, COLEC1)','MBL2 Gene','This gene is involved in the complement immune response pathway.',3624084,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DCTD (dCMP deaminase)','Deoxycytidylate Deaminase','Deoxycytidylate deaminase (178 aa, ~20 kDa) is encoded by the human DCTD gene. This protein plays a role in the conversion of deoxycytidine to deoxyuridine.',3624086,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PRLR (prolactin receptor)','Prolactin Receptor','The Prolactin Receptor binds prolactin, initiating the cellular response to the hormone.  The receptor is found in breast, placenta, liver, testes, kidneys, ovaries, and other organs.  The prolactin receptor is homologous to members of the cytokine receptor superfamily, such as GHR, IL2R, IL3R, IL4R, IL6R, IL7R, EPOR, and GMCSFR.  PRLR isoforms differ in the length of their cytoplasmic domains.  The short form acts as a dominant-negative inhibitor, forming inactive heterodimers that inhibit Janus kinase 2 activation.  (from OMIM 176761 and NCI)',3624088,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ACPP (acid phosphatase, prostate; ACP-3, ACP3)','Prostatic Acid Phosphatase','Prostatic acid phosphatase precursor catalyzes the conversion of orthophosphoric monoester to alcohol and orthophosphate. ACPP is synthesized under androgen regulation and secreted by the epithelial cells of the prostrate gland. (from LocusLink)',3624090,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('UGT1A1 var','Genetic Variation UGT1A1 Gene','The phenotypic differences among individuals in a population: This gene is involved in controlling serum levels of bilirubin and in glucuronidation.',3624629,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CYP3A5 var','Genetic Variation CYP3A5 Gene','The phenotypic differences among individuals in a population: This gene is involved in the metabolism of fatty acids, steroids, drugs and xenobiotics. It also plays a role in the metabolism of sex hormones.',3624631,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ABCG2 var','Genetic Variation ATP-Binding Cassette, Sub-Family G, Member 2','The phenotypic differences among individuals in a population: Human ATP binding cassette transporter-G2 protein (2436 aa, ~270 kDa) is encoded by the human ABCG2 gene. This integral membrane protein plays a role in transport and is associated with drug resistance in tumor cell lines.',3624633,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ABCB1 var','Genetic Variation ABCB1 Gene','The phenotypic differences among individuals in a population: This gene plays a role in multi-drug resistance and is involved in blood-brain barrier transport.',3624634,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NOTCH3 (CADASIL, CASIL, notch 3)','NOTCH3 protein, human','No Value Exists',3624636,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NOTCH2 (notch 2)','Neurogenic Locus Notch Homolog Protein 2','Neurogenic locus notch homolog protein 2 (2471 aa, ~265 kDa) is encoded by the human NOTCH2 gene. This protein plays a role in intercellular communication.',3624638,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NOTCH1 (notch 1, TAN1)','Notch Homolog 1','Expressed in adult/fetal tissues by human NOTCH1 Gene (Notch Family), 2556-aa 273-kDa phosphorylated type 1 transmembrane Notch Homolog 1 contains 36 extracellular EGF domains, 3 Lin/Notch repeats, and multiple intracellular domains, including 5 ANK repeats. Cleaved by a Golgi furin-like convertase, cell surface Notch protein is a disulfide linked N-/C-terminal heterodimeric receptor for membrane-bound Jagged1, Jagged2, Delta1, and Serrate on adjacent cells that activates an conserved intercellular signaling pathway (lateral inhibition) to regulate cell-fate determination, differentiation, proliferation, and apoptotic programs. Activated Notch cleavage by TACE and presenilin dependent gamma-secretase releases the intracellular domain to form a transcription complex with RBP-J kappa to activate enhancer of split genes. NOTCH1 interacts with DTX1 and DTX2 and may regulate thymic lymphocyte maturation. (NCI)',3624640,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HEY1 (hairy/enhancer-of-split related with YRPW motif 1, HERP2, HESR1, HESR-1, HRT-1, CHF2, CHF-2, BHLHb31)','Hairy/Enhancer-of-Split Related with YRPW Motif Protein 1','Hairy/enhancer-of-split related with YRPW motif protein 1 (304 aa, ~33 kDa) is encoded by the human HEY1 gene. This protein is involved in dimerization with transcription factors to suppress transcription.',3624642,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ADRB1 (ADRB1R, adrenoceptor beta 1)','ADRB1 Gene','This gene plays a role in neuronal G protein-coupled receptor signal transduction that modulates the physiological effects of epinephrine and norepinephrine.',3625298,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CREB1 (cAMP responsive element binding protein 1)','Cyclic AMP-Responsive Element-Binding Protein 1','Cyclic AMP-responsive element-binding protein 1 (341 aa, ~37 kDa) is encoded by the human CREB1 gene. This protein plays a role in transcriptional regulation.',3625300,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SDC4 (amphiglycan, ryudocan, SYND4, syndecan 4)','Syndecan-4','Syndecan-4 (198 aa, ~22 kDa) is encoded by the human SDC4 gene. This protein is involved in cell surface localization of heparan sulfate.',3625302,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PITX2 (paired-like homeodomain 2, RS, RIEG1, RIEG, RGS, Otlx2, IRID2, IHG2, IGDS, Brx1, ARP1)','PITX2 Gene','This gene is involved in both the development of the pancreas and transcriptional regulation.',3625304,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MBL var','Genetic Variation Mannose-Binding Lectin','The phenotypic differences among individuals in a population: A recombinant protein similar or identical to human mannan-binding lectin (MBL) with opsonin activity. MBL, a soluble pattern recognition receptor (PRR) collectin in the C-type lectin superfamily, is a plasma protein that plays an important role in innate immunity; MBL contains a carbohydrate recognition domain at one end and a collagen-like stalk domain at the other. Upon MBL binding to mannose residues on mannose-containing polysaccharides (mannans) on the surfaces of microorganisms, activation of the complement system results in the deposition of complement components (opsonization) and the clearance of the opsonized microorganisms by phagocytic cells. MBL is part of the mannan-binding lectin pathway (also known as the Ali/Krueger pathway), which has similarities to the classical complement pathway in that activation of C4 and C2 produce activated complement proteins further down the complement cascade. However, unlike the classical complement pathway, activation of this pathway is not antibody dependent.',3625306,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('F5 (coagulation factor V (proaccelerin, labile factor)','F5 Gene','This gene plays a role in coagulation.',3625558,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('F2 (coagulation factor II (thrombin)','F2 Gene','This gene plays a role in the coagulation cascade.',3625560,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ELN (elastin, WS, WBS, SVAS)','Elastin','Elastin (786 aa, ~68 kDa) is encoded by the human ELN gene. This protein is involved in the elasticity of the extracellular matrix.',3625562,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('COMT (catechol-O-methyltransferase)','Catechol O-Methyltransferase','Catechol O-methyltransferase (271 aa, ~30 kDa) is encoded by the human COMT gene. This protein is involved in the metabolism of neurotransmitters.',3625564,'ACTIVE');
