INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ADRB2 (adrenoceptor beta 2, surface; BAR, B2AR, ADRBR, ADRB2R)','Beta-2-Adrenergic Receptor','Beta 2 adrenergic receptor (413 aa, 47 kD) is a cell communication protein that is encoded by the human ADRB2 gene and has roles in endosome to lysosome transport and signal transduction.',3625574,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('LDLR (low density lipoprotein receptor)','Low Density Lipoprotein Receptor','The low density lipoprotein receptor (LDLR) gene family consists of cell surface proteins involved in receptor-mediated endocytosis of specific ligands. Low density lipoprotein (LDL) is normally bound at the cell membrane and taken into the cell ending up in lysosomes where the protein is degraded and the cholesterol is made available for repression of microsomal enzyme 3-hydroxy-3-methylglutaryl coenzyme A (HMG CoA) reductase, the rate-limiting step in cholesterol synthesis. At the same time, a reciprocal stimulation of cholesterol ester synthesis takes place. Mutations in this gene cause the autosomal dominant disorder, familial hypercholesterolemia. (LocusLink)',3625802,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ITPKC (inositol-trisphosphate 3-kinase C, IP3KC, IP3-3KC)','ITPKC gene','No Value Exists',3625804,'ACTIVE');
