INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Resveratrol','Resveratrol','A phytoalexin derived from grapes and other food products with antioxidant and potential chemopreventive activities. Resveratrol induces phase II drug-metabolizing enzymes (anti-initiation activity); mediates anti-inflammatory effects and inhibits cyclooxygenase and hydroperoxidase functions (anti-promotion activity); and induces promyelocytic leukemia cell differentiation (anti-progression activity), thereby exhibiting activities in three major steps of carcinogenesis. This agent may inhibit TNF-induced activation of NF-kappaB in a dose- and time-dependent manner. (NCI05)',3630009,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Anti-Hairy Cell Leukemia Antibody (DBA.44)','Anti-Hairy Cell Leukemia antibody (DBA.44, ab779)','Anti-Hairy Cell Leukemia antibody (DBA.44, ab779)',3630010,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PRDM1 (PR domain containing 1, with ZNF domain; PRD1-BFI, BLIMP1)','PRDM1 Gene','This gene is involved in repression of transcription. It plays a role in the formation of pre-plasma memory B cells and immunoglobulin-secreting plasma cells.',3630038,'ACTIVE');
