INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PCSK1 (proprotein convertase subtilisin/kexin type 1, SPC3, PC3, PC1, NEC1)','PCSK1 gene','No Value Exists',3630150,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ECT2 (epithelial cell transforming sequence 2 oncogene, ARHGEF31)','ECT2 Gene','This gene plays a role in both GTPase-mediated signaling and cellular stress responses.',3630189,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ACVRL1 (activin A receptor type II-like 1, ORW2, HHT2, HHT, ALK1, ACVRLK1)','ACVRL1 Gene','This gene is involved in the mediation of cell-surface receptor interactions for the TGF-beta superfamily of ligands.',3630216,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ALDH1A2 (aldehyde dehydrogenase 1 family, member A2; RALDH2)','Retinal Dehydrogenase 2','Encoded by human ALDH1A2 Gene, Aldehyde Dehydrogenase 1A2 (ADH Family) is a 499-amino acid 54.8 kD putative cytoplasmic homotetrameric NAD-dependent retinaldehyde dehydrogenase, similar to class 1 aldehyde dehydrogenases that synthesizes retinoic acid from retinaldehyde.  The protein contains conserved aldehyde dehydrogenase motifs: GXGXXXG motif NAD-binding domain, two peptide motifs, and cys301, critical for aldehyde group interaction.  ALDH1A2 and CYP26A1 regulate local retinoic acid levels that act as a signal in developing and adult tissues; CYP26A1 metabolizes retinoic acid.  In T-ALL, ectopically expressed TAL1 and LMO in T cells form a complex with GATA3 on the RALDH2-T promoter and activate transcription.  (OMIM, Swiss-Prot, and NCI)',3630218,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome 15q26','15q26','A chromosome band present on 15q',3630252,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Telomeric Allelic Imbalance Regions (NtAI)','Telomere Allele Protein Domain','The terminal end of a chromosome arm which has a specialized structure and which is involved in chromosomal replication and stability. Its length is believed to be a few hundred base pairs. Telomeres undergo dramatic changes during the progression of cancer.: one of a series of possible alternative forms of a given gene, differing in DNA sequence, and affecting the functioning of a single product.: A protein domain is a structurally and functionally defined protein region. (from http://www.ddmag.com)',3630253,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ARAF (v-raf murine sarcoma 3611 viral oncogene homolog, ARAF1)','ARAF Gene','This gene plays a role in signal transduction and the cellular response to mitogens.',3630255,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FANCI (Fanconi anemia, complementation group I, FLJ10719, KIAA1794)','FANCI protein, human','No Value Exists',3630279,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BLM(Bloom syndrome, RecQ helicase-like; BS, RECQ2, RECQL3)','BLM Gene','This gene plays a role in DNA unwinding and recombination-mediated telomere lengthening.',3630281,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome 8q22','8q22','A chromosome band present on 8q',3630283,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TBX (Thromboxane)','Thromboxane','Physiologically active compounds found in many organs of the body. They are formed in vivo from the prostaglandin endoperoxides and cause platelet aggregation, contraction of arteries, and other biological effects. Thromboxanes are important mediators of the actions of polyunsaturated fatty acids transformed by cyclooxygenase.',3630876,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome 8q amplification','Gene Amplification Technique Chromosome 8q','This technique refers to selectively replicate DNA sequence of interest to multiple extra copies that meet the need of research or health care activity. Polymerase chain reaction (PCR), can be considered a type of man-made gene amplification process.: One of the bodies (normally 46 in humans) in the cell nucleus that is the bearer of genes, has the form of a delicate chromatin filament during interphase, contracts to form a compact cylinder segmented into two arms by the centromere during metaphase and anaphase stages of cell division, and is capable of reproducing its physical and chemical structure through successive cell divisions. In microbes, the chromosome is prokaryotic, not being enclosed within a nuclear membrane and not being subject to a mitotic mechanism.: Distal (long) arm of chromosome 8',3630878,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Monosomy  Chromosome 3','Monosomy Chromosome 3','The condition in which one chromosome of a pair is missing. In a normally diploid cell it is represented symbolically as 2N-1.: The designation for each member of the third largest human autosomal chromosome pair. Chromosome 3 spans almost 200 million base pairs and represents about 6.5% of the total DNA in normal diploid cells.',3630879,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MIF (macrophage migration inhibitory factor (glycosylation-inhibiting factor), GLIF, GIF)','Macrophage Migration Inhibitory Factor','This protein is a lymphokine involved in cell-mediated immunity, immunoregulation, and inflammation. It plays a role in the regulation of macrophage function in host defense through the suppression of anti-inflammatory effects of glucocorticoids. This lymphokine and the JAB1 protein form a complex in the cytosol near the peripheral plasma membrane, which may indicate an additional role in integrin signaling pathways. (from Locuslink)',3630881,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FASLG (Fas ligand (TNF superfamily, member 6), TNFSF6, FasL, CD178, APT1LG1)','FASLG protein,human','No Value Exists',3630883,'ACTIVE');
