INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PML (promyelocytic leukemia, RNF71, TRIM19, MYL)','PML Gene','This gene plays a role in tumor suppression and is involved in the regulation of p53 in response to oncogenic signal transduction.',3630995,'ACTIVE');
