INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TAP2 (transporter 2, ATP-binding cassette, sub-family B (MDR/TAP); RING11, PSF2, D6S217E, ABCB3)','Transporter 2, ATP-Binding Cassette,Sub-Family B','Transporter 2, ATP-Binding Cassette, Sub-Family B (MDR/TAP), encoded by the TAP2 gene, is a member of the superfamily of ATP-binding cassette (ABC) transporters. Being a member of the MDR/TAP subfamily and a subunit of the heterodimeric TAP1/TAP2 complex (TAP), this protein is involved in antigen processing. TAP transports peptides from the cytoplasm to the endoplasmic reticulum for assembly of MHC class I molecules. Loss of TAP function occurs more often in metastatic than in primary tumors. Mutations in this gene may be associated with ankylosing spondylitis, insulin-dependent diabetes mellitus, and celiac disease. Alternative splicing of this gene produces two products which differ in peptide selectivity and level of restoration of surface expression of MHC class I molecules. (From LocusLink 6891, PMID 11773612 and NCI)',3636072,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TAP1 (transporter 1, ATP-binding cassette, sub-family B (MDR/TAP); RING4, PSF1, D6S114E, ABCB2)','Transporter 1, ATP-Binding Cassette, Sub-Family B','Transporter 1, ATP-Binding Cassette, Sub-Family B (MDR/TAP), encoded by the TAP1 gene, is a member of the superfamily of ATP-binding cassette (ABC) transporters. Being a member of the MDR/TAP subfamily and a subunit of the heterodimeric TAP1/TAP2 complex (TAP), this protein is involved in antigen processing. TAP transports peptides from the cytoplasm to the endoplasmic reticulum for assembly of MHC class I molecules. Loss of TAP function occurs more often in metastatic than in primary tumors. Loss of TAP1 expression may enhance tumor growth by enabling them to escape T-cell recognition during the effector phase of an antitumor immune response in immunized mice. However, it does not change the immunogenicity of tumor cells in the priming phase. Mutations in the TAP1 gene may be associated with ankylosing spondylitis, insulin-dependent diabetes mellitus, and celiac disease. (From LocusLink 6890, PMID 12019164 and NCI)',3636074,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CST3 (cystatin C)','Cystatin-C','Cystatin-C (146 aa, ~16 kDa) is encoded by the human CST3 gene.  This protein is involved in the inhibition of cysteine proteinases.',3636075,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CSTB (cystatin B (stefin B); EPM1, PME, STFB, CST6)','Cystatin B','An intracellular cystatin subtype that is found in a broad variety of cell types. It is a cytosolic enzyme inhibitor that protects the cell against the proteolytic action of lysosomal enzymes such as CATHEPSINS.',3636077,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CSTA (cystatin A (stefin A); STF1, STFA)','Cystatin A','A cytastin subtype found at high levels in the SKIN and in BLOOD CELLS. Cystatin A incorporates into the cornified cell envelope of stratified squamous epithelial cells and may play a role in bacteriostatic properties of skin.',3636079,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CTSH (cathepsin H, CPSB, ACC-5, ACC-4)','Cathepsin H','Pro-cathepsin H (335 aa, ~37 kDa) is encoded by the human CTSH gene. This protein plays a role in both degradation of proteins in the lysosome and antigen processing.',3636081,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Nuclear Factor NF-kappa B p60 Subunit','NF-kappa B p60 Subunit','NF-kappa B p60 Subunit',3636094,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Nuclear Factor NF-kappa B p50 Subunit','NF-kappa B p50 Subunit','A component of NF-kappa B transcription factor. It is proteolytically processed from NF-kappa B p105 precursor protein and is capable of forming dimeric complexes with itself or with TRANSCRIPTION FACTOR RELA. It regulates expression of GENES involved in immune and inflammatory responses.',3636096,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TRAP1 (TNF receptor-associated protein 1, HSP90L, HSP75)','TRAP1 protein, human','No Value Exists',3636098,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BIRC3 (baculoviral IAP repeat containing 3, c-IAP2, cIAP2, IAP-1, hiap-1, MALT2, MIHC, RNF49, API2)','Baculoviral IAP Repeat-Containing Protein 3','Baculoviral IAP repeat-containing protein 3 (604 aa, ~68 kDa) is encoded by the human BIRC3 gene. This protein is involved in the inhibition of apoptosis.',3636100,'ACTIVE');
