INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('t(21;22)','t(21,22)(ERG,EWSR1) gene translocation','No Value Exists',3636104,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('t(11;22)','t(11,22)(WT1,EWSR1) gene translocation','No Value Exists',3636106,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Melanoma antigen NA17','NA17-A Antigen','A specific melanoma antigen protein derived from a patient (NA17) with cutaneous melanoma metastases. When administered in a vaccine formulation, NA17-A antigen may stimulate a cytotoxic T lymphocyte (CTL) response against tumors that express this antigen, which may result in a reduction in tumor size. The NA17-A antigen is part of the enzyme N-acetyl glucosaminyltransferase V (GnT-V). Approximately half of melanomas have been found to express significant levels of this atypical protein, which is not expressed by normal tissues.',3636108,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome 19q','19q','Distal (long) arm of chromosome 19',3636137,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome 7','Chromosome 7','The designation for each member of the seventh largest human autosomal chromosome pair. Chromosome 7 spans more than 158 million base pairs and represents between 5 and 5.5% of the total DNA in normal diploid cells.',3636138,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome 22','Chromosome 22','The designation for each member of the smallest human autosomal chromosome pair. Chromosome 22 spans about 49 million base pairs and represents between 1.5 and 2% of the total DNA in normal diploid cells.',3636139,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome 13','Chromosome 13','The designation for each member of the thirteenth largest human autosomal chromosome pair. Chromosome 13 spans about 113 million base pairs and represents between 3.5 and 4% of the total DNA in normal diploid cells.',3636140,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome 10','Chromosome 10','The designation for each member of the tenth largest human autosomal chromosome pair. Chromosome 10 spans about 135 million base pairs and represents between 4 and 4.5% of the total DNA in normal diploid cells.',3636141,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome 9p','9p','Proximal (short) arm of chromosome 9',3636142,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NNN (N-nitrosonornicotine)','Nitrosonornicotine','A yellow, oily liquid nitrosamine that solidifies at cold temperatures and emits toxic fumes of nitrogen oxides when heated to decomposition. Nitrosonornicotine is found in tobacco products and is likely produced by the nitrosation of nicotine during the making and smoking of tobacco products. This substance is only used in research to induce tumors in experimental animals. Exposure to nitrosonornicotine affects the liver and nitrosonornicotine is reasonably anticipated to be a human carcinogen. (NCI05)',3636144,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NNAL (4-(n-nitrosomethylamino)-1-(3-pyridyl)-1-butanone)','4-(n-nitrosomethylamino)-1-(3-pyridyl)-1-butanone','4-(n-nitrosomethylamino)-1-(3-pyridyl)-1-butanone',3636145,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Nicotine','Nicotine','An addictive CNS stimulant found in the tobacco plant that causes either ganglionic stimulation by depolarization in low doses or ganglionic blockage in high doses. (NCI)',3636146,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DRG1 (developmentally regulated GTP binding protein 1, NEDD3)','developmentally regulated GTP-binding protein','No Value Exists',3636148,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FGF1 (fibroblast growth factor 1 (acidic), HBGF1, GLIO703, FGFA, FGF-alpha, ECGFB, ECGFA, ECGF-beta, ECGF, AFGF)','Fibroblast Growth Factor 1','A modifier of endothelial cell migration and proliferation, Fibroblast Growth Factor 1 may be important in neovascularization.  Acidic Fibroblast Growth Factor and alpha-ECGF are derived from FGF1 by posttranslational processing.  FGF1 causes the foregut endoderm to develop into the liver.  The hepatogenic response is restricted to endoderm tissue, which selectively co-expresses FGF receptors 1 and 4.  Different FGF signals appear to initiate distinct phases of liver development during mammalian organogenesis.  FGF1 binding to FGFR2 is accompanied by binding of a heparin decasaccharide.  (from OMIM 131220 and NCI)',3636150,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NMP22 (NMP-22)','Reagents, Immunoassay,Tumor Marker, Protein, Nuclear Matrix Protein (NMP22)','Immunoassay reagents intended to perform qualitative and/or quantitative analyses on a body fluid sample (typically urine) to determine nuclear mitotic apparatus protein (NMP), a protein that makes up the internal structure of the nucleus (i.e., a nuclear matrix protein) and is usually known as NMP22. Increased levels of NMP22 are found in urine of patients with transitional cell carcinoma of the urinary tract.',3636159,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GST (Glutathione S-Transferase)','Glutathione S-Transferase','A class of enzymes that catalyze the reaction of glutathione with an acceptor molecule (an arene oxide) to form an S-substituted glutathione; a key step in detoxification of many substances; start of the mercapturic acid pathway.',3636161,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AGP (Alpha-1-acid glycoprotein)','Alpha-1-acid glycoprotein','Alpha-1-acid glycoprotein',3636162,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Procaspase-9 (Procaspase 9)','Procaspase-9','Procaspase-9',3636163,'ACTIVE');
