INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD59 (CD59 molecule, complement regulatory protein; p18-20, MSK21, MIN3, MIN2, MIN1, MIC11, G344, EL32, EJ30, EJ16, 16.3A5)','CD59 Glycoprotein','CD59 glycoprotein (128 aa, ~14 kDa) is encoded by the human CD59 gene. This protein is involved in the inhibition of the assembly of the membrane attack complex in the complement cascade.',3636166,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD55 (CD55 molecule, decay accelerating factor for complement (Cromer blood group); CR, CROM, DAF, TC)','Complement Decay-Accelerating Factor','Complement decay-accelerating factor (381 aa, ~41 kDa) is encoded by the human CD55 gene. This protein plays a role in the negative regulation of the complement cascade.',3636167,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CD46 (CD46 molecule, complement regulatory protein; MCP, MGC26544, MIC10, TLX, TRA2.10)','CD46 protein, human','No Value Exists',3636169,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome Y','Chromosome Y','The male sex chromosome, being the differential sex chromosome carried by half the male gametes and none of the female gametes in man and in some other male-heterogametic species in which the homologue of the X chromosome has been retained.',3636170,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Chromosome X','Chromosome X','The female sex chromosome, being the differential sex chromosome carried by half the male gametes and all female gametes in man and other male-heterogametic species.',3636171,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CASP3 (caspase 3, apoptosis-related cysteine peptidase; Yama, CPP32B, CPP32, apopain)','CASP3 Gene','This gene plays a role in the execution phase of apoptosis and is involved in DNA repair.',3636178,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('RHOB (ras homolog family member B, RhoB, RHOH6, MST081, ARHB, ARH6)','RHOB Gene','This gene plays a role in signal transduction. It is involved in several cellular functions including cell adhesion, differentiation and motility.',3637800,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Prelamin A','prelamin A','No Value Exists',3637802,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DNAJA1 (DnaJ (Hsp40) homolog, subfamily A, member 1; hdj-2, HSJ2, HSPF4, NEDD7, dj-2)','DNAJA1 protein,human','No Value Exists',3637804,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BTA Stat','BTA (Bladder Tumor Antigen) Determination Reagents','No Value Exists',3637806,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('FB1 (Fumonisin B1)','Fumonisin B1','A mycotoxin produced by Fusarium moniliforme.  It is a contaminant of cereals, especially corn.  It has been epidemiologically linked to high incidence of human esophageal cancer in South Africa and China and to hepatocarcinogenesis in animal models.',3637843,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('AFB1 (Aflatoxin B1)','Aflatoxin B1','A potent hepatotoxic and hepatocarcinogenic mycotoxin produced by the Aspergillus flavus group of fungi. It is also mutagenic, teratogenic, and causes immunosuppression in animals. It is found as a contaminant in peanuts, cottonseed meal, corn, and other grains. The mycotoxin requires epoxidation to aflatoxin B1 2,3-oxide for activation. Microsomal monooxygenases biotransform the toxin to the less toxic metabolites aflatoxin M1 and Q1.',3637845,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ID4 (inhibitor of DNA binding 4, dominant negative helix-loop-helix protein; bHLHb27)','ID4 protein, human','No Value Exists',3637847,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TWIST2 (twist homolog 2 (Drosophila), DERM01, Dermo-1, bHLHa39)','TWIST2 protein, human','No Value Exists',3637849,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('XRCC3 (X-Ray Repair Complementing Defective Repair in Chinese Hamster Cells 3, CMM6, DNA Repair Protein XRCC3, X-Ray-Repair, Complementing Defective, Repair In Chinese Hamster, 3, X-Ray Repair Cross Complementing Protein 3,','XRCC3 Gene','This gene plays a role in recombination and in the maintenance of DNA integrity.',3637851,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HLA-A11','HLA-A11','No Value Exists',3637853,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HLA-B44','HLA-B44','No Value Exists',3637855,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HLA-A3','HLA-A3 Antigen','Human histocompatibility (HLA) surface antigen encoded by the A locus on chromosome 6. The allele occurs with increased frequency in individuals with idiopathic hemochromatosis. HLA-A3 is in linkage disequilibrium with HLA-B7 and HLA-DR2.',3637857,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NAT2 (N-acetyltransferase 2 (arylamine N-acetyltransferase), AAC2)','Arylamine N-acetyltransferase','Wide specificity for aromatic amines, including serotonin; also catalyses acetyl-transfer between arylamines without CoA. [EC 2.3.1.5 created 1961] (from IUBMB)',3637858,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('SULT1A1 (sulfotransferase family, cytosolic, 1A, phenol-preferring, member 1; SPT1, STP, P-PST)','SULT1A1 protein, human','No Value Exists',3637860,'ACTIVE');
