INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('R2 subunit of ribonucleotide reductase','ribonucleotide reductase R2 subunit','No Value Exists',3637863,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('MAL (mal, T-cell differentiation protein)','MAL protein, T-cell','No Value Exists',3638059,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('KIAA1549-BRAF Fusion mutation','Mutation Abnormality KIAA1549/BRAF Fusion Gene','A general term referring to single or multiple alterations in the genetic material of an organism that ranges from a single base change in a gene to the loss or addition of complete chromosomes. A mutation abnormality may be heritable or occur somatically.: A fusion gene that results from a tandem duplication of approximately 2 Mb at 7q34 which fuses exon 15 or 16 of the KIAA1549 gene to exon 9 or 11 of the BRAF gene. This fusion is associated with pilocytic astrocytoma.',3638061,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BARD1 (BRCA1 associated RING domain 1)','BRCA1-Associated RING Domain Protein 1','BRCA1-associated RING domain protein 1 (777 aa, ~87 kDa) is encoded by the human BARD1 gene. This protein plays a role in cell cycle progression, DNA damage repair, ubiquitination and transcriptional regulation.',3638063,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('HGVAC (HGF activator, HGFAP, HGFA)','HGF activator','No Value Exists',3638065,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Fetal hemoglobin (Hb F)','Hemoglobin F Measurement','The determination of the amount of hemoglobin F present in a sample.',3638066,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CASP8 (caspase 8, apoptosis-related cysteine peptidase; MACH, MCH5, FLICE, Casp-8)','Caspase-8','Caspase-8 (479 aa, ~55 kDa) is encoded by the human CASP8 gene. This protein plays a role in proteolysis, angiogenesis and caspase-induction of apoptosis.',3638068,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('CFLAR (CASP8 and FADD-like apoptosis regulator, MRIT, I-FLICE, FLAME, FLIP, CLARP, Caster, CASP8AP1, CASH, c-FLIP)','CFLAR Gene','This gene plays a role in the regulation of both proteolysis and apoptosis.',3638070,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('PRMT5 (protein arginine methyltransferase 5, SKB1, SKB1Hs, HRMT1L5)','PRMT5 protein, human','No Value Exists',3638072,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('DNMT3B (DNA (cytosine-5-)-methyltransferase 3 beta)','DNA (Cytosine-5-)-Methyltransferase 3B','DNA (cytosine-5)-methyltransferase 3B (853 aa, ~96 kDa) is encoded by the human DNMT3B gene. This protein is involved in DNA methylation.',3638074,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ST7 (suppression of tumorigenicity 7, TSG7, SEN4, RAY1, HELG, FAM4A1, FAM4A, ETS7q)','Suppressor of Tumorigenicity 7 Protein','Suppressor of tumorigenicity 7 protein (585 aa, ~67 kDa) is encoded by the human ST7 gene. This protein may be involved in both autism and tumor suppression.',3638076,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('EPA (Eicosapentaenoic Acid )','Eicosapentaenoic Acid','An essential, polyunsaturated, 20-carbon omega-3 fatty acid with anti-inflammatory and potential antineoplastic and chemopreventive activities. Eicosapentaenoic acid (EPA) may activate caspase 3, resulting in apoptosis in susceptible tumor cell populations. In addition, this agent may inhibit cyclooxygenase-2 (COX-2), resulting in inhibition of prostaglandin synthesis and prostaglandin-mediated inflammatory processes.',3638077,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL15RA (interleukin 15 receptor, alpha; IL-15RA, CD215)','Interleukin-15 Receptor Alpha','Interleukin-15 Receptor',3646420,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TAL1 (T-Cell Acute Lymphocytic Leukemia 1, TCL5, SCL, Class A Basic Helix-Loop-Helix Protein 17, SCL Transcription Factor, Stem Cell Leukemia Hematopoietic Transcription Factor, Stem Cell Protein, T-Cell Acute Lymphocytic Leukemia 1 Protein, T-Cell Acute','TAL1 Gene','This gene plays a role in regulation of transcription and cell organization. It is involved in both embryonic hematopoiesis and adult erythropoiesis.',3647996,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('BMP3 (Bone Morphogenetic Protein 3, Osteogenin,  BMP-3, BMP-3A)','BMP3 Gene','This gene is involved in bone and cartilage formation. It plays a role in the negative regulation of bone density.',3647998,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('NRP2 (Neuropilin 2, MGC126574, PRO2714, VEGF165R2, NP2, NPN2, Vascular Endothelial Cell Growth Factor 165 Receptor 2)','NRP2 Gene','This gene plays a role in both ligand binding and signal transduction.',3648000,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('TAC1 (Tachykinin, Precursor 1 (Substance K, Substance P, Neurokinin 1, Neurokinin 2, Neuromedin L, Neurokinin alpha, Neuropeptide K, Neuropeptide gamma), NK2, NKA, NKNA, TAC1, TAC2, Neurokinin A, Protachykinin-1, PPT)','TAC1 Gene','This gene plays a role in the induction of behavioral responses and in vasodilation.',3648012,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Serum rhIL15','Serum rhIL15','The clear liquid part of the blood that remains after blood cells and clotting proteins have been removed.: A recombinant agent that is chemically identical or similar to the endogenous cytokine interleukin-15 (IL-15) with immunomodulating activity. IL-15, secreted by mononuclear phagocytes (and some other cell types) following viral infection, regulates T and natural killer cell activation and proliferation. This cytokine induces activation of transcription activators STAT3, STAT5, and STAT6 via JAK kinase signal transduction pathways in mast cells, T cells, and dendritic epidermal T cells. IL-15 and interleukin-2 (IL-2) are structurally similar and share many biological activities; both may bind to common hematopoietin receptor subunits, negatively regulating each others activity. CD8+ memory T cell number has been shown to be regulated by a balance between IL-15 and IL-2.',3649339,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('IL15 Antibodies','IL15 Antibody levels','(AN-tih-BOD-ee) A type of protein made by certain white blood cells in response to a foreign substance (antigen). Each antibody can bind to only a specific antigen. The purpose of this binding is to help destroy the antigen. Antibodies can work in several ways, depending on the nature of the antigen. Some antibodies destroy antigens directly. Others make it easier for white blood cells to destroy the antigen.: Interleukin-15, encoded by the IL15 gene, is a cytokine that regulates T and natural killer cell activation and proliferation. This cytokine and interleukin 2 share many biological activities. They are found to bind common hematopoietin receptor subunits, and may compete for the same receptor, and thus negatively regulate each others activity. The number of CD8+ memory cells is controlled by a balance between this cytokine and IL2. This cytokine induces the activation of JAK kinases, as well as the phosphorylation and activation of transcription activators STAT3, STAT5, and STAT6. Three alternatively spliced transcript variants of this gene encoding two distinct isoforms have been reported. (From LocusLink)',3649340,'ACTIVE');
INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('ABCC5 (ATP-Binding Cassette, Sub-Family C (CFTR/MRP), Member 5, MRP5, SMRP, ABC33, MOATC, MOAT-C, pABC11, EST277145, ATP-Binding Cassette Sub-Family C Member 5, Multi-Specific Organic Anion Transporter C)','ABCC5 Gene','This gene plays a role in the transport of organic anions and nucleotides.',3649370,'ACTIVE');
