INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Memory T Cells (Memory T-Lymphocyte, Memory T Cell, Memory T Lymphocyte, Memory T-Cell)','Memory T-Lymphocyte','A mature T-lymphocyte that has encountered its cognate antigen and is primed to reproduce and elicit a stronger immune response upon a second encounter with the antigen. These cells are characterized by the presence CD45R0.',3651037,'ACTIVE');
