INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Ganglioside GQ (GQ Ganglioside; A2B5; A2B5 Antigen)','Ganglioside GQ','A sialoglycosphingolipid that is a branched nonasaccharide containing five sialyl residues, two galactose residues, one N-acetylgalactosamine residue and a glucose residue. This ceramide is found associated with the surface of the plasma membrane in developing thymic epithelial cells, oligodendrocyte progenitors, neuroendocrine cells, neurons and neuroblastoma cells.',3685449,'ACTIVE');
