INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('tBID (Truncated BH3-Interacting Domain Death Agonist; Truncated BID; p15; p13; p11)','Truncated BID','Truncated BID is encoded by the human BID gene and is a C-terminal peptide that results from caspase-8 cleavage of the BH3-interacting domain death agonist protein. This protein fragment localizes with the mitochondrial membrane and can stimulate the release of cytochrome c and promote the progression of apoptosis.',3685454,'ACTIVE');
