INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('GM2 ganglioside (GM2; G(M2) Ganglioside; Tay-Sachs ganglioside; &#946;-D-GalNAc-(1&#8594;4)-[&#945;-Neu5Ac-(2&#8594;3)]-&#946;-D-Gal-(1&#8594;4)-&#946;-D-Glc-(1&#8596;1)-N-octadecanoylsphingosine)','Ganglioside GM2','A glycosphingolipid antigen expressed by a variety of human cancer cells. GM2 containing vaccines have been shown to elicit antibodies production in melanoma patients without deleterious effects associated with an immune response to GM2. Mutations in at least 1 of 3 recessive genes: HEXA, HEXB, and GM2A cause defects in GM2 catabolism, leading to lysosomal lipid storage disorders that manifest primarily as neurodegenerative diseases, including Tay-Sachs and Sandhoff Disease.',3685470,'ACTIVE');
