INSERT INTO PLANNED_MARKER_SYNC_CADSR(NAME, MEANING, DESCRIPTION, caDSRId, STATUS_CODE) VALUES ('Cytokine expression profile','Cytokine Proteomic Profile','Cytokines are a unique family of growth factors. Secreted primarily from leukocytes, cytokines stimulate both the humoral and cellular immune responses, as well as the activation of phagocytic cells. Cytokines that are secreted from lymphocytes are termed lymphokines, whereas those secreted by monocytes or macrophages are termed monokines. A large family of cytokines are produced by various cells of the body. Many of the lymphokines are also known as interleukins (ILs), since they are not only secreted by leukocytes but also able to affect the cellular responses of leukocytes. Specifically, interleukins are growth factors targeted to cells of hematopoietic origin. (http://indstate.edu/thcme/mwking/growth-factors): A data set that both identifies all the proteins and quantifies the levels of their expression in a biological sample or specimen.',3685543,'ACTIVE');
